var book = {
	"name": "၂ စဎွၩ",
	"numChapters": 25,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> တၭစအၫဟၭၥံၫဝ့ၫအလးခဲၫ့နီၪ မိအၭပိၩ့ထၪ့အံၫ စရ့လၭလီၫ.",
			"2": "<sup>2</sup> တၭစအၫဟဇဲအၫလၩ့ထ့ၬ လၧဆၧဖိးလၧဒူၭလၧ ထၭလခီၫလဒူၭ လၧစမ့ရအၫ အဖၧၩ့နီၪ,ဆၫထၪ့ဝ့ၫ တၭ,အၪ့မၧၫ့လၩ့အၥီၫ့လဖၪတၭ, စံၭဝ့ၫ,ယမိဘျၪဒံၭ လၧဆၧဆၫယီၩဧၪ, လ့ၩအၪ့စၪ့လၧအ့ၭကြၧၫ့အယွၩ",
			"3": "<sup>3</sup> ဘၫအလၭဇံဘၧၭနီၪဆံၭ.- ယဟိဝၩအၥီၫ့စံၭၦတံၡ ဘၭဖိၪစအံၫလဲယၫ, ဂဲထုၪ့, လ့ၩထၪ့ဆီးစမ့ရအၫအ စဎွၩအၥီၫ့လဖၪဘီၪ, စံၭအဝ့ၫၥံၪ, မွဲယွၩလအီၪဘၪ လၧအံၫစရ့လၭအဖၧၩ့အကၠီၩ့တၭ, နၥံၪလ့ၩအၪ့စၪ့ ဆၧလၧအ့ၭကြၧၫ့အယွၩ ဘၫအလၭဇံဘၧၭနီၪ, လမွဲ",
			"4": "<sup>4</sup> ဘၪဧၪ.- မၩအၥၭဘဲၫနီၪတၭ ယဟိဝၩစံၭဘဲၫယီၩ,န မိစဲၪ့လၩ့ဘၪလၧလးမံၫလၧ နလ့ၩထၪ့လၧအဖၫ့ခိၪအ့ၬ, နမိၥံၫတၡါလီၫ. တၭစအံၫလဲယၫစဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ.",
			"5": "<sup>5</sup> အၥီၫ့လဖၪဂဲၫထဲၩ့ကဒၩထဲၩ့ လၧအအီၪတၭ, အဆၧ စံၭအဝ့ၫၥံၪ, ဘိၩ့နဲၪ့ယီၩနၥံၪဂဲၫထဲၩ့ကဒၩထဲၩ့မွဲဘၪ",
			"6": "<sup>6</sup> လဲၪ.- အဝ့ၫၥံၪစံၭ, ၦၡၩဂဲၫထၪ့ဆီးပၧၩလဂၩတၭ, စံၭ ပၧၩ,လ့ၩဆၧ, ထဲၩ့ကဒၩထဲၩ့လၧစဎွၩ လၧအအၪ့မၧၫ့ လၩ့နၥံၪတၭ, စံၭအဝ့ၫ, ယဟိဝၩစံၭဘဲၫယီၩ. မွဲယွၩ လအီၪဘၪလၧအံၫစရ့လၭ အဖၧၩ့အကၠီၩ့တၭ, နအၪ့ မၧၫ့လၩ့ဆၧအၪ့စၪ့လၧအ့ၭကြၧၫ့အယွၩ ဘၫအလၭဇံ ဘၧၭနီၪလမွဲဘၪဧၪ. မၩအၥၭဘဲၫနီၪတၭနမိစဲၪ့လၩ့ ဘၪလၧလးမံၫလၧနလ့ၩထၪ့လၧအဖၫ့ခိၪအ့ၬ. တၭန",
			"7": "<sup>7</sup> မိၥံၫတၡါလီၫ.- တၭအဆၧစံၭဝ့ၫ, ၦလၧအဂဲၫထၪ့ဆီး နၥံၪတၭ,စံၭနၥံၪလၧဆၧချဲၩ့နီၪ, မွဲအမၩအၥၭဘဲၫၥ့ၪ",
			"8": "<sup>8</sup> လဲၪ.- တၭအဝ့ၫၥံၪစံၭဝ့ၫဒၪ, မွဲၦအီၪလၧအဆီၪ့အၪ အၪလ့ၬတၭ, ခဲးထူၬအယးဒံၩ့လၧအခၧၩ့ယးဆၧဖံၭ လီၫ.တၭအဆၧစံၭဝ့ၫဒၪ, မွဲဝ့ၫလၧၦတံၡဘၭဖိၪစအံၫ လဲယၫလီၫ.",
			"9": "<sup>9</sup> ထီးနီၪလဖၧၫ့စဎွၩအၪ့မၧၫ့လၩ့ ၦယဲဆံၫအခိၪအီၪ လၧအၡၩယဲဆံၫအီၪလၧအဝ့ၫဒၪအအီၪလီၫ. လ့ၩဝ့ၫ လၧအအီၪတၭ, ယိခွါ, အဆၧဆၧၫ့နၩ့ဝ့ၫလၧခိၪလီၩ့ ဒၩ့ခိၪတၭ, စံၭဝ့ၫ, ယွၩအၡၩလဂၩဧ့, စဎွၩစံၭဝ့ၫဒၪ,",
			"10": "<sup>10</sup> ဂဲၫလၩ့ဆံၭ.- စအံၫလဲယၫစံၭဆၧၫ့ဆၧတၭ, စံၭၦယဲ ဆံၫအခိၪ, ယအ့ၪမွဲယွၩအၡၩတၭ, မွဲမ့ၪဂဲၫလၩ့လၧ မူၭခိၪအၪ့ခွံၬနၧၩ, ဒဲနၡၩယဲဆံၫနီၪဆံၭ. မ့ၪဂဲၫလၩ့",
			"11": "<sup>11</sup> လၧမူၭခိၪတၭ, အၪ့ခွံၬအဝ့ၫဒဲအၡၩယဲဆံၫလီၫ.- မၩ ဒီၭလဖၧၫ့ဆၧအၪ့မၧၫ့လၩ့ ၦယဲဆံၫအခိၪလဂၩဒၪအီၪ လၧအၡၩယဲဆံၫလီၫ. အဝ့ၫဒၪချဲၩ့ဆၧတၭစံၭဝ့ၫဒၪ, ယွၩအၡၩလဂၩဧ့, စဎွၩစံၭဝ့ၫဒၪ, ဂဲၫလၩ့ချဲၫ့ချဲၫ့ဆံၭ.",
			"12": "<sup>12</sup> စအံၫလဲယၫစံၭဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫၥံၪ, ယအ့ၪမွဲ ယွၩအၡၩတၭ, မွဲမ့ၪဂဲၫလၩ့လၧမူၭခိၪအၪ့ခွံၬနၧၩ, ဒဲန",
			"13": "<sup>13</sup> ၡၩယဲဆံၫနီၪဆံၭ.- မၩဒီၭလဖၧၫ့, ဆၧအၪ့မၧၫ့လၩ့ၦ ယဲဆံၫအခိၪၥၧၫ့ဂၩလဂၩ ဒဲအၡၩယဲဆံၫလီၫ.ၦယဲဆံၫ အခိၪၥၧၫ့ဂၩလဂၩလ့ၩထၪ့တၭ, ဂဲၫချံၭလၩ့အခၪ့လၧ စအံၫလဲယၫအမ့ၬယၫတၭ, အၪ့ကံၩ့အၪ့ယၫဆၧတၭ, စံၭဝ့ၫ,ယွၩအၡၩလဂၩဧ့, မွဲယၥၭမၧၫ့, ဒဲနခ့ၫနၡၩယဲ ဆံၫအၥၭမၧၫ့ယီၩ ကဲၪထၪ့လါဆၧလူဒိၪဎွ့ၩဒိၪလၧန",
			"14": "<sup>14</sup> မ့ၬယၫဆံၭ.- ယိခွါ,မ့ၪဂဲၫလၩ့လၧမူၭခိၪတၭ, အၪ့ခွံၬ ၦယဲဆံၫအခိၪနံၫဂၩလၧအခၪ့ထံၭနီၪ, ဒဲအၡၩယဲဆံၫ လဖၪနီၪလီၫ. တၭဘိၩ့နဲၪ့ယီၩ မွဲယၥၭမၧၫ့ကဲၪထၪ့",
			"15": "<sup>15</sup> ဆၧလူဒိၪဎွ့ၩဒိၪလၧနမ့ၬယၫဆံၭ.- တၭယဟိဝၩအ ၥီၫ့စံၭစအံၫလဲယၫ, လ့ၩလၩ့လၧအဝ့ၫဒၪအၥိၭဆံၭ. ထီးၥၭမဲၪအဝ့ၫလဂ့ၩ. အဆၧဂဲထုၪ့တၭ, လ့ၩလၩ့လၧ",
			"16": "<sup>16</sup> အၥိၭလၧစဎွၩအအီၪလီၫ.- တၭစံၭအဝ့ၫ,ယဟိဝၩစံၭ ဝ့ၫဘဲၫယီၩ, မွဲနအၪ့မၧၫ့လၩ့အၥီၫ့လဖၪ ဘဲၫၥိၭအမိ အၪ့စၪ့ဆၧလၧအ့ၭကြၧၫ့အယွၩ ဘၫအလၭဇံဘၧၭနီၪ, (မွဲယွၩလၧပမိအၪ့စၪ့ဆၧချဲၩ့လအီၪဘၪ လၧအံၫစရ့ လၭအဖၧၩ့အကၠီၩ့နီၪ, လမွဲဘၪဧၪ.) မၩအၥၭဘဲၫနီၪ တၭ,နမိစဲၪ့လၩ့ဘၪလၧလးမံၫလၧနလ့ၩထၪ့ဘၭလၧ အဖၫ့ခိၪအ့ၬ. တၭနမိၥံၫတၡါလီၫ.",
			"17": "<sup>17</sup> အဝ့ၫဒၪၥံၫဝ့ၫ ဘဲၫယဟိဝၩအလူလၧစအံၫလဲယၫ ချဲၩ့ဆၧအၥိၭတၭ, စယဟိရၫ့ကဲၪစဎွၩလၧအလး,လၧ ယုဒၫအစဎွၩစယဟီၡဖၭ အဖိၪခွၫစယဟိရၫ့အနံၪ့ နံၫနံၪ့လနံၪ့လီၫ. အဂဲးဘဲၫယီၩ, အဖိၪခွၫအီၪအ့ၬ.",
			"18": "<sup>18</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစအၫဟဇဲအၫ လၧ အမၩဝ့ၫလဖၪနီၪ အီၪကွ့ၭအၥၭ လၧအံၫစရ့လၭအ စဎွၩၥံၪအလံၬကွ့ၭနဲၪ့ဆၧ အဖၧၩ့လမွဲဘၪဧၪ."
		},
		"2": {
			"1": "<sup>1</sup> ထီးယဟိဝၩမိမၩန့ထၪ့ စအံၫလဲယၫလၧမူၭခိၪလၧ လံၩၥဝံၭအဖၧၩ့တၭ, ဆၧမၩအၥၭ လၧစအံၫလဲယၫ",
			"2": "<sup>2</sup> ဒဲစအံၫလဲၡၫစဲၪ့ထၪ့ခွံၬ လၧဂံလဂၫလၭလီၫ.- တၭ စအံၫလဲယၫစံၭစအံၫလဲၡၫ, အီၪဒၪခလူၬထီးယီၩဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩအၪ့မၧၫ့လၩ့ယၧၩ လၧဘ့ၫၥ လၭလီၫ. တၭစအံၫလဲၡၫစံၭဝ့ၫဒၪ, ယဟိဝၩမၧၫ့ဝ့ၫ, ဒဲနၥၭမၧၫ့ဝ့ၫတၭ, ယလၩ့ဖၭလၧနၧၩအ့ၬ. တၭအဝ့ၫ",
			"3": "<sup>3</sup> ၥံၪလ့ၩလၩ့လၧဘ့ၫၥလၭလီၫ.- မီၪအဖိၪခွၫလဖၪလၧ အအီၪလၧဘ့ၫၥလၭအဖၧၩ့နီၪ ဂဲၫလၧစအံၫလဲၡၫအ အီၪတၭ,စံၭဝ့ၫ, ယဟိဝၩမိမၩန့ခွံၬနကဆါ လၧနခိၪ လၧမုဆၫလနံၩယီၩ, မွဲနၥ့ၪယၫဆ့ဧၪ. တၭအဆၧစံၭ",
			"4": "<sup>4</sup> ဝ့ၫဒၪ,ယၥ့ၪယၫလီၫ. အီၪလၩ့မါပံၭဆံၭ.- တၭစအံၫလဲ ယၫစံၭအဝ့ၫ, စအံၫလဲၡၫဧ့, အီၪဒၪခလူၬထီးယီၩဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩအၪ့မၧၫ့လၩ့ယၧၩ လၧယ့ၫရ ခိၫလီၫ. တၭအဆၧစံၭဝ့ၫဒၪ, ယဟိဝၩမၧၫ့ဝ့ၫ,ဒဲနၥၭ မၧၫ့ဝ့ၫနီၪယလၩ့ဖၭလၧနၧၩအ့ၬ. တၭအဝ့ၫၥံၪဂဲၫဝ့ၫ လၧယ့ၫရခိၫလီၫ.",
			"5": "<sup>5</sup> မီၪအဖိၪခွၫၥံၪလၧအအီၪလၧ ယ့ၫရခိၫလဖၪ ဂဲၫ လၧစအံၫလဲၡၫအအီၪတၭ, စံၭဝ့ၫဒၪ,ယဟိဝၩမိမၩန့ ခွံၬနကဆါလၧနခိၪလၧမုဆၫလနံၩယီၩ, မွဲနၥ့ၪယၫဆ့ ဧၪးတၭအဆၧစံၭဝ့ၫဒၪ, ယၥ့ၪယၫလီၫ. အီၪလၩ့မါ",
			"6": "<sup>6</sup> ပံၭဆံၭ.- တၭစအံၫလဲယၫစံၭဝ့ၫ, အီၪဒၪခလူၬထီး ယီၩဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩအၪ့မၧၫ့လၩ့ယၧၩ လၧယီၫဒၫ့လီၫ. တၭအဆၧစံၭဝ့ၫဒၪ, ယဟိဝၩ မၧၫ့ ဝ့ၫ,ဒဲနၥၭမၧၫ့ဝ့ၫနီၪ, ယလၩ့ဖၭလၧနၧၩအ့ၬ. တၭအဝ့ၫ",
			"7": "<sup>7</sup> ၥံၪလ့ၩဆၧနံၫဂၩလူၬလီၫ.- ၦၡၩယဲဆံၫလၧမီၪၥံၪအ ဖိၪခွၫလဖၪအကျၩလ့ၩဝ့ၫတၭ, ဆၧၫ့ထုၪ့လၧအယဲၩ့ တၭယိဆၧလီၫ. တၭၦနံၫဂၩနီၪ ဆၧၫ့ထုၪ့လၧယီၫဒၫ့",
			"8": "<sup>8</sup> အနဲၩ့လီၫ.- စအံၫလဲယၫမၩန့အၡၫ့တၭ, ထုၫထၪ့ဝ့ၫ တၭ,ထးထံၫတၭ, ထံၫနီၪလၩ့ဖၭဝ့ၫနံၫခီၫတၭ, အဝ့ၫ ၥံၪလ့ၩခၫ့ဂၬဆၧလၧခီၫ့နံၫဂၩလူၬလီၫ.",
			"9": "<sup>9</sup> ထီးအဝ့ၫၥံၪ လ့ၩခၫ့ဂၬခွံၬတၭ, ဆၧမၩအၥၭလၧ စအံၫလဲယၫစံၭစအံၫလဲၡၫ, ဆၧလချႃၭမၩန့ထၪ့ခွံၬ ဒံၭဘၪယၧၩလၧနအီၪတၭ, အၪ့ကံၩ့ဆၧလၧယမိမၩ လၧနဂးဆံၭ. တၭစအံၫလဲၡၫစံၭဝ့ၫဒၪ, မွဲနၥၭနံၫစၩ",
			"10": "<sup>10</sup> အီၪလါလၧယလီၩ့ဆံၭ.- တၭအဆၧစံၭဝ့ၫဒၪ, နအၪ့ ကံၩ့ဆၧကၪလမံၩ့လီၫ. ထီးဆၧမၩန့ထၪ့ခွံၬယၧၩလၧ နအီၪတၭ, နအ့ၪဒၪဘၪယၧၩတၭ, ဆၧမိမၩအၥၭလၧ နဂးဘဲၫနီၪလီၫ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, ဆၧကဲၪထၪ့ လၧနဂးအ့ၬ.",
			"11": "<sup>11</sup> တၭလၧအဝ့ၫၥံၪလ့ၩဆၧလၧယၫ, ဒဲချဲၩ့ဒုၪ့လိၬအ ၥၭအဘိၩ့ဘၭနီၪ,ယိခွါ, ဆၧမၩအၥၭလၧလဲၪ့မ့ၪဒဲက ၥ့ၪမ့ၪလဖၪ မၩလၩ့ဖၭအဝ့ၫၥံၪနံၫဂၩတၭ, စအံၫလဲ ယၫလ့ၩထၪ့လၧမူၭခိၪလၧလံၩၥဝံၭအဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> စအံၫလဲၡၫဒၪဘၪဝ့ၫတၭ, ကိၭထၪ့ဆၧ, ယဖါဧ့, ယဖါဧ့, အံၫစရ့လၭအလဲၪ့, ဒဲအကၥ့ၪလဖၪနီၪဘီၪၬ တၭဒၪဘၪလၧၩ့ဝ့ၫအ့ၬ. အဝ့ၫဖီၪ့အကီၩ့အၥိၭဒၪဝ့ၫ",
			"13": "<sup>13</sup> တၭ,ၡၫ့ခွံၬဝ့ၫနံၫကဲၩ့လီၫ.- အၪ့မၩန့ထၪ့စအံၫလဲယၫ အဖၬဘဲၩ့လၧအလၩ့ထ့ၬခွံၬလၧအလီၩ့တၭ, ထဲၩ့က",
			"14": "<sup>14</sup> ဒၩထဲၩ့တၭ, ဆၧၫ့ထုၪ့လၧယီၫဒၫ့အနဲၩ့လီၫ.- တၭမၩ န့စအံၫလဲယၫအဖၬဘဲၩ့လၧ အလၩ့ထ့ၬခွံၬလၧအလီၩ့ တၭ,ထးထံၫတၭ, စံၭဝ့ၫဒၪ, ယဟိဝၩစအံၫလဲယၫအ ယွၩနီၪ,မွဲအအီၪခီၫခီၫလဲၪး ထးထံၫဂီၩ့တၭ, ထံၫလၩ့ ဖၭဝ့ၫနံၫခီၫတၭ, စအံၫလဲၡၫခၫ့ဂၬဝ့ၫလီၫ.",
			"15": "<sup>15</sup> ထီးမီၪအဖိၪခွၫလဖၪ အီၪလၧယ့ၫရခိၫဒၪဘၪတၭ, စံၭဝ့ၫဒၪ,စအံၫလဲယၫ အၥၭအီၪဝ့ၫလၧစအံၫလဲၡၫ အလီၩ့လီၫ. အဝ့ၫၥံၪဂဲၫအၪ့ဂၬဝ့ၫတၭ, ထွံၩလၩ့ဝ့ၫ",
			"16": "<sup>16</sup> လၧအမ့ၬယၫလီၫ.- တၭအဝ့ၫၥံၪနီၪစံၭအဝ့ၫဒၪ,ယိခွါ, ၦၡၩအဆီၪ့ယဲဆံၫအီၪလၧနခ့ၫနၡၩလီၫ. ဒုၭလ့ၩလါ ဝ့ၫ,အၪ့ဎူၫအၪ့ဎၬနကဆါဆံၭ. ဘၪလဘၪယဟိဝၩ အၥၭမၩန့ထၪ့ဝ့ၫတၭ, လၧခိၪလီၩ့လဖျိၪ့ဖျိၪ့ဂ့ၩ,လၧ ခိၪလီၩ့ဆူၭလစီၪ့စီၪ့ဂ့ၩတၭ, ခွံၬလၩ့ဝ့ၫလီၫ. တၭအ",
			"17": "<sup>17</sup> ဆၧစံၭဝ့ၫဒၪ, နၥံၪထီးအၪ့မၧၫ့လၩ့လဂ့ၩ.- အဝ့ၫၥံၪ ပဂၨၪထၪ့အခဲၫ့ထီးအမ့ၬမဲတၭ, အဆၧစံၭဝ့ၫဒၪ,အၪ့ မၧၫ့လၩ့ကဒၪဘီၪ. အဝ့ၫၥံၪအၪ့မၧၫ့လၩ့ၦယဲဆံၫတၭ,",
			"18": "<sup>18</sup> ၦလဖၪနီၪအၪ့ဎၬဝ့ၫၥၧၫ့နံၩတၭ, ဒၪဘၪဝ့ၫအ့ၬ.- တၭ ဂဲၫထဲၩ့ဒီၭဝ့ၫလၧအအီၪလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪ အီၪဒံၭဝ့ၫလၧယ့ၫရခိၫအဖၧၩ့လီၫ. တၭအဆၧစံၭဝ့ၫ, ယစံၭနၥံၪလ့ၩလဂ့ၩနီၪ, မွဲအ့ၬဧၪ.",
			"19": "<sup>19</sup> ဒိၩ့အၡၩၥံၪစံၭစအံၫလဲၡၫ, ယိခွါ,ဒိၩ့အလးယီၩ ဂ့ၩဝ့ၫ,ဘဲၫယကဆါဒၪဘၪအၥိၭ, အ့ၪမွဲထံၫနီၪအၧၩ့",
			"20": "<sup>20</sup> ဝ့ၫဒၪတၭ, ဂၪ့ခိၪဒုၭမဲၪထၪ့ဆၧအ့ၬ.- အဝ့ၫဒၪစံၭ,ဂဲၫ ဆိၬန့ယၧၩလၧတခီးအၥၫ့နးဖျိၪ့တၭ, ဒုၭနုၬထံၫလၪ လၧအဖၧၩ့ဆံၭ. တၭအဝ့ၫၥံၪ ဂဲၫဆိၬဝ့ၫလၧအအီၪ",
			"21": "<sup>21</sup> လီၫ.- အဝ့ၫဒၪလ့ၩထၪ့ဝ့ၫလၧထံၫထၪ့ဖျိၭအအီၪတၭ, ခွံၬလၩ့ထံၫလၪ လၧအဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ယဟိဝၩ စံၭဘဲၫယီၩ, ယမၩအွံၪထၪ့ထဲၩ့ယူၭထံၫယီၩယူၭ,ထီး ယီၩလၧယၫဆၧၥံၫ, ဒဲဆၧလဒုၭကဲၪထၪ့ဘၪဆၧနီၪ",
			"22": "<sup>22</sup> အီၪလၧၩ့အ့ၬ.- တၭထံၫလဖၪနီၪအွံၪထၪ့ထဲၩ့ဝ့ၫထီး မုဆၫလနံၩယီၩဘဲၫစအံၫလဲၡၫအဆၧချဲၩ့ လၧအချဲၩ့",
			"23": "<sup>23</sup> ဝ့ၫအၥိၭနီၪလီၫ.- အဝ့ၫဒၪလ့ၩထၪ့လၧဘ့ၫၥလၭတၭ, လ့ၩထၪ့လၧဖၧၩ့ၥၭအဘိၩ့ဘၭနီၪ, ဖိၪၥၪဆံၭလဖၪဂဲၫ ထၪ့လၧဒိၩ့ဖၧၩ့, ဒုၪဒွ့ၪဝ့ၫတၭ,စံၭဝ့ၫ, လ့ၩထၪ့ဘီၪ, ၦချၩခိၪဧ့း လ့ၩထၪ့ဘီၪ, ၦချၩခိၪဧ့း",
			"24": "<sup>24</sup> အဝ့ၫဒၪထဲၩ့က ဒၩထဲၩ့တၭ, ယိဝ့ၫတၭ, ဆိၪအၧၩ့အဝ့ၫၥံၪလၧယဟိ ဝၩအမံၩ့လီၫ. ဖူၫထၫ့မိနံၫဒုၩဂဲၫထၪ့လၧၥံၪ့လစီၪ့အ ကျၩတၭ, ၡၫ့ခွံၬဖိၪၥၪလဖၪ လံဆံၫနံၫဂၩလၧအကျၩ",
			"25": "<sup>25</sup> နီၪလီၫ.- အဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬထီးနီၪ လ့ၩထီၩ့လၧခိၪလီၩ့ ကၫမလၭတၭ, စဲၪ့ထၪ့ခွံၬထီးနီၪ ထဲၩ့ထဲၩ့လၧစမ့ရ အၫလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> တၭလၧယုဒၫအစဎွၩစယဟီၡဖၭအနံၪ့ လဆံၫဎိၭ နံၪ့လနံၪ့နီၪ, စအၫဟၭအဖိၪခွၫစယဟိရၫ့ကဲၪၥၫ့စဎွၩ လၧအံၫစရ့လၭအဖၫ့ခိၪ လၧစမ့ရအၫအဖၧၩ့တၭ,ကဲၪ",
			"2": "<sup>2</sup> စဎွၩလဆံၫနံၫနံၪ့လီၫ.- အဝ့ၫဒၪမၩဆၧအၧၩ့လၧယ ဟိဝၩအမ့ၬယၫလါနၫ့တၭ, မီၪ့ဎီၩ့လၧအမိအဖါအ့ၬ. အဂဲးဘဲၫယီၩ ၥုၭခွံၬဘၫအလၭ အဆၧဂၩ့ လၧအဖါ",
			"3": "<sup>3</sup> တဲၩ့ဝ့ၫလီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, ဘုၭထၬအၥၭလၧ စနံဘၭအဖိၪခွၫ စယ့ၫရဘိအၫ့ အဆၧဒဲၩဘၭလၧအ ဒုၭမၩအံၫစရ့လၭ လၧဆၧဒဲၩဘၭတၭ, ခွံၬၡိၭခွံၬဝ့ၫအ့ၬ.",
			"4": "<sup>4</sup> မိအၭအစဎွၩမ့ၡၫမွဲၥိၪအကဆါတၭ, ဖ့ၪလၫ့ၥိၪ ဖိၪလကုၬအီၪလၧအဆီၪ့လၧ အံၫစရ့လၭအစဎွၩလီၫ.",
			"5": "<sup>5</sup> ထီးစအၫဟၭၥံၫဝ့ၫတၭ, ဆၧမၩအၥၭလၧမိအၭအ",
			"6": "<sup>6</sup> စဎွၩပိၩ့ထၪ့အံၫစရ့လၭလီၫ.- တၭဆၧလၧမုလနံၩနီၪ စဎွၩယဟိရၫ့စဲၪ့ထၪ့ခွံၬ လၧစမ့ရအၫတၭ, ဝံထၪ့နၬ",
			"7": "<sup>7</sup> ထၪ့အံၫစရ့လၭထီးအလူၬလီၫ.- လ့ၩဆၧတၭအၪ့မၧၫ့ လၩ့ဆၧလၧယုဒၫအစဎွၩ ယဟီၡဖၭအအီၪ,စံၭဝ့ၫဒၪ, မိအၭအစဎွၩပိၩ့ထၪ့ယူၭယၧၩယူၭ. မွဲနမိလ့ၩဆၧ လၧယၥိၭထၫ့ဒၩမိအၭလၧ ပမိဒုၭၥုၭအဂဲးဆ့ဧၪ.တၭ အဆၧစံၭဝ့ၫဒၪ, ယမိလ့ၩဆၧလီၫ. ယမွဲဘဲၫနၧၩအ ၥိၭ,ယၡၩခမျၧးဘဲၫနၡၩခမျၧးအၥိၭ, ယကၥ့ၪလဖၪ",
			"8": "<sup>8</sup> ဘဲၫနကၥ့ၪလဖၪအၥိၭနီၪလီၫ.- တၭစံၭဝ့ၫဒၪ,ပမိဘၪ လ့ၩလၧဖၧၩ့ၥၭလဘီၩ့ဘီၩ့လဲၪ. တၭအဆၧစံၭဆၧၫ့",
			"9": "<sup>9</sup> ဝ့ၫဒၪ,ဖၧၩ့ၥၭခၫ့ဂၬ အံဒၧၫ့အၡါမုနၧၫ့ဖၫနီၪလီၫ.- အံၫ စရ့လၭအစဎွၩလ့ၩဆၧ, ဒဲယုဒၫအစဎွၩ, ဒဲအံဒၧၫ့အ စဎွၩတၭ, လ့ၩဎဲၪ့ဆၧနွ့ၫနံၩဖၧၩ့ၥၭတၭ, လၧၦၥုၭမု ခမျၧးအဂး,ဒဲလၧဆၧဖိၪဆၧဎါအဒိၩ့ လၧအဖိၬအခဲၫ့ အဂးနီၪထံၫအီၪအ့ၬ.",
			"10": "<sup>10</sup> တၭအံၫစရ့လၭအစဎွၩစံၭဝ့ၫဒၪ, အၩလါ,ယဟိ ဝၩကိၭကီၪ့စဎွၩၥၧၫ့ဂၩယီၩ ဘဲၫၥိၭအမိဖ့ၪလၫ့ခွံၬဝ့ၫ",
			"11": "<sup>11</sup> လၧမိအၭအစူၪဖၧၩ့ဖီၩၬ- အ့ၪမွဲစယဟီၡဖၭ စံၭဝ့ၫ ဒၪ,ဘဲၫၥိၭပမိအၪ့စၪ့ယဟိဝၩတၭ, မွဲယဟိဝၩအမီၪ လဂၩဂၩလအီၪဘၪထီးယီၩဧၪ. အံၫစရ့လၭအစဎွၩ အခ့ၫအၡၩလဂၩစံၭဆၧၫ့ဆၧတၭစံၭဝ့ၫဒၪ, စၡ့ဖၭအ ဖိၪခွၫစအံၫလဲၡၫလၧအဂါလၩ့ထံၫ လၧစအံၫလဲယၫ",
			"12": "<sup>12</sup> အစူၪလီၩ့လဂၩအီၪထီးယီၩလီၫ.- တၭစယဟီၡဖၭ စံၭဝ့ၫဒၪ, ယဟိဝၩအလူအီၪလၧအဝ့ၫလီၫ. တၭအံၫ စရ့လၭအစဎွၩ, ဒဲစယဟီၡဖၭ, ဒဲအံဒၧၫ့အစဎွၩလ့ၩ",
			"13": "<sup>13</sup> ထၪ့လၧအအီၪလီၫ.- တၭစအံၫလဲၡၫစံၭ အံၫစရ့လၭ အစဎွၩ, ဆၧဘၪဆဲၫ့လၧနၧၩဒဲယၧၩမွဲဆၧနီၪ လမံၩ့ လဲၪ.လ့ၩလၧနဖါအမီၪလဖၪအအီၪ, ဒဲလၧနမိအမီၪ လဖၪအအီၪဆံၭ. တၭအံၫစရ့လၭအစဎွၩစံၭဝ့ၫ, မွဲ အ့ၬ.အဂဲးဘဲၫယီၩ ယဟိဝၩကိၭကီၪ့ၦၥၧၫ့ဂၩယီၩဘဲၫ",
			"14": "<sup>14</sup> ၥိၭအမိဖ့ၪလၫ့ခွံၬဝ့ၫလၧ မိအၭအစူၪဖၧၩ့လီၫ.- စအံၫ လဲၡၫစံၭဝ့ၫဒၪ, ၦခမျၧးလၧအယဟိဝၩမၧၫ့ဝ့ၫလၧယ ဆၧၫ့ထုၪ့လၧအမ့ၬယၫနီၪ, မွဲမၬ,အ့ၪလမွဲဘၪလၧယ ယိမ့ၬယုဒၫအစဎွၩယဟီၡဖၭတၭ, ယယိဆၧလၧန",
			"15": "<sup>15</sup> အီၪအ့ၬ. တၭယဒၪဘၪနၧၩဆ့အ့ၬ.- တၭဘိၩ့နဲၪ့ယီၩ ဂဲၫဆိၬန့ယၧၩၦဒံၩ့ဆၧဖိၪနးဂၩဆံၭး ထီးၦဒံၩ့ဆၧဖိၪ ဒံၩ့ဆၧအဘိၩ့ဘၭတၭ, ဆၧမၩအၥၭလၧယဟိဝၩအ",
			"16": "<sup>16</sup> စူၪအီၪလၧအလီၩ့လီၫ.- တၭအဆၧစံၭဝ့ၫဒၪ, ယဟိ ဝၩစံၭဘဲၫယီၩ, လၧခိၪလီၩ့ဆူၭဖၧၩ့ယီၩ မၩထံၫကၠီၪ့",
			"17": "<sup>17</sup> ထီးအဎံၩ့ဆံၭ.- အဂဲးဘဲၫယီၩယဟိဝၩစံၭဘဲၫယီၩ, နၥံၪလဒၪဘၪလံၩ, ဒဲဆၧဂဲၫဆၧၩ့လၩ့နီၪ, နၥံၪလဒၪ ဘၪလါနၫ့ဘိၩ, ဆၧဖၧၩ့ယီၩမိဎွ့ၩဝ့ၫ လၧထံၫဘဲၫၥိၭ နၥံၪမိအီၩဆၧ, နၥံၪဝ့ၫဒၪ, ဒဲနၥံၪအဆၧဖိၪဆၧဎါ,ဒဲန",
			"18": "<sup>18</sup> ၥံၪအဆၧဖိၪဆၧဎါအဒိၩ့လဖၪလီၫ.- တၭဆၧယီၩမွဲ ဆၧဎွံၫလမံၩ့လၧယဟိဝၩအမ့ၬယၫလီၫ. မိဖ့ၪလၫ့ခွံၬ",
			"19": "<sup>19</sup> ဆ့ၦမိအၭဖိၪလဖၪလၧနၥံၪအစူၪဖၧၩ့လီၫ.- နၥံၪမိဘၪ ကျီၪ့ခွံၬကယဲဒိၩ့အီၪ လၧအခိၪဒၧၩ့ဒဲကယဲဒိၩ့လၧ ဆၧရွံန့ဝ့ၫတၭ, မိဘၪခူၬလၩ့ခွံၬ ကယဲၥံၪ့လၧအဂ့ၩ တၭ,နၥံၪမိဘၪဆွံၫဘံၭ ကယဲထံၫထၪ့ဖျိၭ, ဒဲကယဲဂၪ့ ခိၪအဝၩ့ဂ့ၩမိဘၪမၩဂၭဂီၩ့လၧ လိးလဖၪလီၫ.",
			"20": "<sup>20</sup> လၧမုဆဲၪ့ထၪ့နီၪ ထီးၦမၩဘိၪ့ဆၧမၩဘိၪ့ကိၪမုၬ အဘိၩ့ဘၭယိခွါ, ဆၧမၩအၥၭလၧထံၫဂဲၫလၧအံဒၧၫ့",
			"21": "<sup>21</sup> အဖၧၩ့ၥၭတၭ, ခးဎွ့ၩဝ့ၫလၧထံၫလီၫ.- တၭထီးၦမိအၭ ဖိၪထီးအလူၬနါဂၧၫ့ လၧစဎွၩလဖၪဂဲၫဒုၭဆၧလၧအ ဝ့ၫၥံၪတၭ, ဒုၭအီၪကီၪ့ကယဲၦလၧအၥိၭထၪ့စူၪဝဲၩၥ့ၪ, ဒဲၦလၧအၥၭၡါနဲၪ့ဝ့ၫလဖၪ, ဆၧၫ့ထုၪ့လၧခးအနဲၩ့ထံၭ",
			"22": "<sup>22</sup> နီၪလီၫ.- မုဆဲၪ့ထၪ့နီၪအဝ့ၫၥံၪဂဲထုၪ့ဂီၩဂီၩတၭ, မုအ ဂိးဆ့ၭဘၪထံၫဖံၭခိၪတၭ, ၦမိအၭဖိၪဒၪဘၪထံၫလၧဝါ",
			"23": "<sup>23</sup> လခီၫဝီၩဝ့ၫဘဲၫဆၧၥွံၪအၥိၭနီၪလီၫ.- တၭစံၭဝ့ၫဒၪ, အယီၩမွဲဆၧၥွံၪလီၫ. စဎွၩလဖၪ ဘၪဆၧမၩၥံၫယူၭ ဝ့ၫတၡါတၭ, ကျီၪ့လိၬအၥၭယူၭတၭ, ဘိၩ့နဲၪ့ယီၩ,",
			"24": "<sup>24</sup> မိအၭဧ့,ဂဲၫလၧဆၧအၪ့ဂူၬန့အအီၪဆံၭ.- အဝ့ၫၥံၪဂဲၫ ဝ့ၫလၧအံၫစရ့လၭ ၥုၪ့တဲၩအလးတၭ, ၦအံၫစရ့လၭ ဖိၪဂဲထုၪ့တၭ, ကျီၪ့ခွံၬၦမိအၭဖိၪတၭ, အဝ့ၫၥံၪစဲၪ့ဝ့ၫ လၧအမ့ၬယၫတၭ, ၦလဖၪနီၪကျီၪ့ခွံၬဆၧတၭ, လ့ၩ",
			"25": "<sup>25</sup> ဆၧ,ဒဲဖ့ၬခွံၬၦမိအၭဖိၪဆီၪ့ဆီၪ့လ့ၬလီၫ.- တၭမၩလၩ့ ဎီးအဝ့ၫၥံၪအဒိၩ့လဖၪ, ဒဲလၧကယဲဂၪ့ခိၪအဝၩ့လၧအ ဂ့ၩအဖၫ့ခိၪနီၪလဂၩ ခွံၬလိးလဖျိၪ့လဂၩ ခွံၬလိးလဖျိၪ့ တၭ,မၩဎွ့ၩဝ့ၫလီၫ. အဝ့ၫၥံၪဆွံၫဘံၭထံၫထၪ့ဖျိၭထီး အလူၬတၭ, ခူၬလၩ့ခွံၬၥံၪ့အဂ့ၩထီးအလူၬလီၫ. အီၪ က့ၪလၩ့ထးဝ့ၫ ကၧၫဟၫရစ့ၭအခိၪဒၧၩ့း မွဲလါနၫ့ဘိၩ ၦခွံၬဖလီဖိၪလ့ၩဎဲၪ့ဆၧတၭခၭဝ့ၫလီၫ.",
			"26": "<sup>26</sup> မိအၭအစဎွၩဒၪဘၪဝ့ၫလၧ ဆၧဒုၭၥုၭဆီၪ့လၨၪလၧ အဂးတၭ,မၩန့ၦၡၩနွ့ၫယၩလၧအထုၭထၪ့နၭ, ဘဲၫ ၥိၭအမိဘုၪ့ဖျီၫ့ဆၧလၧအံဒၧၫ့ အစဎွၩအအီၪတၭ,မၩ",
			"27": "<sup>27</sup> ဝ့ၫၥ့ၪအ့ၬ.- ထီးနီၪလဖၧၫ့မၩန့အဖိၪဝဲၡါလၧအကြၨၭ ကဲၪစဎွၩလၧအလးတၭလုထၪ့ဝ့ၫ လၧဆၧလုမ့ၪလၧ ဒိၩ့ခိၪဒၧၩ့အဖၫ့ခိၪလီၫ. ဆၧၥၭခိထၪ့ဖၭဒိၪ အီၪလၧ အံၫစရ့လၭအကျၩနီၪတၭ, အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧအ အီၪတၭ,ထဲၩ့ထဲၩ့လၧအခးဒၪဝ့ၫနီၪလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> ၦမုၪလဂၩ လၧမီၪအဖိၪခွၫလဖၪ အမၫၥံၪအကျၩ နီၪ,ကိၭထၪ့စအံၫလဲၡၫတၭ, စံၭဝ့ၫဒၪ,နခ့ၫနၡၩယဝၩ လဂၩၥံၫယူၭတၭ, နၥ့ၪယၫလၧနခ့ၫနၡၩၥၭမဲၪယဟိ ဝၩလီၫ.တၭမါဆါနီၪဂဲၫဝ့ၫဘဲၫၥိၭ အမိမၩန့အၪ့မၧၫ့",
			"2": "<sup>2</sup> ဎီးယဖိၪခွၫနံၫဂၩလူၬလီၫ.- တၭစအံၫလဲၡၫစံၭဝ့ၫ,ယ မိဘၪမၩဆၧနီၪလၫလၧနဂးလမံၩ့လဲၪး နဆၧအီၪလၧ ဂံၪ့ဖၧၩ့မွဲဆၧနီၪလမံၩ့လဲၪ, လီၩဘၪယၧၩဆံၭ. တၭအ ဝ့ၫဒၪလီၩဘၪဝ့ၫ, နဎီးမုၪအဆၧအီၪလၧဂံၪ့ဖၧၩ့နးမံၩ့",
			"3": "<sup>3</sup> အ့ၬး အီၪန့ၫၥိၪလပလၫ့လီၫ.- တၭအဝ့ၫဒၪစံၭ,လ့ၩဘီၪ, အၪ့ကံၩ့အၪ့လီးဖၧၩ့လဖၪ လၧကယဲၦအီၪလၧနနဲၩ့ ထံၭကိၭဂၩဒ့ၭ, ဖၧၩ့အီၪခီၫလဖၪဆံၭး မၩန့ၡၩဖျိၪ့လ",
			"4": "<sup>4</sup> ဂ့ၩ,- ထီးနအ့ၪဂဲၫနုၬယူၭတၭ, မၩဘံၭထၬတရၫ့လၧ နလးခဲၫ့, ဒဲလၧနဖိၪခွၫၥံၪအလးခဲၫ့တၭ, နမိဘၪဂါလၩ့ လၧကယဲဖၧၩ့လဖၪနီၪ အဖၧၩ့ထီးအလူၬတၭ,ကယဲ",
			"5": "<sup>5</sup> ဆၧလၧအဎွ့ၩဝ့ၫနီၪ နမိဘၪအီၪက့ၪလစီၪ့ဒၪလီၫ.- ၦ မုၪနီၪစဲၪ့ထၪ့ခွံၬလၧအအီၪတၭ, ကၭဘံၭထၬတရၫ့ လၧအလးခဲၫ့, ဒဲလၧအဖိၪခွၫၥံၪအလးခဲၫ့လီၫ. အဝ့ၫ ၥံၪနီၪဂဲၫဆိၬဆၧလၧအအီၪတၭ, အဝ့ၫဂါလၩ့ဆၧ",
			"6": "<sup>6</sup> လီၫ.- ထီးဖၧၩ့ဎွ့ၩဝ့ၫတၭ, ဆၧမၩအၥၭလၧအစံၭအ ဖိၪခွၫဂဲၫဆိၬဒံၭဖၧၩ့နးဖျိၪ့ဆံၭ. တၭအဆၧစံၭဝ့ၫဖၧၩ့",
			"7": "<sup>7</sup> အီၪလၧၩ့အ့ၬ. တၭၥိၪအီၪပထုၬဝ့ၫလီၫ.- ထီးနီၪလ ဖၧၫ့ၦမုၪဂဲၫဝ့ၫတၭ, လီၩဘၪယွၩအၡၩတၭ, အဝ့ၫဒၪ စံၭ,လ့ၩအၪ့ဆၫခွံၬၥိၪတၭ လိၭလၩ့ထူၭခွံၬနမါတၭ, မၧၫ့နဝ့ၫ,ဒဲနဖိၪခွၫလဖၪနီၪ လၧဆၧအီၪလၩ့ထးလဖၪ နီၪဆံၭ.",
			"8": "<sup>8</sup> ဆၧမၩအၥၭလၧမုလနံၩလၧ စအံၫလဲၡၫလ့ၩထီၩ့ လၧရှုနံၫ့, ၦမုၪလၧအကဲၪဒိၪ အီၪထီးနီၪလဂၩတၭ, အဝ့ၫအၪ့ဂူၬဒုၭအၪ့ဝ့ၫလၧကိၪလီၫ. ထီးဒၪအလ့ၩဖီၩ့ခွံၬ အလးလဖၧၫ့ဖၧၫ့ဆၧမၩအၥၭ လၧအလ့ၩနုၬအၪ့ကိၪ",
			"9": "<sup>9</sup> ထီးနီၪလီၫ.- တၭၦမုၪလီၩဘၪအဝၩ, ယိခွါ,ယဒၪလၧ ၦလဂၩယီၩ, မွဲယွၩအၡၩဆံၫ့ဎံၪလီၫ. အဝ့ၫဒၪလဲး",
			"10": "<sup>10</sup> လီၩ့လၧပအီၪယီၩလထံၪဎးလီၫ.- မွဲပတဲၩ့ဝဲၩလါဒူၭ ဖိၪလၧဆၧဒီၪ့အလီၩ့လၧအဂးဆံၭ. တၭအီၪက့ၪလၩ့ အလးမံၫဒဲစပွဲဒဲလးဆၧၫ့နၩ့နးဖျိၪ့, ဒဲမ့ၪဒိၩ့နးဖျိၪ့ထီးနီၪ လၧအဂးဆံၭ. ထီးအဝ့ၫဒၪအ့ၪဂဲၫလၧပအီၪတၭ,ဆၧ",
			"11": "<sup>11</sup> မိမၩအၥၭလၧအမိကၠၪအၥၭလၧနီၪလီၫ.- ဆၧမၩအ ၥၭလၧမုလနံၩ လၧအဂဲၫဝ့ၫနီၪတၭ, ကၠၪအၥၭလၧဒူၭ",
			"12": "<sup>12</sup> ဖိၪအဖၧၩ့နီၪတၭမံၫဝ့ၫထီးနီၪလီၫ.- လီၩဘၪအခ့ၫအ ၡၩစဂံၫဟၫဇဲၫနီၪ, ကိၭန့ၦရှုနံၫ့မုၪလဂၩနီၪဆံၭ. ထီး အကိၭဝ့ၫနီၪတၭ, ၦမုၪဂဲၫဆၧၫ့ထုၪ့လၧအမ့ၬယၫလီၫ.",
			"13": "<sup>13</sup> အဝ့ၫဒၪအၪ့မၧၫ့အခ့ၫအၡၩစံၭၦမုၪ, ယိခွါ,နယိထဲၩ့ ခွါထဲၩ့မၩဆၧၩ့ပၧၩ လၧကယဲဆၧထီးအလူၬယီၩလီၫ. ပမိမၩလၧနဂးလၧ ဆၧနီၪလမံၩ့လဲၪ. ၦချဲၩ့ဆၧလၧန ဂးလၧစဎွၩမွဲဂ့ၩ, ၦၥုၭမုခမျၧးအခိၪမွဲဂ့ၩ, အလးအီၪ ဧၪ.တၭအဝ့ၫဒၪစံၭ, ယအီၪလၧယၡၩလဆၨၩဒၪယ",
			"14": "<sup>14</sup> ဝ့ၫအကျၩလီၫ.- တၭအဝ့ၫဒၪစံၭ ပဘၪမၩလၧအဂး လၧဆၧနီၪလမံၩ့လဲၪ. စဂံၫဟၫဇဲၫစံၭဝ့ၫ, မွဲမၬအဖိၪ",
			"15": "<sup>15</sup> လအီၪဘၪတၭ, အဝၩအၥၭၡါယူၭလီၫ.- တၭအဝ့ၫ နီၪစံၭ,ကိၭန့အဝ့ၫဆံၭ. ထီးအကိၭဝ့ၫတၭ, အဝ့ၫဆၧၫ့",
			"16": "<sup>16</sup> ထုၪ့လၧတရၫ့ဖၧၩ့လီၫ.- စအံၫလဲၡၫစံၭဝ့ၫဒၪ,ထီးအ ထီယီၩဆၧၫ့ထဲၩ့အလးတၭ, ဘဲၫဆၧမၧၫ့အထီနီၪ,န မိဖိၭဘၪဖိၪခွၫလဂၩလီၫ. တၭၦမုၪနီၪစံၭဝ့ၫဒၪ,မွဲအ့ၬ. ယကဆါ,ယွၩအၡၩဧ့, ချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧလၧနဎီး",
			"17": "<sup>17</sup> မုၪလဂ့ၩ.- ၦမုၪနီၪဒၧၩ့ထၪ့တၭ, အီၪဖျဲၪန့အဖိၪခွၫထီး အထီလၧစအံၫလဲၡၫလီၩဘၪဝ့ၫ, ဘဲၫဆၧမၧၫ့အထီနီၪ လီၫ.",
			"18": "<sup>18</sup> ထီးဖိၪၥၪဒိၪထၪ့တၭ, အလနံၩနီၪဆၧမၩအၥၭလၧ အလ့ၩထၪ့ လၧအဖါအအီၪ, လၧၦကူၭဘုၪလဖၪအ",
			"19": "<sup>19</sup> အီၪလီၫ.- စံၭအဖါ, ယခိၪဎွံၪ,ယခိၪဎွံၪတၭ, အဝ့ၫဒၪ စံၭဖိၪၥၪခွၫလဂၩ, လ့ၩထၪ့ဆိၬဝ့ၫ လၧအမိအအီၪ",
			"20": "<sup>20</sup> ဆံၭ.- အဝ့ၫမၩန့ဆိၬထၪ့ဝ့ၫလၧအမိအအီၪတၭ, ဖိၪ ၥၪနီၪဆၧၫ့နၩ့လၧအဂူၫလၬ ထီးမုထုၪ့တၭ,ၥံၫဝ့ၫလီၫ.",
			"21": "<sup>21</sup> အမိလ့ၩထၪ့တၭအီၪက့ၪလၩ့ဝ့ၫလၧ ယွၩအၡၩအလး မံၫအဖၫ့ခိၪတၭ, ကၭဘံၭထၬအလးခဲၫ့တၭ, စဲၪ့ထၪ့",
			"22": "<sup>22</sup> ဝ့ၫလီၫ.- တၭကိၭထၪ့လၧအဝၩ, စံၭဝ့ၫ,အၪ့မၧၫ့လၩ့န့ ယၧၩလၧဖိၪၥၪခွၫနးဂၩ, ဒဲကၥ့ၪယီၩ့နးဒုၩ, ဘဲၫၥိၭ ယမိလ့ၩစဲၪ့လၧယွၩ အၡၩအအီၪဒဲ ဂဲၫထဲၩ့ထဲၩ့နီၪ",
			"23": "<sup>23</sup> ဆံၭ.- တၭအဝ့ၫဒၪစံၭ, နမိလ့ၩလၧအအီၪလၧမုဆၫ လနံၩယီၩမွဲဘၪလဲၪ. လၩၥံၫအနံၩမွဲအ့ၬ, မးၥံၫအ နံၩမွဲဆ့အ့ၬ. တၭၦမုၪစံၭဝ့ၫဒၪ, ဆၧဘၪအမုၬလီၫ.",
			"24": "<sup>24</sup> တဲၩ့ဝဲၩကၥ့ၪယီၩ့အပီၩ့တၭ, စံၭအခ့ၫအၡၩ, နၫ့တၭ လ့ၩဆၧဆံၭ. ယအ့ၪလအၪ့မၧၫ့ဘၪနၧၩတၭ, မၩလၩ့",
			"25": "<sup>25</sup> ၡီနနၫ့ဆၧလဂ့ၩ.- တၭလ့ၩဆၧထီၩ့လၧယွၩအၡၩအ အီၪလၧခိၪလီၩ့ကၫမလၭလီၫ. ထီးယွၩအၡၩဒၪဘၪအ ဝ့ၫလၧအယဲၩ့တၭ, ဆၧမၩ အၥၭလၧအစံၭအခ့ၫအၡၩ, စဂံၫဟၫဇဲၫ,ယိခွါ,ၦရှု",
			"26": "<sup>26</sup> နံၫ့မုၪလဂၩနီၪဘီၪ.- ဘိၩ့နဲၪ့ယီၩလ့ၩစဲၪ့အၪ့ဂၬအဝ့ၫ တၭ,စံၭအဝ့ၫ, နအီၪမုၬဆ့ဧၪ, နဝၩနီၪအီၪမုၬဆ့ဧၪ, ဖိၪၥၪနီၪအီၪမုၬဆ့ဧၪနီၪဆံၭ. တၭၦမုၪနီၪစံၭဝ့ၫဒၪ,",
			"27": "<sup>27</sup> အီၪမုၬဝ့ၫလီၫ.- ထီးအထီၩ့လၧယွၩအၡၩအအီၪလၧ ခိၪလီၩ့ခိၪတၭ, ဖီၪ့ထၬအခၪ့တၭ, စဂံၫဟၫဇဲၫၥုၭဘူၭ အၥၭဘဲၫၥိၭအမိထွၫခွံၬဝ့ၫလီၫ. တၭယွၩအၡၩစံၭ ဝ့ၫ,အီၪဒၪဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩအၥုၪ့ခိအၥၭဝီၩလၧ အဖၧၩ့တၭ, ယဟိဝၩအီၪက့ၪၥူၪခွံၬဝ့ၫလၧယၧၩတၭ,",
			"28": "<sup>28</sup> လီၩဘၪယၧၩအ့ၬ.- တၭၦမုၪနီၪစံၭ, ယအၪ့ကံၩ့န့ဖိၪ ၥၪလဂၩလၧယကဆါဆ့ဧၪ, ယစံၭအၪ့လီၫန့ယၧၩ",
			"29": "<sup>29</sup> လဂ့ၩ,မွဲအ့ၬဧၪ.- အဝ့ၫဒၪစံၭစဂံၫဟၫဇဲၫ, ခဲးထူၬန ယးဒံၩ့တၭ, မၩန့ယနိၪထိၭဘီၩ့လၧယစူၪဖၧၩ့,ဒဲလ့ၩ ဆၧဆံၭ. နအ့ၪဘၪခီၩ့ၦလဂၩဂၩတၭ, ချဲၩ့ဒုၪ့လဂ့ၩ တၭ,ၦလဂၩဂၩအ့ၪချဲၩ့ဒုၪ့နၧၩတၭ, စံၭဆၧၫ့လဂ့ၩ. တၭအီၪက့ၪလၩ့ယနိၪထိၭဘီၩ့ လၧဖိၪၥၪအမ့ၬအဖၫ့",
			"30": "<sup>30</sup> ခိၪဆံၭ.- တၭဖိၪၥၪအမိစံၭ, ယဟိဝၩမၧၫ့ဝ့ၫဒဲနၥၭမၧၫ့ ဝ့ၫနီၪ,ယစဲၪ့ထၪ့ခွံၬ လၧနအီၪအ့ၬ.အဝ့ၫဒၪ ဂဲထုၪ့တၭ",
			"31": "<sup>31</sup> ဖိၬအခဲၫ့လီၫ.- စဂံၫဟၫဇဲၫလ့ၩဝ့ၫလၧ အဝ့ၫၥံၪအမ့ၬ ယၫတၭ,အီၪက့ၪလၩ့ နိၪထိၭဘီၩ့ လၧဖိၪၥၪအမ့ၬအ ဖၫ့ခိၪး မွဲလါနၫ့ဘိၩ ဆၧအလူအီၪအ့ၬ. ဆၧနါဂၧၫ့ဆ့ အ့ၬ.အခိးမွဲအဝ့ၫလ့ၩဒီၭဘဲၫၥိၭ အမိအၪ့ဂၬအဝ့ၫဒၪ တၭ,လီၩဘၪအဝ့ၫ, စံၭဝ့ၫ,ဖိၪၥၪနၪ့ထၪ့အၥၭအ့ၬ.",
			"32": "<sup>32</sup> စအံၫလဲၡၫဂဲၫနုၬလၧဂံၪ့ဖၧၩ့တၭ, ဖိၪၥၪၥံၫယူၭတၭ,",
			"33": "<sup>33</sup> မံၫနၩ့ဝ့ၫလၧအလးမံၫအဖၫ့ခိၪလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,အဝ့ၫဒၪလ့ၩနုၬဝ့ၫတၭ, ကၭဘံၭထၬတရၫ့ဘဲၫ ၥိၭအမိအီၪနံၫဂၩတၭ, အၪ့ကံၩ့အၪ့ယၫယဟိဝၩလီၫ.",
			"34": "<sup>34</sup> လ့ၩထၪ့မံၫနၩ့ လၧဖိၪၥၪနီၪအဖၫ့ခိၪတၭ, အီၪက့ၪအ နိၭလၧအနီၪလဂၩ အနိၭအဖၫ့ခိၪ, ဒဲအမ့ၬၥၪလၧအ ဝ့ၫဒၪအမ့ၬၥၪအဖၫ့ခိၪ, အစူၪလၧအဝ့ၫဒၪအစူၪအဖၫ့ ခိၪတၭ, စီၪ့လၩ့အၥၭလၧဖိၪၥၪအဖၫ့ခိၪတၭ, ဖိၪၥၪ",
			"35": "<sup>35</sup> အယၪလၧၩ့ထၪ့ဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫဒၪထဲၩ့ တၭလဲးလီၩ့ဆၧလၧဂံၪ့ဖၧၩ့တၭ, လ့ၩထၪ့စီၪ့လၩ့အ ၥၭလၧအဖၫ့ခိၪတၭ, ဖိၪၥၪကဆ့ၪထၪ့နွ့ၫဖၧၫ့တၭ,ဖိၪ",
			"36": "<sup>36</sup> ၥၪစၪ့ထၪ့အမ့ၬလီၫ.- အဝ့ၫကိၭန့စဂံၫဟၫဇဲၫတၭ,စံၭ ဝ့ၫဒၪ, ကိၭန့ၦရှုနံၫ့မုၪ လဂၩနီၪဆံၭ. အဝ့ၫကိၭန့ဝ့ၫ လီၫ.ၦမုၪဂဲၫနုၬဝ့ၫလၧအအီၪတၭ, အဝ့ၫဒၪစံၭမၩန့",
			"37": "<sup>37</sup> ထၪ့နဖိၪခွၫဆံၭ.- ထီးနီၪလဖၧၫ့ၦမုၪလ့ၩနုၬဝ့ၫတၭ, ထိၪလၩ့ထံၩဖါအၥၭ လၧအခၪ့ထံၭတၭ, ၡီၫ့လၩ့အၥၭ ထီၩ့လၩ့လၧဂၪ့ခိၪ, မၩန့ထၪ့အဖိၪခွၫတၭ, လ့ၩထၪ့ လၧခီၫ့လီၫ.",
			"38": "<sup>38</sup> စအံၫလဲၡၫဂဲၫထဲၩ့ထဲၩ့ဒီၭ လၧဂံလဂၫလၭတၭ, ဆၧၥၭဝံလၩ့ဒိၩအီၪဝ့ၫလၧခးဖၧၩ့နီၪလီၫ. တၭမီၪလ ဖၪအဖိၪခွၫၥံၪ အီၪဆၧၫ့နၩ့ဝ့ၫ လၧအမ့ၬယၫတၭး အ ဝ့ၫဒၪစံၭအခ့ၫအၡၩ, ဒီၩ့ထၪ့ဖၧၩ့ဖၭဒိၪတၭ, အၪ့ဎွံ",
			"39": "<sup>39</sup> ဆၧအၪ့ဎွံလၧမီၪအဖိၪခွၫလဖၪအဂးဆံၭ.- တၭၦလ ဂၩ,လ့ၩဝ့ၫလၧ မံၩ့လၬကျၩ ဘဲၫၥိၭအမိအၪ့မၩဆၧ ဒိၭဆၧလၪလီၫ. တၭဒၪဘၪဆၧမုအမံၩ့, ဒဲအၪ့မၩထံၫ လုၩမံၩ့အၥၪလၧအလီၩ့ဎွ့ၩ အဖိၫ့ဝ့ၫန့တၭ, ဂဲၫထဲၩ့ဒုၭ နုၬဝ့ၫလၧဖၧၩ့ဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ၥ့ၪယၫဝ့ၫအ့ၬ.",
			"40": "<sup>40</sup> တၭဂါလၩ့ဝ့ၫဘဲၫၥိၭၦၡၩမိအၪ့ဆၧလီၫ. အဝ့ၫၥံၪအၪ့ ဆၧအၪ့ဎွံအဘိၩ့ဘၭတၭ, ကိၭၡၭထၪ့တၭ,စံၭဝ့ၫဒၪ, ယွၩအၡၩဧ့, ဆၧၥံၫအီၪဝ့ၫလၧဖၧၩ့ဖၧၩ့လီၫ. တၭအၪ့",
			"41": "<sup>41</sup> ဝ့ၫၥ့ၪအ့ၬ.- အဝ့ၫဒၪစံၭ,ဂဲၫဆိၬကိၪမုၬဆံၭ. တၭဒုၭ လၩ့ဝ့ၫလၧဖၧၩ့ဖၧၩ့တၭ, စံၭဝ့ၫဒၪ,ဂါလၩ့လၧၦခမျၧး အဂးဘဲၫၥိၭအမိအၪ့ဆၧနီၪဆံၭ. တၭဆၧအၧၩ့အီၪ လၧဖၧၩ့ဖၧၩ့နးမံၩ့အ့ၬ.",
			"42": "<sup>42</sup> ၦလဂၩဂဲၫဝ့ၫ လၧဘၫအလၭၡလံၡၫတၭ,ဂဲၫဆိၬ န့ယွၩအၡၩလၧကိၪအလီၪ့နံၫဆံၫ မၩဝ့ၫလၧဘုၪမုယီၩ အၥၪဆိၫ,ဒဲဘုၪအဆဲၩလဖၪ လၧထိၪ့ဖၧၩ့လီၫ.တၭစံၭ",
			"43": "<sup>43</sup> ဝ့ၫဒၪ,ဖ့ၪလၫ့ၦခမျၧးဘဲၫၥိၭအမိအၪ့ဆၧဆံၭ.- တၭ အခ့ၫအၡၩစံၭဝ့ၫ, ဘဲၫၥ့ၪလဲၪ, မွဲယမိအီၪက့ၪလၩ့ အယီၩလၧၦလယၩ အမ့ၬယၫနီၪဆ့ဧၪ, တၭအဝ့ၫ စံၭဒီၭဝ့ၫ,ဖ့ၪလၫ့ၦခမျၧး ဘဲၫၥိၭအမိအၪ့ဆၧဆံၭ. အ ဂဲးဘဲၫယီၩ ယဟိဝၩစံၭဘဲၫယီၩ, အဝ့ၫၥံၪမိအၪ့ဆၧ",
			"44": "<sup>44</sup> ဒဲမိအီၪက့ၪလၩ့ထးဆၧလီၫ.- အဝ့ၫၥံၪအီၪက့ၪလၩ့ဝ့ၫ လၧအဝ့ၫၥံၪအမ့ၬယၫတၭ, အဝ့ၫၥံၪအၪ့ဆၧတၭ, အီၪ က့ၪလၩ့ထးဝ့ၫ, ဘဲၫယဟိဝၩအလူအၥိၭနီၪလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ခးစံရအၫအစဎွၩအၥုၭမုခမျၧးအခိၪ စနၫအမၫ့ မွဲၦအဒိၪလၧအကဆါအမ့ၬယၫတၭ, အဆၧယိမ့ၬဝ့ၫ လီၫ.အဂဲးဘဲၫယီၩ ယဟိဝၩဖ့ၪလၫ့ဆၧမၩဖီၩ့မၩဖျ့ၭစံ ရအၫလၧအဝ့ၫဒၪအစူၪဖၧၩ့လီၫ. တၭမွဲၦအဆီၪ့လၧ အၥၭဒူၩလါနၫ့တၭ, မွဲၦခံၫထူၬဆၫအၧၩ့လဂၩလီၫ.",
			"2": "<sup>2</sup> ၦစံရအၫဖိၪဂဲၫယူၭလၧၦလဒီၪ့လဒီၪ့လဖၪတၭ, ထဲၩ့ ဆိၬထၪ့ခွံၬ လၧခးအံၫစရ့လၭအဖၧၩ့ အၪ့မၧၫ့ဎီးဖိၪ ၥၪမုၪအဆံၭလဂၩတၭ, အဝ့ၫဒၪအီၪမၩစနၫအမၫ့အမၫ",
			"3": "<sup>3</sup> အခ့ၫအၡၩအဆၧလီၫ.- တၭစံၭအကဆါမုၪ, မွဲယက ဆါအီၪလါလၧမီၪအမ့ၬယၫ လၧအအီၪဝ့ၫလၧစမ့ရ အၫအဖၧၩ့နီၪဆံၭ. အဝ့ၫဒၪမိမၩဘျၪထဲၩ့ဝ့ၫလၧဆၧ",
			"4": "<sup>4</sup> ခံၫထူၬဆၫအၧၩ့လီၫ.- ၦလ့ၩနုၬတၭ, လီၩဘၪအက ဆါတၭ,စံၭဝ့ၫဒၪ, ဖိၪၥၪမုၪလၧအဂဲၫလၧ ခးအံၫစရ့ လၭလဂၩချဲၩ့ဆၧဘဲၫအံၩဘဲၫအိၩလီၫ.",
			"5": "<sup>5</sup> တၭစံရအၫအစဎွၩစံၭဝ့ၫဒၪ, ဂဲၫဘီၪ,လ့ၩဆၧဆံၭ. ယမိဖ့ၪယုလံၬနးဘံၪ့ လၧအံၫစရ့လၭအစဎွၩလီၫ.အ ဝ့ၫဒၪလ့ၩဆၧတၭ, လ့ၩဆိၬစ့ၩဆံၫကံကၫဒဲထီၫ့အဘံၪ့ ဎူၫထီၫ့, ဒဲဆၧကီၩ့ဆၧၥိၭလၧ ၦမိလုထၪ့အၥၭဆံၫဖၧၫ့",
			"6": "<sup>6</sup> အဂးလီၫ.- တၭအဝ့ၫဒၪဂဲၫဆိၬ လံၬလဘံၪ့နီၪလၧအံၫ စရ့လၭအစဎွၩအအီၪ လၧအစံၭဝ့ၫ, ဘိၩ့နဲၪ့ယီၩထီး လံၬလဘံၪ့ယီၩအ့ၪထီၩ့လၧနအီၪတၭ, ယိခွါ,ယအၪ့ မၧၫ့လၩ့ယခ့ၫယၡၩ စနၫအမၫ့လၧနအီၪဘဲၫၥိၭနမိမၩ ဘျၪထဲၩ့ဝ့ၫလၧဆၧခံၫထူၬဆၫအၧၩ့နီၪလီၫ.",
			"7": "<sup>7</sup> ထီးအံၫစရ့လၭအစဎွၩ ဖီလံၬလဘံၪ့နီၪတၭ,ဆၧ မၩအၥၭလၧအၡၫ့အကီၩ့အၥိၭစံၭဝ့ၫဒၪ, ယမွဲယွၩလၧ အမၩၥံၫဆၧဒဲမၩမၧၫ့ဆၧတၭ, ၦလဂၩနီၪအၪ့မၧၫ့ၦ ၡၩလဂၩ, ဘဲၫၥိၭဆၧမိမၩဘျၪထဲၩ့ အဆၧခံၫထူၬဆၫ အၧၩ့နီၪဆ့ဧၪး မၩအၥၭဘဲၫနီၪတၭၥ့ၪယၫ, ဒဲယိလၧ ၦလဂၩနီၪအၪ့ဎၬဆၧလမံၩ့မံၩ့ ထၫ့ဒၩယၧၩလီၫ.",
			"8": "<sup>8</sup> ထီးယွၩအၡၩစအံၫလဲၡၫ နါဂၧၫ့ဝ့ၫလၧအံၫစရ့လၭ အစဎွၩၡၫ့အကီၩ့အၥိၭတၭ, ဆၧမၩအၥၭလၧအအၪ့ မၧၫ့လၩ့ဆၧလၧစဎွၩအအီၪတၭ, စံၭဝ့ၫဒၪ,နၡၫ့နကီၩ့ နၥိၭနီၪမွဲဘၪလဲၪ မွဲၦလဂၩနီၪဂဲၫလါလၧယအီၪဆံၭ. တၭမိၥ့ၪယၫဝ့ၫလၧမီၪအီၪလၧ အံၫစရ့လၭအဖၧၩ့လ",
			"9": "<sup>9</sup> ဂၩလီၫ.- တၭစနၫအမၫ့ဂဲၫလၧကၥ့ၪလဖၪ, ဒဲအလဲၪ့ ကၥ့ၪတၭ,ဆၧၫ့ထုၪ့လၧ စအံၫလဲၡၫအဂံၪ့အတရၫ့ထံၭ",
			"10": "<sup>10</sup> လီၫ.- စအံၫလဲၡၫအၪ့မၧၫ့လၩ့အၥီၫ့လဂၩ လ့ၩလၧအ အီၪတၭ,စံၭဝ့ၫဒၪ, လ့ၩအၪ့လူထံၫလၧယီၫဒၫ့အဖၧၩ့ နးနွ့ၫဖၧၫ့ဆံၭ. နဖံၭနယၪမိဂဲၫထဲၩ့ထဲၩ့တၭ, နမိဆံၫ့",
			"11": "<sup>11</sup> ထၪ့လီၫ.- တၭစနၫအမၫ့အၥၭထၪ့တၭ, စဲၪ့ထၪ့ဝ့ၫ တၭ,စံၭဝ့ၫဒၪ,ယိခွါ, ယစံၭ,အဝ့ၫဒၪမိဂဲၫထၪ့လၧယ အီၪ,ဒဲမိဆၧၫ့ထုၪ့, ဒဲမိကိၭထၪ့အယွၩယဟိဝၩနီၪအ မံၩ့, ဒဲဖၧၫ့လ့ၬအလးလၧအစူၪနီၪ, ဒဲမၩဘျၪထဲၩ့ခံၫ",
			"12": "<sup>12</sup> ထူၬဆၫအၧၩ့လီၫ.- ဒမၭစကၧၭအထံၫချိၬအၭဘနၫ, ဒဲဖါဖၫနီၪဂ့ၩနဲၪ့အံၫစရ့လၭအထံၫလဖၪ ထီးအလူၬ, မွဲအ့ၬဧၪ. ယမိအၪ့လူထံၫလၧအဖၧၩ့တၭ,မိဆံၫ့ထၪ့ မွဲအ့ၬဧၪ. ကၠၪခွံၬအၥၭတၭ, စဲၪ့ထၪ့ဝ့ၫလၧအၥၭထၪ့",
			"13": "<sup>13</sup> လီၫ.- အခ့ၫအၡၩၥုၭဘူၭအၥၭတၭ, ချဲၩ့ဆၧလၧအဝ့ၫ တၭ,စံၭဝ့ၫ,ယဖါဧ့, မီၪလဂၩနီၪအ့ၪအၪ့မၧၫ့နၧၩလၧ ဆၧဖၭဒိၪလမံၩ့တၭ, နမိမၩ,မွဲအ့ၬဧၪး ထီးအစံၭနၧၩ အၪ့လူထံၫတၭ, ဆံၫ့ထၪ့ဆံၭနီၪ, မၩဝ့ၫအလးအီၪအၪ",
			"14": "<sup>14</sup> နဲၪ့ဒံၭဆံၭအၪလဲၪ.- ထီးနီၪလဖၧၫ့အဝ့ၫလ့ၩလၩ့တၭ, ဘၧၩ့လၩ့အၥၭလၧ ယီၫဒၫ့အဖၧၩ့နွ့ၫဖၧၫ့,ဘဲၫယွၩအ ၡၩစံၭဝ့ၫအၥိၭနီၪလီၫ. တၭအဖံၭအယၪဂဲၫထဲၩ့ထဲၩ့ ဘဲၫဖိၪၥၪဆံၭလဂၩအယၪအၥိၭနီၪတၭ, ဆံၫ့ထၪ့ဝ့ၫလီၫ.",
			"15": "<sup>15</sup> အဝ့ၫဒၪထဲၩ့ကဒၩထဲၩ့ လၧယွၩအၡၩအအီၪနီၪ, အဝ့ၫဒၪဒဲအၡၩလဒီၪ့ထီးအလူၬတၭ, ဂဲၫဆၧၫ့ထုၪ့လၧ အမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ,ယိခွါ, ဘိၩ့နဲၪ့ယီၩယၥ့ၪယၫ လၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫယွၩအီၪအ့ၬး အီၪန့ၫအံၫစရ့ လၭလစီၪ့လီၫ. ဘိၩ့နဲၪ့ယီၩမၩန့လါဆၧဆိၪဂ့ၩလၧ",
			"16": "<sup>16</sup> နခ့ၫနၡၩဆံၭ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယဟိဝၩလၧယ ဆၧၫ့ထုၪ့လၧအမ့ၬယၫမၧၫ့ဝ့ၫနီၪ, ယမၩန့ဆၧအ့ၬ. တၭအဝ့ၫဒၪပဂၨၪထၪ့အခဲၫ့လါနၫ့တၭ, မၩဝ့ၫအ့ၬ.",
			"17": "<sup>17</sup> တၭစနၫအမၫ့စံၭဝ့ၫဒၪ, မွဲၦမိဖ့ၪလၫ့လါနခ့ၫနၡၩလၧ ဂၪ့ခိၪဘျဲၩဆိၬလၧကၥ့ၪယီၩ့နံၫဒုၩအ့ၬဧၪ. အဂဲးဘဲၫ ယီၩဆၧလုမ့ၪမွဲဂ့ၩ, ဆၧလုမွဲဂ့ၩ, နခ့ၫနၡၩလုထၪ့ လၧၩ့လၧယွၩအဂူၫဂၩအ့ၬ. မိလုထၪ့ဆၧန့ၫယဟိဝၩ",
			"18": "<sup>18</sup> လဂၩဎးလီၫ.- လၧဆၧယီၩလမံၩ့ မွဲယဟိဝၩဖျါနခ့ၫ နၡၩအဆၧမၪဆံၭ. ထီးယကဆါလ့ၩနုၬလၧရံၭမိၫ့ အဂံၪ့ဖၧၩ့ဘဲၫၥိၭအမိဘိၪ့ဆၧဘၩဆၧနီၪ, ဒဲဒိၭနဲၩ့အ ၥၭလၧယစူၪ, ဒဲယကူၭလၩ့လၧရံၭမိၫ့အဂံၪ့ဖၧၩ့တၭး ထီးယအ့ၪကူၭလၩ့ လၧရံၭမိၫ့အဂံၪ့ဖၧၩ့နီၪ, မွဲယဟိ ဝၩဖျါခွံၬလါနခ့ၫနၡၩ အဆၧမၪလမံၩ့နီၪဆံၭ.",
			"19": "<sup>19</sup> တၭအဝ့ၫဒၪစံၭ, လ့ၩဆၧမုၬမုၬဆံၭ. အဝ့ၫစဲၪ့ထၪ့,",
			"20": "<sup>20</sup> ယဲၩ့ဖိၭဖၫ့လထၩ့လ့ၩကၪယူၭလီၫ.- ယွၩအၡၩစအံၫ လဲၡၫအခ့ၫအၡၩစဂံၫဟၫဇဲၫစံၭဝ့ၫဒၪ, ယိခွါ,ယက ဆါယၫ့ၥၭၦစံရအၫဖိၪ စနၫအမၫ့ယီၩ လၧအလထိး ဆၧၫ့ဘၪဆၧလၧအဂဲၫဆိၬဝ့ၫ လၧအစူၪနီၪလီၫ. ယဟိ ဝၩမၧၫ့ဝ့ၫနီၪ, ယမိလီၩ့ဆီးဝ့ၫ ဒဲမၩန့ဆၧလမံၩ့မံၩ့",
			"21": "<sup>21</sup> လၧအဝ့ၫလီၫ.- တၭစဂံၫဟၫဇဲၫလီၩ့ဆီး စနၫအမၫ့ တၭ,စနၫအမၫ့ဒၪဘၪအစဲၪ့ဖိၬအခဲၫ့တၭ, စဲၪ့လၩ့ဝ့ၫ လၧလဲၪ့ကၥ့ၪအဖၧၩ့း ဘဲၫၥိၭအမိလ့ၩအၪ့ဂၬဝ့ၫတၭ,",
			"22": "<sup>22</sup> စံၭဝ့ၫဒၪ, ဆၧအီၪမုၬထီးအလူၬဆ့ဧၪ.- တၭအဝ့ၫဒၪ စံၭ,မုၬထီးအလူၬလီၫ. ယကဆါအၪ့မၧၫ့လၩ့ယၧၩ တၭ,စံၭဝ့ၫဒၪ,ယိခွါ, ဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ, ၦဖိၪၥၪခွၫ လၧမီၪအဖိၪခွၫအကျၩနံၫဂၩ ဂဲၫလၧယအီၪ,လၧအံ ဖြံၫ့လီၫ. ဖ့ၪလၫ့လါအဝ့ၫၥံၪလၧစ့ၩလကံကၫ, ဒဲလၧ ဆၧကီၩ့ဆၧၥိၭလၧၦမိလုထၪ့အၥၭ နံၫဖၧၫ့အဂးဆံၭ.",
			"23": "<sup>23</sup> တၭစနၫအမၫ့စံၭဝ့ၫဒၪ, မွဲအဘၪနၥၭလၧနမၩန့နံၫကံ ကၫဆံၭ. ပဂၨၪထၪ့အခဲၫ့တၭ, စၧၩ့ထၬစ့ၩနံၫကံကၫ လၧထိၪ့နံၫဖျိၪ့အဖၧၩ့ အီၪလၧဆၧအကီၩ့အၥိၭ လၧၦ လုထၪ့အၥၭနံၫဖၧၫ့အဂးနီၪတၭ, အီၪက့ၪထၪ့ဝ့ၫလၧ အခ့ၫအၡၩနံၫဂၩအလီၩ့တၭ, အဝ့ၫၥံၪဆိၬဝ့ၫလၧအ",
			"24": "<sup>24</sup> မ့ၬယၫလီၫ.- ၦလ့ၩဝ့ၫထီၩ့လၧဆၧစီၩ့ခိၪတၭ, အဝ့ၫ မၩန့ဝ့ၫလၧအဝ့ၫၥံၪအစူၪဖၧၩ့တၭ, အီၪက့ၪဝ့ၫလၧဂံၪ့ ဖၧၩ့,ဒဲဖျါခွံၬၦၡၩလဖၪတၭ, အဝ့ၫၥံၪထဲၩ့ထဲၩ့ဝ့ၫဒၪ",
			"25": "<sup>25</sup> လီၫ.- အဝ့ၫဒၪလ့ၩနုၬဆၧၫ့ထုၪ့လၧ အကဆါအမ့ၬယၫ တၭ,စအံၫလဲၡၫစံၭအဝ့ၫ, စဂံၫဟၫဇဲၫဧ့, မွဲနလ့ၩခီၫ ခီၫလဲၪး တၭအဝ့ၫစံၭဆၧၫ့ဝ့ၫဒၪ, နခ့ၫနၡၩလ့ၩဆၧလၧ",
			"26": "<sup>26</sup> အံၩလၧအိၩနးစီၪ့အ့ၬ.- အဝ့ၫဒၪစံၭအဝ့ၫ,ထီးၦလဂၩ နီၪစဲၪ့လၩ့လၧလဲၪ့ကၥ့ၪ ဘဲၫၥိၭအမိဂဲၫထဲၩ့အၪ့ဂၬ နၧၩတၭ,ယၥၭအီၪဆ့မွဲအ့ၬဧၪ. မွဲအဆၧၫ့အထီလၧ ၦမိဒိၭန့စ့ၩ, ဒဲဒိၭန့ဆၧအကီၩ့အၥိၭၥံၪ, ဒဲၥံၪ့အလဲ အိၫ့အကျိၭၥံၪ, ဒဲစဘံၭမုအလးၥံၪ, ဒဲၥိၪၥံၪဘ့ၪၥံၪ,ဒဲ ချီဖၫၥံၪ,ဒဲဆၧအဎီးအၡၩခွၫၥံၪ, ဒဲဆၧအဎီးအၡၩမုၪ",
			"27": "<sup>27</sup> ၥံၪနီၪဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, စနၫအမၫ့အခံၫထူၬ ဆၫအၧၩ့မိဘုၭထၬလၧနၧၩ, ဒဲလၧနချံၫနၥၪလၩ့ဆိၩ လၩ့ကၠၪလီၫ. တၭအဝ့ၫဒၪစဲၪ့ထၪ့ဝ့ၫလၧအအီၪတၭ, ဘၪဆၧခံၫထူၬဆၫအၧၩ့, ဘွၩဘဲၫမူၭခိၪဖီၫ အၥိၭနီၪ လီၫ."
		},
		"6": {
			"1": "<sup>1</sup> တၭမီၪလဖၪအဖိၪခွၫၥံၪနီၪစံၭစအံၫလဲၡၫ, ယိခွါ, ဆၧအလးထီးပအီၪလၧနၥိၭယီၩ မွဲအံၪ့လၨၪလၧပဂး",
			"2": "<sup>2</sup> လီၫ.- ဒုၭလ့ၩလါပၧၩလၧယီၫဒၫ့တၭ, ဂဲၫထဲၩ့ဆိၬလ ဂၩၥံၪ့လကုၭ, လဂၩၥံၪ့လကုၭလၧယီၩတၭ, ဒုၭမၩ ပၧၩလၧဆၧအလးထီးပမိအီၪဘၪနီၪဆံၭ. တၭအဝ့ၫ",
			"3": "<sup>3</sup> ဒၪစံၭဆၧၫ့ဝ့ၫ, လ့ၩကဒၪဘီၪ.- တၭၦလဂၩစံၭဝ့ၫ,နဝ့ၫ ဒၪလ့ၩလါလၧနခ့ၫနၡၩအၥိၭဆံၭ. တၭအဆၧစံၭ",
			"4": "<sup>4</sup> ဆၧၫ့ဝ့ၫ,ယမိလ့ၩလီၫ. အခိးမွဲအလ့ၩလၧအဝ့ၫၥံၪအ ၥိၭတၭ,ထီၩ့ဝ့ၫလၧယီၫဒၫ့တၭ, အဝ့ၫၥံၪခူၬလၩ့ၥံၪ့",
			"5": "<sup>5</sup> လီၫ.- ၦလဂၩခူၬလၩ့ၥံၪ့လထံၭတၭ, အကွၩလၩ့ထ့ၬ လၧထံၫကျၩတၭ, အဝ့ၫဒၪကိၭထၪ့ဆၧစံၭဝ့ၫ,အၩလါ,",
			"6": "<sup>6</sup> ကဆါဧ့,အဂဲးဘဲၫယီၩ မွဲဆၧအၪ့လီးန့ဝ့ၫလီၫ.- တၭ ယွၩအၡၩစံၭဝ့ၫဒၪ,မွဲအလၩ့ထ့ၬ ခီၫခီၫလဲၪ. အဆၧ ဒုၭနဲၪဝ့ၫအလးတၭ, အဝ့ၫဒၪဖ့ၬန့နိၪကဲၩ့လဘီၩ့တၭ,",
			"7": "<sup>7</sup> ခွံၬလၩ့ဝ့ၫထီးနီၪတၭ, ထၭနီၪထၪ့ဖီၫဝ့ၫလီၫ.- တၭအ ဝ့ၫဒၪစံၭ,မၩန့ထၪ့လၧနအီၪဘီၪ, အဝ့ၫယူၬစိၩအစူၪ တၭ,မၩန့ဝ့ၫလီၫ.",
			"8": "<sup>8</sup> ထီးအထီနီၪစံရအၫအစဎွၩ ဒုၭဆၧထၫ့ဒၩအံၫစရ့ လၭတၭ, ကိၪ့လိၬအၥၭလၧအခ့ၫအၡၩ, စံၭဝ့ၫဒၪ,ယ",
			"9": "<sup>9</sup> ၥုၪ့တဲၩအလးမိအီၪထီးအံၩထီးအိၩလီၫ.- ယွၩအၡၩ အၪ့မၧၫ့လၩ့ဆၧလၧအံၫစရ့လၭ အစဎွၩအအီၪတၭ, စံၭဝ့ၫဒၪ,ထီးလၩ့နၥၭ ဘဲၫၥိၭနထီးလ့ၩဖီၩ့ခွံၬအလး ထီးနီၪလဂ့ၩ. အဂဲးဘဲၫယီၩၦစံရအၫဖိၪ ဂဲၫလၩ့ထီး",
			"10": "<sup>10</sup> နီၪလီၫ.- တၭအံၫစရ့လၭအစဎွၩ အၪ့မၧၫ့လၩ့ဆၧလၧ အလးလၧယွၩအၡၩလီၩဘၪဝ့ၫလၧ အဂဲးအကၠီၪ့ဒဲၥီၪ့ ဝ့ၫလၧအဘၪထီးလၩ့အၥၭတၭ, ဒုၭဖီၩ့ဖျ့ၭလၩ့အၥၭ ထီးနီၪလဖၧၫ့နံၫဖၧၫ့ကၭအ့ၬ.",
			"11": "<sup>11</sup> အခိးမွဲစံရအၫအစဎွၩ အၥုၪ့ခိအၥၭဝီၩလၧဆၧလ မံၩ့နီၪအကၠီၩ့တၭ, ကိၭန့အခ့ၫအၡၩတၭ,စံၭအဝ့ၫၥံၪ, ၦလၧပကျၩလၧအအီၪဝ့ၫလၧ အံၫစရ့လၭအဂးလဂၩ",
			"12": "<sup>12</sup> ဂၩလဲၪနီၪ,နၥံၪဒုၭနဲၪယၧၩအ့ၬဧၪ.- တၭအခ့ၫအၡၩ လဂၩစံၭဝ့ၫဒၪ, အီၪနးဂၩအ့ၬ,ယကဆါ,စဎွၩဧ့.အ့ၪ မွဲမီၪစအံၫလဲၡၫလၧအအီၪဝ့ၫ လၧအံၫစရ့လၭအကျၩ လဂၩနီၪ, လီၩဘၪအံၫစရ့လၭ အစဎွၩလၧဆၧချဲၩ့လၧ",
			"13": "<sup>13</sup> နချဲၩ့ဆၧလၧနဒူၭဖၧၩ့လီၫ.- တၭအဆၧစံၭဝ့ၫဒၪ,လ့ၩ ယိဂူၪဘီၪ,မွဲအအီၪခီၫခီၫလဲၪနီၪ, ယိခွါဆံၭ. ဘဲၫၥိၭ အမိအၪ့မၧၫ့လၩ့ဆၧတၭ, ဂဲၫထဲၩ့ဆိၬဝ့ၫလီၫ. တၭ ဆၧလီၩဘၪအဝ့ၫဒၪ,စံၭဝ့ၫ, ယိခွါ,အီၪဝ့ၫလၧဒိၥၫ့အ ဖၧၩ့လီၫ.",
			"14": "<sup>14</sup> အဝ့ၫဒၪအၪ့မၧၫ့လၩ့ကၥ့ၪလဖၪ, ဒဲလဲၪ့ၥုၭလဖၪ, ဒဲၥုၭမုခမျၧးဂဲၫဝ့ၫ လၧမုနၩလခီၫတၭ, ဝၩ့ထၬဒိၩ့နီၪ",
			"15": "<sup>15</sup> လီၫ.- ယွၩအၡၩအခ့ၫအၡၩ ဂဲထုၪ့ဂီၩဂီၩစဲၪ့ထၪ့ဝ့ၫ တၭ,ယိခွါ, ၦၥုၭမုခမျၧးဝၩ့ထၬဒိၩ့နီၪ အီၪလၧကၥ့ၪ လဖၪ,ဒဲလဲၪ့ၥုၭလဖၪလီၫ. တၭအခ့ၫအၡၩစံၭအဝ့ၫ,",
			"16": "<sup>16</sup> အၩလါ,ယကဆါဧ့, ပမိမၩဘဲၫၥ့ၪလဲၪ.- တၭအဆၧ စံၭဝ့ၫဒၪ,ၥၭမဲၪလဂ့ၩ. အဂဲးဘဲၫယီၩ ၦအီၪလၧပၥိၭ",
			"17": "<sup>17</sup> ယီၩအၪနဲၪ့ၦအီၪလၧအဝ့ၫၥံၪအၥိၭလီၫ.- စအံၫလဲၡၫ ဘၩဆိၪဖၪဆၧတၭ, စံၭဝ့ၫဒၪ,ယဟိဝၩဧ့, ဝဲထၪ့အ ဝ့ၫဒၪအမ့ၬၥၪဘဲၫၥိၭအမိဒၪဘၪဆၧဆံၭ. တၭယဟိ ဝၩ,ဝဲထၪ့ၦဖိၪၥၪခွၫလဂၩနီၪအမ့ၬၥၪတၭ, အဆၧဒၪ ဘၪဝ့ၫတၭ,ယိခွါ, ခိၪလီၩ့ထိၩ့ချိၬဎွ့ၩလၧကၥ့ၪ, ဒဲလဲၪ့",
			"18": "<sup>18</sup> မ့ၪ,အီၪဝၬဖီၩ့စအံၫလဲၡၫနီၪလီၫ.- ၦဂဲၫလၩ့လၧအအီၪ တၭ,စအံၫလဲၡၫဘၩဆိၪဖၪယဟိဝၩတၭ, စံၭဝ့ၫဒၪ, ထးလါၦခမျၧးယီၩ လၧအမ့ၬဘျီၪဆံၭ. တၭဆၧထး ဝ့ၫလၧအမ့ၬဘျီၪဘဲၫစအံၫလဲၡၫ အလူအၥိၭနီၪလီၫ.",
			"19": "<sup>19</sup> တၭစအံၫလဲၡၫစံၭအဝ့ၫၥံၪ, ဖၧၩ့ၥၭယီၩမွဲအ့ၬ, ဒဲဒိၩ့ ယီၩမွဲအ့ၬ. ဖိၬယခဲၫ့ဆံၭ. တၭယမိဒုၭလ့ၩနၥံၪလၧ ၦလၧနၥံၪအၪ့ဎၬဝ့ၫအအီၪလီၫ. တၭလ့ၩၥိၫ့ဝ့ၫလၧ",
			"20": "<sup>20</sup> စမ့ရအၫအဖၧၩ့လီၫ.- ထီးအထီၩ့လၧစမ့ရအၫအဖၧၩ့ တၭ,ဆၧမၩအၥၭလၧစအံၫလဲၡၫစံၭဝ့ၫဒၪ, ယဟိဝၩ ဧ့,ဝဲထၪ့ၦလဖၪယီၩအမ့ၬၥၪ ဘဲၫၥိၭအမိဒၪဘၪဆၧ ဆံၭ. တၭယဟိဝၩဝဲထၪ့အဝ့ၫၥံၪ အမ့ၬၥၪတၭ,ဒၪဘၪ ဆၧတၭ,ယိခွါ, အီၪဝ့ၫလၧစမ့ရအၫအၥၭကျၩလီၫ.",
			"21": "<sup>21</sup> ထီးအံၫစရ့လၭအစဎွၩဒၪဘၪဝ့ၫတၭ စံၭစအံၫလဲၡၫ, ယဖါဧ့,မွဲယမိကျီၪ့ဆ့ဧၪ, ယမိကျီၪ့ဆ့ဧၪ,တၭအဆၧ",
			"22": "<sup>22</sup> စံၭဝ့ၫဒၪ,ကျီၪ့လဂ့ၩ.- နမိကျီၪ့ဘၪၦလၧနဖီၪ့န့အၪ့ မၧၫ့ဎီးဝ့ၫလၧနနၭဒဲနချံၪဆ့ဧၪ, အီၪက့ၪလၩ့ကိၪဒဲထံၫ လၧအဝ့ၫၥံၪအမ့ၬယၫ ဘဲၫၥိၭအမိအၪ့ဆၧဒဲအီၩဆၧ,",
			"23": "<sup>23</sup> ဒဲထဲၩ့ဝ့ၫလၧအကဆါအအီၪနီၪဆံၭ.- တၭအဝ့ၫဒၪ တဲၩ့ဝဲၩဆၧအၪ့ဆၧအီၩ အၪအၪလ့ၬလၧအဝ့ၫၥံၪအဂး တၭ,အဝ့ၫၥံၪအၪ့ဆၧဒဲအီၩဆၧတၭ, စဎွၩဖျါခွံၬဝ့ၫ တၭ,အဝ့ၫၥံၪထဲၩ့ဝ့ၫလၧအကဆါအအီၪလီၫ. တၭစံ ရအၫအၡၩအဒီၪ့လဖၪ ဂဲၫလၧၩ့လၧအံၫစရ့လၭအခး ဖၧၩ့အ့ၬ.",
			"24": "<sup>24</sup> လၧခဲၫ့ထဲၩ့တၭဆၧမၩအၥၭ လၧစံရအၫ အစဎွၩ ဘံၫ့ဟၫဒၭဒုၭအီၪကီၪ့အၥုၭမုခမျၧး ထီးအလူၬတၭ,",
			"25": "<sup>25</sup> လ့ၩထၪ့ဝၩ့ထၬစမ့ရအၫနီၪလီၫ.- ဆၧၥၭဝံလၩ့ဒိၩဖၭ ဒိၪအီၪဝ့ၫလၧစမ့ရအၫအဖၧၩ့တၭ, ယိခွါ,ၦၡၩၥံၪ ဝၩ့ထၬဝ့ၫထီးကၥ့ၪယီၩ့ အခိၪဎွံၪအီၪဝ့ၫလၧစ့ၩအဘံၪ့ ဎိၭဆံၫအဂး, ဒဲထိၪလွံအအ့ၪလတလိၭ လံပိၩ့လပိၩ့",
			"26": "<sup>26</sup> လၧစ့ၩယဲဘံၪ့အဂးလီၫ.- ထီးအံၫစရ့လၭအစဎွၩလ့ၩ ဖီၩ့ခွံၬဆၧလၧဒိၩ့ခိၪဒၧၩ့အဖၫ့ခိၪတၭ, ၦမုၪလဂၩကိၭ ထၪ့အဝ့ၫတၭ, စံၭဝ့ၫ မၩဖီၩ့မၩဖျ့ၭဆၧ, ယကဆါ,",
			"27": "<sup>27</sup> စဎွၩဧ့,- တၭအဝ့ၫဒၪစံၭ, ယဟိဝၩအ့ၪလမၩဖီၩ့မၩ ဖျ့ၭဘၪနၧၩတၭ, ယမိမၩဖီၩ့မၩဖျ့ၭနၧၩ ခီၫခီၫလဲၪ, လၧခရဲးဖၧၩ့ဧၪ, မွဲလၧၦဘံၭစဘံၭၥၪအလးနီၪလဲၪ.",
			"28": "<sup>28</sup> တၭစဎွၩစံၭအဝ့ၫ, ဆၧဘၪနၧၩနီၪ,မွဲဆၧနီၪလမံၩ့လဲၪ. တၭအဝ့ၫဒၪစံၭ, ၦမုၪလဂၩယီၩစံၭယၧၩ, ဖ့ၪလၫ့နဖိၪ ခွၫဘဲၫၥိၭပမိအၪ့ဝ့ၫလၧမုဆၫလနံၩယီၩဆံၭ, တၭပမိ",
			"29": "<sup>29</sup> အၪ့ယဖိၪခွၫကဲဂီၩခိၬလနံၩလီၫ.- အခိးမွဲပအၪ့ဎွံထၪ့ ယဖိၪခွၫပအၪ့ခွံၬဝ့ၫတၭ, လၧမုဆဲၪ့ထၪ့လနံၩနီၪ,ယ စံၭၦမုၪယီၩ ဖ့ၪလၫ့နဖိၪခွၫ ဘဲၫၥိၭပမိအၪ့ဝ့ၫဆံၭ.",
			"30": "<sup>30</sup> တၭအဝ့ၫဒၪအီၪက့ၪၥူၪခွံၬယူၭအဖိၪခွၫယူၭ.- ထီး စဎွၩနါဂၧၫ့ၦမုၪအဆၧချဲၩ့နီၪတၭ, ဆၧမၩအၥၭလၧ အၡၫ့အကီၩ့အၥိၭ, ဒဲလ့ၩဖီၩ့ခွံၬလၧဒိၩ့ခိၪဒၧၩ့အဖၫ့ ခိၪတၭ, ၦခမျၧးယိဆၧတၭ, ယိခွါ, ရၧၬအဆၧယၬ",
			"31": "<sup>31</sup> အီၪဝ့ၫလၧအယၪအလီၩ့လီၫ.- ထီးနီၪလဖၧၫ့စံၭဝ့ၫ ဒၪ,စၡ့ဖၭအဖိၪခွၫ စအံၫလဲၡၫအခိၪဎွံၪ အ့ၪအီၪဒံၭ လၧအလီၩ့လၧမုဆၫလနံၩယီၩတၭ, မွဲယွၩမၩယၧၩ ဘဲၫနီၪ,ဒဲအၪနဲၪ့အနီၪဆံၭ.",
			"32": "<sup>32</sup> စအံၫလဲၡၫဆၧၫ့နၩ့လၧအဂံၪ့ဖၧၩ့တၭ, ၦၥုၪ့က့ၭၥၭ ၡါဆၧၫ့နၩ့လၧအၥိၭတၭ, စဎွၩအၪ့မၧၫ့လၩ့ၦလဂၩ လၧအမ့ၬယၫလီၫ. တၭအၥီၫ့လချႃၭထီၩ့ဒံၭဘၪလၧ အအီၪတၭ, စအံၫလဲၡၫစံၭ ၦၥုၪ့က့ၭၥၭၡါလဖၪနီၪ, ၦမၩၥံၫဘၪၦၡၩလဂၩအဖိၪခွၫယီၩ, အၪ့မၧၫ့လၩ့ဆၧ ဘဲၫၥိၭအမိမၩန့ခွံၬ ယခိၪဎွံၪနီၪ,ယိခွါ, နၥံၪဝ့ၫဆံၭ. ယိခွါ,ထီးအၥီၫ့အ့ၪဂဲၫထီၩ့တၭ, ကၭဘံၭထၬတရၫ့ တၭဖီၪ့ထၬခၧၫ့အဝ့ၫလၧ တရၫ့ထံၭနီၪဆံၭ. အကဆါ",
			"33": "<sup>33</sup> အခၪ့ၥီၫဝ့ၫလၧအလးခဲၫ့နီၪမွဲအ့ၬဧၪ.- အဝ့ၫချဲၩ့ဆၧ လၧအဝ့ၫၥံၪအဘိၩ့ဘၭတၭ, ယိခွါ,အၥီၫ့လဂၩနီၪ, ဂဲၫလၩ့လၧအအီၪလီၫ. အဝ့ၫဒၪစံၭ,ယိခွါ, ဆၧအၧၩ့ ယီၩဂဲၫလၧယဟိဝၩလီၫ. ယမိယိလါဒံၭယဟိဝၩ အဖၧၩ့ၥၭနီၪ,မွဲဘၪလဲၪ."
		},
		"7": {
			"1": "<sup>1</sup> တၭစအံၫလဲၡၫစံၭဝ့ၫဒၪ, ခိၭနၪယဟိဝၩအလူဆံၭး ယဟိဝၩစံၭဘဲၫယီၩ, ကဲဂီၩခိၬဆၧၫ့ထဲၩ့အလးဘဲၫ ယီၩကၪယူၭ, ကိၪမုၬလစ့အၫမိအီၪလၧစ့ၩ လၡက့ လၭအဂး, ဒဲဘုၪမုယီၩနံၫစ့အၫလၧစ့ၩလၡက့လၭအ",
			"2": "<sup>2</sup> ဂးလၧစမ့ရအၫအတရၫ့ဖၧၩ့လီၫ.- တၭၦဒိၪလၧစဎွၩ ဒိၭနဲၩ့အၥၭလၧအစူၪလဂၩ, စံၭဆၧၫ့ယွၩအၡၩတၭ, စံၭဝ့ၫဒၪ,ယိခွါ,ယဟိဝၩအ့ၪမၩဖိးဆၧလၧ မူၭခိၪတၭ, ဆၧယီၩမိမၩအၥၭဆ့ဧၪး တၭအဝ့ၫဒၪစံၭ,ယိခွါနမိ ဒၪဘၪလၧနမ့ၬၥၪလါနၫ့ဘိၩ, နအၪ့ဘၪဝ့ၫအ့ၬ.",
			"3": "<sup>3</sup> ၦခံၫထူၬဆၫအၧၩ့လံဂၩ အီၪဝ့ၫလၧဆၧလ့ၩနုၬလၧ တရၫ့အဖၧၩ့နီၪတၭ, စံၭဝ့ၫ, လဂၩဒဲလဂၩ,ပဆၧၫ့နၩ့",
			"4": "<sup>4</sup> ထီးယီၩထီးပၥံၫနီၪမွဲဘၪလဲၪ.- ပအ့ၪစံၭပမိလ့ၩနုၬ လၧဒိၩ့ဖၧၩ့တၭ, ဆၧၥၭဝံလၩ့ဒိၩအီၪဝ့ၫလၧဒိၩ့ဖၧၩ့ နီၪ,ပမိၥံၫထီးနီၪလီၫ. ပအ့ၪဆၧၫ့နၩ့ထီးယီၩတၭ, ပမိၥံၫဆ့လီၫ. ဘိၩ့နဲၪ့ယီၩ, ဂဲၫဘီၪ,မွဲပလ့ၩၡီၩ့လၧ ၦစံရအၫဖိၪ အၥုၭမုခမျၧးအကျၩဆံၭ. အဝ့ၫၥံၪအ့ၪ ဒုၭမၧၫ့ဒံၭပၧၩတၭ, ပမိမၧၫ့ဒံၭလီၫ. တၭအ့ၪမၩၥံၫ",
			"5": "<sup>5</sup> လါနၫ့ပၧၩတၭ, န့ၫပမိၥံၫလီၫ.- တၭလၧမုဂၪလၩ့နီၪ အဝ့ၫၥံၪဂဲထုၪ့ ဘဲၫၥိၭအမိလ့ၩလၧၦစံရအၫဖိၪ ၥုၪ့ တဲၩအလးအနဲၩ့ထံၭနီၪတၭ, ယိခွါ, ၦအီၪဝ့ၫနးဂၩ",
			"6": "<sup>6</sup> အ့ၬ.- တၭယဟိဝၩဒုၭနါဂၧၫ့ယူၭ ၦစံရအၫဖိၪအၥုၭ မုခမျၧးလၧလဲၪ့ၥုၭၥံၪအၥီၫ, ဒဲကၥ့ၪၥံၪအၥီၫ,ဆၧၥုၭ မုခမျၧးအၥီၫတၭ, အဝ့ၫၥံၪလဂၩဒဲလဂၩ, စံၭဝ့ၫဒၪ, ယိခွါ,အံၫစရ့လၭအစဎွၩ အၪ့လံၩ့ထၫ့ဒၩပၧၩလၧစ့ၩ လၧၦဟံၥၭဖိၪအစဎွၩလဖၪ, ဒဲၦအံဇံၭဖိၪအစဎွၩလ",
			"7": "<sup>7</sup> ဖၪ,ဘဲၫၥိၭအမိဂဲၫလၩ့ဘၪပၧၩလီၫ.- အခိးမွဲဆၧခံၭ လၩ့မံၭမူၭနီၪအဝ့ၫၥံၪဂဲထုၪ့စဲၪ့ခွံၬတၭ, အီၪက့ၪလၩ့ ထးအတဲၩၥံၪ, ဒဲအကၥ့ၪလဖၪ, ဒဲအကၥ့ၪယီၩ့လဖၪ, လၧၥုၪ့တဲၩအလးဘဲၫအအီၪဝ့ၫအၥိၭနီၪတၭ, စဲၪ့ဖျိၭ ဝ့ၫလၧအၥၭမၧၫ့အဂးလီၫ.",
			"8": "<sup>8</sup> ၦခံၫထူၬဆၫအၧၩ့လဖၪနီၪ ဂဲၫထီၩ့လၧဆၧၥုၪ့တဲၩ အလးအနဲၩ့ထံၭ, ဒဲလ့ၩနုၬလၧတဲၩလဖျိၪ့အဖၧၩ့တၭ, အၪ့ဆၧအီၩဆၧတၭ, ဆိၬထၪ့န့ခွံၬကျိၪၥံၪစ့ၩၥံၪ,ဒဲထီၫ့ ၥံၪလွ့ၫၥံၪ, ဒဲဆၧကီၩ့ဆၧၥိၭထီးနီၪတၭ, လ့ၩအီၪက့ၪ ၥူၪဝ့ၫတၭ,ဂဲၫထဲၩ့တၭ, လ့ၩနုၬလၧတဲၩအဂူၫဂၩလ ဖျိၪ့တၭ,ဆိၬခွံၬဆၧထီးနီၪတၭ, လ့ၩအီၪက့ၪၥူၪဝ့ၫ",
			"9": "<sup>9</sup> လီၫ.- တၭအဝ့ၫၥံၪလဂၩဒဲလဂၩ, စံၭလိၬအၥၭ,ပမၩ တီၩအ့ၬး ဆၧလၧမုဆၫလနံၩယီၩ မွဲဆၧၥၭထိၬအ ပရၧၫ့အမုလနံၩတၭ, ပဝ့ၫဒၪယီၩပအီၪလၩ့မါပံၭလီၫ. ပအ့ၪအီၪခိၭထီးဆၧဖၩ့ထၪ့တၭ, ဆၧအၧၩ့လမံၩ့မိ ဘၪပၧၩလီၫ. တၭဘိၩ့နဲၪ့ယီၩဂဲၫဘီၪ. မွဲပမိလ့ၩလီၩ",
			"10": "<sup>10</sup> ဘၪစဎွၩအၡၩဂံၪ့ဖိၪဆံၭ.- ဂဲၫဝ့ၫတၭ, ကိၭထၪ့လၧ ၦပၧၩ့ဒိၩ့အတရၫ့တၭ, လီၩဘၪဆၧလၧအဝ့ၫ, စံၭဝ့ၫ ဒၪ,ပလ့ၩလၧၦစံရအၫဖိၪၥုၪ့တဲၩအလးတၭ, ယိခွါ,ၦ ၡၩအီၪထီးနီၪနးဂၩအ့ၬ. တၭၦၡၩအၥီၫအီၪဆ့အ့ၬ. အီၪလၧကၥ့ၪစၧၩ့ထၬအၥၭ ဒဲကၥ့ၪယီၩ့ၥံၪစၧၩ့ထၬအ",
			"11": "<sup>11</sup> ၥၭ,ဒဲတဲၩလဖၪဘဲၫအလးလးအၥိၭနီၪလီၫ.- အဝ့ၫ ဒၪကိၭထၪ့ဝ့ၫလၧၦပၧၩ့တရၫ့လဖၪတၭ, အဝ့ၫၥံၪလီၩ ဘၪစဎွၩအၡၩဂံၪ့ဖိၪ လၧအအီၪဝ့ၫလၧအဖၧၩ့လခီၫ လီၫ.",
			"12": "<sup>12</sup> စဎွၩဂဲထုၪ့လၧမုနၩလခီၫတၭ, စံၭအခ့ၫအၡၩ,ဆၧ လၧၦစံရအၫဖိၪမၩပၧၩယီၩ ပမိဒုၭနဲၪနၥံၪလီၫ. အဝ့ၫ ၥံၪၥ့ၪယၫဝ့ၫလၧဆၧၥၭဝံပၥၭတၭ, စဲၪ့ထၪ့ဝ့ၫလၧၦၥုၪ့ တဲၩအလးဘဲၫၥိၭအမိအီၪက့ၪၥူၪအၥၭ လၧမံၩ့လၬ ကျၩတၭ,စံၭဝ့ၫဒၪ, ထီးအဝ့ၫၥံၪအ့ၪစဲၪ့ထၪ့ဝ့ၫလၧဒိၩ့ ဖၧၩ့တၭ,ပမိဖီၪ့န့မၧၫ့ဝ့ၫတၭ, လ့ၩနုၬလၧဒိၩ့ဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> အခ့ၫအၡၩလဂၩစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,ဒုၭမၩ န့လါၦ လဖၪလၧကၥ့ၪယဲဒုၩ လၧအအီၪထးဒံၭ,လၧ အအီၪလၩ့ထးလၧဒိၩ့ဖၧၩ့, (ယိခွါ,အဝ့ၫၥံၪမၩအၥၭ ဘဲၫအံၫစရ့လၭအၡၩခမျၧးထီးအလူၬ လၧအအီၪလၩ့ ထးလၧအဖၧၩ့အၥိၭ,ယိခွါ, အဝ့ၫၥံၪမၩအၥၭဘဲၫ အံၫစရ့လၭခမျၧးထီးအလူၬ လၧအလူၬယူၭအၥိၭ,)",
			"14": "<sup>14</sup> မွဲပအၪ့မၧၫ့လၩ့ၦလဖၪ လ့ၩယိဆၧဆံၭ.- မၩအၥၭ ဘဲၫနီၪတၭ, အဝ့ၫၥံၪမၩန့လဲၪ့ၥုၭအကၥ့ၪနံၫဒုၩတၭ, စဎွၩအၪ့မၧၫ့အလ့ၩဆီး ၦစံရအၫဖိၪ အၥုၭမုခမျၧး",
			"15": "<sup>15</sup> တၭ,စံၭဝ့ၫဒၪ,လ့ၩဆၧတၭ, ယိခွါဆံၭ.- အဝ့ၫၥံၪလ့ၩ ဆီးဝ့ၫထီၩ့လၧယီၫဒၫ့တၭ, ယိခွါ, ဖၧၩ့ၥၭထၧၫ့ဘီၩ့ ယၫဎွ့ၩလၧဆၧအကီၩ့အၥိၭ ဒဲဆၧအဎၧၩ့အဎီလၧ ၦစံရအၫဖိၪ ခွံၬၡိၭခွံၬလၧအၥၭမဲၪဆၧအကၠီၩ့လီၫ. အၥီၫ့လဖၪနီၪ ဂဲၫထဲၩ့ကဒၩထဲၩ့တၭ, လီၩဘၪစဎွၩ လီၫ.",
			"16": "<sup>16</sup> တၭၦခမျၧးစဲၪ့ထၪ့အၪ့ဂူၬန့ ဆၧအီၪလၧၦစံရအၫ ဖိၪအတဲၩဖၧၩ့လီၫ. ထီးနီၪလဖၧၫ့ကိၪမုၬလစ့အၫအီၪဝ့ၫ လၧစ့ၩလၡက့လၭအဂး, ဒဲဘုၪမုယီၩနံၫစ့အၫလၧစ့ၩ လၡက့လၭအဂး, ဘဲၫယဟိဝၩအလူအၥိၭနီၪလီၫ.",
			"17": "<sup>17</sup> တၭစဎွၩအီၪက့ၪလၩ့ ၦဒိၪလၧအဒိၭနဲၩ့အၥၭလၧအ စူၪအလီၩ့လဂၩလၧအဘၪပၧၩ့တရၫ့လီၫ. ၦခမျၧးယဲး ဘၪအဝ့ၫလၧတရၫ့အဖၧၩ့တၭ, ၥံၫဝ့ၫ,ဘဲၫယွၩအၡၩ",
			"18": "<sup>18</sup> စံၭဝ့ၫအၥိၭလၧစဎွၩဂဲၫလၧအအီၪအခၫနီၪလီၫ.- တၭ ဆၧလၧၫ့ထၪ့ဎွ့ၩထၪ့ဘဲၫယွၩ အၡၩချဲၩ့ဆၧလၧစဎွၩ အၥိၭနီၪ, လၧအစံၭဝ့ၫ, ဘုၪမုယီၩနံၫစ့အၫလၧစ့ၩလၡ က့လၭအဂး, ဒဲကိၪမုၬလစ့အၫ လၧစ့ၩလၡက့လၭအ ဂးနီၪမိအီၪကဲဂီၩခိၬလနံၩအခၫယီၩ ကၪယူၭ,လၧစမ့",
			"19": "<sup>19</sup> ရအၫအတရၫ့ဖၧၩ့နီၪလီၫ.- တၭၦဒိၪလဂၩနီၪစံၭဆၧၫ့ ယွၩအၡၩ,စံၭဝ့ၫဒၪ, ယိခွါ, ယဟိဝၩအ့ၪမၩဖိးဆၧ လၧမူၭခိၪတၭ, ဆၧမိမၩအၥၭဘဲၫဆၧလမံၩ့နီၪအၥိၭ ဆ့ဧၪ.တၭအဝ့ၫဒၪစံၭ, ယိခွါ, နမိဒၪဘၪလၧနမ့ၬၥၪ",
			"20": "<sup>20</sup> လါနၫ့တၭ,နအၪ့ဘၪဝ့ၫအ့ၬ,- တၭဆၧမၩအၥၭလၧ အဂးဘဲၫနီၪလီၫ. ၦခမျၧးယဲးလၩ့ဘၪအဝ့ၫလၧတရၫ့ ဖၧၩ့တၭ, ၥံၫဝ့ၫလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> စအံၫလဲၡၫချဲၩ့ဒုၪ့ၦမုၪ လၧအဒုၭမၧၫ့ထၪ့ထဲၩ့အ ဖိၪခွၫလဂၩနီၪတၭ, စံၭဝ့ၫ,ဂဲထုၪ့, လ့ၩဆၧ,နဝ့ၫဒၪ ဒဲနၡၩဂံၪ့ဖိၪလဖၪတၭ, အီၪၦမွံၩထီးဒၪအလးလၧနမိ အီၪၦမွံၩဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩကိၭန့ဆၧၥၭဝံ",
			"2": "<sup>2</sup> လၩ့ဒိၩတၭ, မိဂဲၫဘၪဆ့ထံၫၥံၪခးၥံၪနွ့ၫနံၪ့လီၫ.- ၦမုၪ နီၪဂဲထုၪ့တၭ, မၩဝ့ၫဘဲၫယွၩအၡၩအလူအၥိၭတၭ, လ့ၩဆၧ, အဝ့ၫဒၪဒဲအၡၩဂံၪ့ဖိၪလဖၪတၭ, အီၪၦမွံၩ",
			"3": "<sup>3</sup> လၧၦဖလံၡၫဖိၪအခးဖၧၩ့နွ့ၫနံၪ့လီၫ.- တၭနွ့ၫနံၪ့အ ထုၬနီၪဆၧမၩအၥၭ လၧၦမုၪလဂၩနီၪ, ဂဲၫထဲၩ့ထဲၩ့ လၧၦဖလံၡၫဖိၪအခးဖၧၩ့တၭ, လ့ၩကိၭထၪ့စဎွၩလၧ",
			"4": "<sup>4</sup> အဂံၪ့အဂး ဒဲလၧအဂၪ့ခိၪအဂးလီၫ.- တၭစဎွၩချဲၩ့ ဆၧလၧယွၩအၡၩအခ့ၫအၡၩ, စဂံၫဟၫဇဲၫ,စံၭဝ့ၫဒၪ, ကယဲဆၧလၧအဒိၪလဖၪ လၧစအံၫလဲၡၫမၩယူၭဝ့ၫ နီၪ,လီၩဘၪယၧၩ ထီးအလူၬဆံၭ.- အဝ့ၫလီၩဘၪ စဎွၩလၧအဒုၭမၧၫ့ထၪ့ဆၧၥံၫအဘိၩ့ဘၭတၭ, ယိခွါ, ဆၧမၩအၥၭလၧၦမုၪ လၧအဆၧဒုၭမၧၫ့ထၪ့ထဲၩ့အဖိၪ ခွၫလဂၩနီၪ, ကိၭထၪ့စဎွၩလၧအဂံၪ့အဂး, ဒဲလၧအ",
			"5": "<sup>5</sup> ဂၪ့ခိၪအဂးလီၫ.- တၭစဂံၫဟၫဇဲၫစံၭဝ့ၫဒၪ, ယကဆါ, စဎွၩဧ့,အဝ့ၫဒၪယီၩမွဲၦမုၪနီၪတၭ, အဝ့ၫဒၪယီၩမွဲအ",
			"6": "<sup>6</sup> ဖိၪခွၫလၧစအံၫလဲၡၫ ဒုၭမၧၫ့ထၪ့ထဲၩ့ဝ့ၫလီၫ.- တၭ စဎွၩအၪ့စၪ့ၦမုၪတၭ, အဆၧလီၩဘၪဝ့ၫလီၫ. စဎွၩ အီၪက့ၪလၩ့ ၦဒိၪလဂၩ လၧအဂးတၭ, စံၭဝ့ၫဒၪ,ခီၫ လၧမုနံၩလၧအဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬ လၧဂၪ့ခိၪနီၪခီးဘိၩ့ နဲၪ့ယီၩနီၪ ဖ့ၪထဲၩ့ကယဲအဆၧ, ဒဲအဂၪ့ခိၪအဆၧၥၪ ထီးအလူၬဆံၭ.",
			"7": "<sup>7</sup> စအံၫလဲၡၫဂဲၫထီၩ့လၧဒမၭစကၧၭတၭ, စံရအၫအ စဎွၩဘံၫ့ဟၫဒၭနီၪဘၪဆၧဆၫတၭ, ၦလီၩဘၪအဝ့ၫ,",
			"8": "<sup>8</sup> စံၭဝ့ၫဒၪ, ယွၩအၡၩဂဲၫထီးယီၩလီၫ.- စဎွၩစံၭစဟၭ ဇအ့လၭမၩန့လၬဆီၪ့ လၧနစူၪဖၧၩ့တၭ, လ့ၩလၧယွၩ အၡၩအအီၪတၭ, အၪ့စၪ့ယဟိဝၩလၧအဝ့ၫအစူၪဖၧၩ့",
			"9": "<sup>9</sup> တၭ,စံၭ, ဆၧဆၫယီၩမိဘျၪထဲၩ့ဆ့ဧၪ,နီၪဆံၭ.- စဟၫ ဇအ့လၭနီၪ လ့ၩလၧအအီၪ, လၬဆီၪ့အီၪလၧအစူၪ ဖၧၩ့,ကယဲဆၧဂ့ၩလၧဒမၭစကၧၭ ဘျဲၩဆိၬကလအူၭ လံဆံၫတၭ, ဂဲၫဝ့ၫ, ဒဲဆၧၫ့ထုၪ့လၧအမ့ၬယၫတၭ, စံၭ ဝ့ၫဒၪ,နဖိၪခွၫ, စံရအၫအစဎွၩဘံၫ့ဟၫဒၭ အၪ့မၧၫ့လၩ့ ယၧၩလၧနအီၪတၭ, စံၭဝ့ၫဒၪ, ဆၧဆၫယီၩမိဘျၪထဲၩ့",
			"10": "<sup>10</sup> ဒဲယမိမၧၫ့ဒံၭဆ့ဧၪ.- တၭစအံၫလဲၡၫစံၭအဝ့ၫ, လ့ၩ လီၩဘၪဝ့ၫ, မၧၫ့ဒံၭတၭ, နမၧၫ့နီၪအလးအီၪလါနၫ့",
			"11": "<sup>11</sup> တၭ,ယဟိဝၩဒုၭနဲၪယၧၩ လၧနမိၥံၫတၡါလီၫ.- အီၪ က့ၪအမ့ၬ, ဒဲယိဆၧထံၫထံၫထီးအမ့ၬမဲတၭ, ယွၩအ",
			"12": "<sup>12</sup> ၡၩအမ့ၬထံၫလၩ့လီၫ. တၭစဟၫဇအ့လၭစံၭဝ့ၫဒၪ, ယကဆါအမ့ၬထံၫလၩ့နီၪ, မွဲဘၪလဲၪ. တၭအဝ့ၫဒၪ စံၭ,အဂဲးဘဲၫယီၩ ယၥ့ၪယၫဆၧအၧၩ့လၧနမိမၩၦအံၫ စရ့လၭဖိၪလီၫ. အထိၬလဖၪနီၪနမိဆူၭထၪ့ခွံၬလၧမ့ၪ တၭ,အဖိၪၥၪခွၫလဖၪနီၪ နမိမၩၥံၫလၧနၭတၭ,နမိခွံၬ လၩ့ခွံၬအဖိၪဆံၭတၭ, နမိဎွ့ၭဖၭၦမုၪလၧအဒၧၩ့လီၫ.",
			"13": "<sup>13</sup> တၭစဟၫဇအ့လၭစံၭဝ့ၫဒၪ, မွဲဘဲၫၥ့ၪလဲၪ, နခ့ၫနၡၩ မွဲထွံၪလဒုၩ လၧအမိမၩဆၧဒိၪလမံၩ့နီၪဆ့ဧၪ. တၭ စအံၫလဲၡၫစံၭဆၧၫ့ဝ့ၫဒၪ, ယဟိဝၩဒုၭနဲၪယူၭယၧၩ",
			"14": "<sup>14</sup> လၧနမိကဲၪထၪ့စံရအၫအစဎွၩလီၫ.- အဝ့ၫဒၪစဲၪ့ထၪ့ ခွံၬလၧစအံၫလဲၡၫအအီၪတၭ, ဂဲၫဝ့ၫလၧအကဆါအ အီၪနီၪ,အဝ့ၫဒၪစံၭ, မွဲစအံၫလဲၡၫစံၭနၧၩလၧဆၧနီၪ လမံၩ့လဲၪး အဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, စံၭယၧၩ, နမိဘျၪထဲၩ့",
			"15": "<sup>15</sup> တၡါလီၫ.- တၭလၧမုဆဲၪ့ထၪ့လနံၩနီၪ ဆၧမၩအၥၭ လၧအမၩန့ဆၧကဲၩ့ယၬတၪ့လဘံၪ့တၭ, စုၪလၩ့ဝ့ၫ လၧထံၫကျၩတၭ, ဒၩလၩ့ဝ့ၫလၧစဎွၩအမ့ၬအဖၫ့ခိၪ တၭ,အဆၧၥံၫဝ့ၫဒၪတၭ, စဟၭဇအ့လၭကဲၪစဎွၩလၧ အလးလီၫ.",
			"16": "<sup>16</sup> တၭအံၫစရ့လၭအစဎွၩ အၫဟၭအဖိၪခွၫစယိရၫ့ အနံၪ့ယဲနံၪ့လနံၪ့နီၪ (စယဟီၡဖၭမွဲယုဒၫအစဎွၩ) ယုဒၫအစဎွၩစယဟီၡဖၭအဖိၪခွၫ စယဟိရၫ့ကဲၪၥၫ့",
			"17": "<sup>17</sup> စဎွၩလီၫ.- လၧအကဲၪၥၫ့စဎွၩနီၪ အၥၭၡါၥၧၫ့ဆံၫနံၫ နံၪ့တၭ,ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့နီၪ ဎိၭနံၪ့လီၫ.",
			"18": "<sup>18</sup> တၭဖိၬအံၫစရ့လၭလဖၪအဖၧၩ့ၥၭ, ဘဲၫစအၫဟၭအ ၡၩဂံၪ့ဖိၪအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ စအၫဟၭအဖိၪ မုၪလဂၩမွဲအမၫတၭ, အဝ့ၫဒၪမၩဆၧအၧၩ့လၧယဟိ",
			"19": "<sup>19</sup> ဝၩအမ့ၬယၫဆ့လီၫ.- လါနၫ့တၭ ယဟိဝၩမၩဂၭဂီၩ့ ယုဒၫနီၪအၥၭလအီၪဘၪ, လၧအခ့ၫအၡၩစဒၫဝံၭအ ကၠီၩ့,ဘဲၫအစံၭဝဲၩ လၧအမိဖ့ၪလၫ့အဖိၪအလံၩလၧ",
			"20": "<sup>20</sup> ဆၧဖၩ့လဖျိၪ့လထံၪဎးဘီၩ့ဎးအၥိၭနီၪလီၫ.- လၧအ နံၩလဖၪနီၪအံဒၧၫ့ပိၩ့ထၪ့ဆၧတၭ, စဲၪ့ထၪ့ခွံၬလၧယု ဒၫအစူၪဖၫ့လၬတၭ, အီၪက့ၪထၪ့စဎွၩ လၧအနၫ့ဆါ ၥံၪအဖၫ့ခိၪလီၫ.",
			"21": "<sup>21</sup> စယိရၫ့အီၪက့ၪလၩ့အၥၭ လၧစဇၫအၧၫအစူၪဖၧၩ့ ဒဲလဲၪ့ကၥ့ၪထီးအလူၬ အီၪလၧအၥိၭတၭး ဂဲထုၪ့လၧ မုနၩလခီၫတၭ, ကျီၪ့ခွံၬၦအံဒၧၫ့ဖိၪ လၧအအီၪဝၬဖီၩ့ ဝ့ၫဒဲလဲၪ့ၥုၭအခိၪလဖၪတၭ, ၦခမျၧးၥံၪစဲၪ့ဖျိၭလၧအ",
			"22": "<sup>22</sup> တဲၩလဖၪအဖၧၩ့လီၫ.- တၭအံဒၧၫ့ပိၩ့ထၪ့ဆၧတၭ,စဲၪ့ ထၪ့ခွံၬလၧယုဒၫအစူၪဖၫ့လၬ ထီးမုဆၫလနံၩယီၩ လီၫ.ထီးနီၪလဖၧၫ့ လံဘနၫပိၩ့ထၪ့ဆၧအဆၧၫ့အထီ လဖၧၫ့ဎးလီၫ.",
			"23": "<sup>23</sup> ဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧစယိရၫ့, ဒဲကယဲဆၧ လၧအမၩဝ့ၫနီၪကွ့ၭအၥၭလၧ ယုဒၫအစဎွၩအလံၬကွ့ၭနဲၪ့",
			"24": "<sup>24</sup> ဆၧအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.- စယိရၫ့မံၫဝ့ၫလၧအဖါၥံၪ အၥိၭတၭ, ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧ အဖါၥံၪအၥိၭလၧ စဒၫဝံၭအဒိၩ့ဖၧၩ့တၭ, အဖိၪခွၫစအၫဟဇဲအၫကဲၪထၪ့ စဎွၩလၧအလးနီၪလီၫ.",
			"25": "<sup>25</sup> အံၫစရ့လၭအစဎွၩအၫဟၭ အဖိၪခွၫစယိရၫ့အနံၪ့ လဆံၫနံၫနံၪ့နီၪ, ယုဒၫအစဎွၩစယဟိရၫ့အဖိၪခွၫစအၫ",
			"26": "<sup>26</sup> ဟဇဲအၫကဲၪၥၫ့စဎွၩလီၫ.- လၧစအၫဟဇဲအၫကဲၪၥၫ့ စဎွၩနီၪအၥၭၡါယူၭနံၫဆံၫနံၫနံၪ့တၭ, ကဲၪစဎွၩလၧ ယရုစလံၫ့အဖၧၩ့လနံၪ့လီၫ. အမိအမံၩ့မွဲနးအၫၥလဲ",
			"27": "<sup>27</sup> အၫ,အံၫစရ့လၭအစဎွၩ အီမြဲၫအဖိၪမုၪနီၪလီၫ.- အဝ့ၫ ဖိၬစအၫဟၭအၡၩဂံၪ့ဖိၪအဖၧၩ့ၥၭတၭ, မၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬယၫ, ဘဲၫစအၫဟၭ အၡၩဂံၪ့ဖိၪ အၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩမွဲအမၬ လၧစအၫဟၭအ",
			"28": "<sup>28</sup> ၡၩဂံၪ့ဖိၪအကျၩလီၫ.- အဝ့ၫဒၪလ့ၩလၧစအၫဟၭ အဖိၪခွၫစယိရၫ့အၥိၭ လၧဆၧဒုၭၥုၭလၧစံရအၫအ စဎွၩဟၭဇအ့လၭ လၧရၫမီၭဂံလအၭအဖၧၩ့တၭ, ၦ",
			"29": "<sup>29</sup> စံရအၫဖိၪဆ့ၭစယိရၫ့လီၫ.- တၭစဎွၩယိရၫ့ထဲၩ့ကဒၩ ထဲၩ့လၧယံၭစရ့လၭ, ဘဲၫၥိၭအဆၧဖၧၩ့လးလၧၦစံရ အၫဖိၪမၩဝ့ၫလၧရၫမၫ ထီးအဒုၭၥုၭလၧစံရအၫအ စဎွၩဟၭဇအ့လၭလဂၩနီၪ မိဘျၪထဲၩ့ဝ့ၫလီၫ. တၭ ယုဒၫအစဎွၩယဟိရၫ့အဖိၪခွၫ စအၫဟဇဲအၫနီၪလ့ၩ လၩ့အီၪၡီၩ့ စအၫဟၭအဖိၪခွၫ စယိရၫ့ လၧယံၭစရ့ လၭအဖၧၩ့နီၪး အဂဲးဘဲၫယီၩဆၫဝ့ၫလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> မီၪစအံၫလဲၡၫနီၪကိၭန့မီၪလဖၪ အဖိၪခွၫလဂၩတၭ, စံၭဝ့ၫ,ခဲးထူၬနယးဒံၩ့တၭ, မၩန့ၥိၪလပလၫ့ယီၩလၧ",
			"2": "<sup>2</sup> နစူၪဖၧၩ့တၭ,လ့ၩလၧရၫမီၭဂံလအၭဆံၭ.- ထီးနအ့ၪ ထီၩ့ထီးနီၪတၭ, ယိစနံၫ့ၡံၫအဖိၪခွၫ စယဟီၡဖၭအ ဖိၪခွၫစယံဟုၫထီးနီၪတၭ, လ့ၩနုၬ, ဒုၭဂဲထုၪ့အဝ့ၫလၧ အထၧၫ့ဖုဝဲၥံၪအကျၩတၭ, ဒုၭလ့ၩနုၬဝ့ၫလၧဒူၭလၧ",
			"3": "<sup>3</sup> ယၫလခီၫအဖၧၩ့ဆံၭ. ထီးနီၪလဖၧၫ့မၩန့ၥိၪလပလၫ့ ဂါလၩ့လၧအခိၪဎွံၪတၭ, စံၭ, ယဟိဝၩစံၭဘဲၫယီၩ, ယဂုၪနၧၩလၧစဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪလီၫ. ထီး နီၪလဖၧၫ့ဝဲထၪ့တရၫ့, စဲၪ့ထၪ့ခွံၬ, အီၪယံၬအီၪနးလ",
			"4": "<sup>4</sup> ဂ့ၩ.- တၭဖိၪၥၪခွၫ, မီၪလဂၩနီၪ, လ့ၩထီၩ့လၧရၫမီၭ ဂံလအၭနီၪလီၫ.",
			"5": "<sup>5</sup> လ့ၩထီၩ့ဝ့ၫတၭ, ယိခွါ,ၥုၭမုခမျၧးအခိၪလဖၪဆၧၫ့ နၩ့ဝ့ၫတၭ, အဝ့ၫဒၪစံၭ, ယချဲၩ့ဆၧလၧနၧၩအလးအီၪ, ဆၧအခိၪဧ့, တၭစယံဟုၫစံၭဝ့ၫဒၪ, လၧၦထီးအလူၬ ယီၩအကျၩနီၪ, လဂၩဂၩလဲၪ. တၭအဝ့ၫဒၪစံၭ,လၧ",
			"6": "<sup>6</sup> နၧၩ,ဆၧအခိၪဧ့,- အဝ့ၫဒၪဂဲထုၪ့လ့ၩနုၬလၧဂံၪ့ဖၧၩ့ တၭ,ၦလဂၩနီၪဂါလၩ့ၥိၪ လၧအခိၪဎွံၪအဖၫ့ခိၪတၭ, စံၭဝ့ၫ,ယဟိဝၩအံၫစရ့လၭအယွၩ စံၭဘဲၫယီၩ,ယဂုၪ နၧၩလၧစဎွၩလၧယဟိဝၩ အၡၩခမျၧးအဖၫ့ခိၪ,လၧ",
			"7": "<sup>7</sup> အံၫစရ့လၭအဖၫ့ခိၪလီၫ.- တၭနမိကျီၪ့ခွံၬ နကဆါ စအၫဟၭအၡၩဂံၪ့ဖိၪ, ဘဲၫၥိၭယမိမၩဆၧၫ့ဆၧအၧၩ့ လၧယခ့ၫယၡၩမီၪလဖၪအၥွံၪ, ဒဲယဟိဝၩအခ့ၫအၡၩ ထီးအလူၬအၥွံၪ, လၧနးယ့ၭဇဘ့လၭအစူၪဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> စအၫဟၭအၡၩဂံၪ့ဖိၪထီးအလူၬ မိထီၩ့လၧဆၧဂၭဂီၩ့ တၭ,ယမိဒၪ့ထ့ၬခွံၬ ၦဘၪဆဲၫ့လၧစအၫဟၭလၧကယဲ အခွၫလဖၪထီးအလူၬ ဒဲၦလၧအဘၪဆၧဒုၭထၬဝ့ၫဒဲ",
			"9": "<sup>9</sup> အီၪလၩ့ထးဝ့ၫလၧအံၫစရ့လၭအဖၧၩ့လီၫ.- တၭယ မိအီၪက့ၪစအၫဟၭအဂံၪ့ ဘဲၫစနံဘၭအဖိၪခွၫ စယ့ၫ ရဘိအၫ့အဂံၪ့အၥိၭနီၪ, ဒဲဘဲၫစအဟဲယၫ အဖိၪခွၫ",
			"10": "<sup>10</sup> စဘၫအၡၫအဂံၪ့အၥိၭနီၪလီၫ.- ထွံၪလဖၪမိအၪ့နး ယ့ၭဇဘ့လၭ လၧယံၭစရ့လၭအလးဖၧၩ့တၭ, ၦခုၪ့ လၩ့ဘၧၩ့ခွံၬဝ့ၫ အီၪနးဂၩအ့ၬ. အဝ့ၫဒၪဝဲထၪ့တရၫ့ တၭ,စဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ.",
			"11": "<sup>11</sup> စယံဟုၫဂဲၫထၪ့လၧအကဆါ အခ့ၫအၡၩၥံၪအအီၪ တၭ,အလဂၩစံၭအဝ့ၫ, ဆၧအမုၬဆ့ဧၪ.ၦအဖျႃလဂၩ နီၪဂဲၫလၧနအီၪ, မွဲဘၪလဲၪ. တၭအဝ့ၫလီၩဘၪအဝ့ၫ",
			"12": "<sup>12</sup> ၥံၪ,နၥံၪၥ့ၪယၫၦလဂၩနီၪ ဒဲအချဲၩ့ဆၧဆ့လီၫ.- တၭ အဝ့ၫၥံၪစံၭဝ့ၫ, နချဲၩ့ဆၧဘၪအ့ၬ. လီၩဘၪလါပၧၩ ဆံၭ.အဆၧစံၭဝ့ၫ အဝ့ၫဒၪစံၭယၧၩဘဲၫအံၩဘဲၫအိၩ တၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩစံၭဘဲၫယီၩ, ယဂုၪယူၭနၧၩ",
			"13": "<sup>13</sup> လၧစဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪယူၭ.- ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪမၩဝ့ၫချဲၫ့ချဲၫ့တၭ, မၩန့လဂၩအဖၬဘဲၩ့ဒၪဝ့ၫ, လဂၩအဖၬဘဲၩ့ဒၪဝ့ၫတၭ, ဒၩလၩ့ဝ့ၫလၧဎၫ့အၥွၫဒၪ လ့ၬအဖၫ့ခိၪ, လၧအဝ့ၫလဂၩအဖၫ့လၬတၭ, အူၪထၪ့ ခွ့ၩလဖၪတၭစံၭဝ့ၫဒၪ, စယံဟုၫကဲၪယူၭစဎွၩယူၭ.",
			"14": "<sup>14</sup> တၭစနံၫ့ၡံၫအဖိၪခွၫစယဟီၡဖၭ အဖိၪခွၫစယံဟုၫနီၪ, အုၩ့လၩ့ဆၧထၫ့ဒၩစယိရၫ့လီၫ. (တၭစယိရၫ့ပၧၩ့ရၫ မီၭဂံလအၭ, အဝ့ၫဒၪဒဲအံၫစရ့လၭထီးအလူၬ, လၧစံ",
			"15": "<sup>15</sup> ရအၫအစဎွၩ ဟၭဇအ့လၭအကၠီၩ့လီၫ.- တၭစဎွၩ ယိရၫ့ဂဲၫထဲၩ့ကဒၩထဲၩ့, ဘဲၫၥိၭအဖၧၩ့လးလၧၦစံရ အၫဖိၪမၩဝ့ၫ, ထီးအဒုၭၥုၭ လၧစံရအၫ အစဎွၩဟၭ ဇအ့လၭလဂၩနီၪ မိဘျၪထဲၩ့လီၫ.) တၭစယံဟုၫစံၭ ဝ့ၫဒၪ,အ့ၪဘၪနၥံၪအၥၭတၭ, ထီးဒုၭစဲၪ့ထၪ့ဖီၩ့ဖျ့ၭ ၦလၧဒိၩ့ဖၧၩ့, ဘဲၫၥိၭအမိလ့ၩလီၩဘၪ ဆၧလၧယံၭ စရ့လၭအဖၧၩ့နီၪနးဂၩလဂ့ၩ.",
			"16": "<sup>16</sup> စယံဟုၫထူၬလဲၪ့ၥုၭတၭ, လ့ၩထီၩ့လၧယံၭစရ့လၭ လီၫ. အဂဲးဘဲၫယီၩစယိရၫ့မံၫနၩ့ဝ့ၫထီးနီၪလီၫ. တၭ ယုဒၫအစဎွၩစအၫဟဇဲအၫ ဂဲၫလၩ့အီၪၡီၩ့ စယိရၫ့",
			"17": "<sup>17</sup> ထီးနီၪလီၫ.- ၦခိၭဆၧလဂၩ ဆၧၫ့ထုၪ့လၧတၨၭထီၫ အဖၫ့ခိၪလၧယံၭစရ့လၭအဖၧၩ့တၭ, ဒၪဘၪစယံဟုၫ အၡၩလဒီၪ့ဂဲၫဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ယဒၪဘၪၦလဒီၪ့ လီၫ.စယိရၫ့စံၭဝ့ၫဒၪ, မၩန့ၦကၥ့ၪၥုၭဖိၪလဂၩတၭ, အၪ့မၧၫ့အလ့ၩအၪ့ဂၬဝ့ၫတၭ, မိဘၪစံၭ, ဆၧဘၪလိၬ",
			"18": "<sup>18</sup> အိၭလိၬဆ့ဧၪ.- ၦထူၬကၥ့ၪလဂၩလ့ၩအၪ့ဂၬဝ့ၫတၭ, စံၭဝ့ၫဒၪ, စဎွၩစံၭဘဲၫယီၩ, ဆၧဘၪလိၬအိၭလိၬဆ့ဧၪ. တၭစယံဟုၫစံၭဝ့ၫဒၪ, ဆၧဘၪလိၬအိၭလိၬဘၪဆဲၫ့ လၧနၧၩဘဲၫၥ့ၪလဲၪ. ထဲၩ့ထဲၩ့လၧယလးခဲၫ့ဘီၪ. ၦခိၭ ဆၧလဂၩနီၪဒုၭနဲၪဝ့ၫ,စံၭဝ့ၫဒၪ, အၥီၫ့လဂၩထီၩ့လၧ",
			"19": "<sup>19</sup> အဝ့ၫၥံၪအအီၪတၭ, ဂဲၫထဲၩ့ကဒၩထဲၩ့အ့ၬ.- အဝ့ၫဒၪ အၪ့မၧၫ့ၦကၥ့ၪၥုၭဖိၪနံၫဂၩလဂၩတၭ, အဆၧထီၩ့ လၧအဝ့ၫၥံၪအအီၪတၭ, စံၭဝ့ၫဒၪ, စဎွၩစံၭဘဲၫယီၩ, ဆၧဘၪလိၬအိၭလိၬဆ့ဧၪ. စယံဟုၫစံၭဝ့ၫဒၪ, ဆၧဘၪ လိၬအိၭလိၬဘၪဆဲၫ့လၧနၧၩ ဘဲၫၥ့ၪလဲၪ. ထဲၩ့ထဲၩ့လၧ",
			"20": "<sup>20</sup> ယလးခဲၫ့ဘီၪ.- ၦခိၭဆၧလဂၩနီၪဒုၭနဲၪဝ့ၫတၭ, စံၭ ဝ့ၫဒၪ,ထီၩ့လၧအဝ့ၫၥံၪအအီၪတၭ, ဂဲၫထဲၩ့ကဒၩထဲၩ့ အ့ၬ.တၭနၫ့ဆၧနီၪမၩအၥၭဘဲၫစနံၫ့ၡံၫအဖိၪခွၫစယံ ဟုၫအနၫ့ဆၧအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩနၫ့ဆၧဆီၪ့",
			"21": "<sup>21</sup> ဘဲၫၦဖျႃအၥိၭလီၫ.- တၭစယိရၫ့စံၭဝ့ၫဒၪ, တဲၩ့ဝဲၩဆၧ ဆံၭ. တၭၦၡၩတဲၩ့ဝဲၩအလဲၪ့ၥုၭနီၪလီၫ. တၭအံၫစရ့ လၭအစဎွၩယိရၫ့ဒဲယုဒၩအစဎွၩ စအၫဟဇဲအၫနီၪစဲၪ့ ထၪ့ဝ့ၫ,လဂၩလၧအလဲၪ့ၥုၭအဖၧၩ့, လဂၩလၧအလဲၪ့ ၥုၭအဖၧၩ့တၭ, လ့ၩထၪ့ထၫ့ဒၩစယံဟုၫတၭ, ဒၪဘၪ အဝ့ၫထီးၦယံၭစရ့လၭဖိၪ စနၫဘီၭအလးဖၧၩ့နီၪလီၫ.",
			"22": "<sup>22</sup> ထီးစယိရၫ့ဒၪဘၪစယံဟုၫတၭ, ဆၧမၩအၥၭလၧ အစံၭ, ဆၧဘၪလိၬအိၭလိၬဆ့ဧၪ, စယံဟုၫဧ့, တၭ အဝ့ၫဒၪစံၭ, လၧနမိအဆၧလဲးဆၧဘျၪၥံၪ, ဒဲအမၩဆၧ ယူၬမုၪအဆၧမၩအီၪအၪမံၩ့အဘိၩ့ဘၭတၭ, ဆၧဘၪ",
			"23": "<sup>23</sup> လိၬအိၭလိၬမိအီၪဘဲၫၥ့ၪလဲၪ.- စယိရၫ့ကၠၪကဒၩအ စူၪတၭ,စဲၪ့ဖျိၭတၭ, စံၭစအၫဟဇဲအၫ, ဆၧပိၩ့ထၪ့",
			"24": "<sup>24</sup> ယူၭစအၫဟဇဲအၫဧ့,- တၭစယံဟုၫဖဲၪ့ထၪ့အချံၪတၭ, ခၭဘၪစယိရၫ့လၧအစူၪဒူၪနံၫခီၫအဘိၩ့ဆၧၩ့တၭ, ဖျါ လဘံၪ့နီၪနုၬဖျီၫ့ထၪ့ထဲၩ့လၧအၥၭလီၫ. တၭလၩ့ဘျၭ",
			"25": "<sup>25</sup> ဝ့ၫလၧအလဲၪ့ၥုၭအဖၧၩ့လီၫ.- စယံဟုၫလီၩဘၪအၥုၭ ဖိၪအခိၪစဘံဒကၫ, မၩန့ထၪ့တၭ, ခွံၬလၩ့ခွံၬအဝ့ၫလၧ ၦယံၭစရ့လၭဖိၪစနၫဘီၭအဂၪ့ခိၪ အဝၩ့ဖၧၩ့ဆံၭ.အ ဂဲးဘဲၫယီၩလၧယၧၩဒဲနၧၩ ပထူၬၡီၩ့ကၥ့ၪနံၫဂၩလၧ အဝ့ၫအဖါစအၫဟၭ အလးခဲၫ့နီၪ ယဟိဝၩအီၪက့ၪ",
			"26": "<sup>26</sup> ဆၧအဎၧၫ့ယီၩလၧအလီၩ့နီၪ, နၪ့ထၪ့ထဲၩ့ဆံၭ.- မွဲ ယူၭ,လၧမုဂၪလနံၩနီၪ ယဒၪဘၪယူၭစနၫဘီၭအၥွံၪ, ဒဲအဖိၪခွၫလဖၪအၥွံၪနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ,တၭယမိ ဖ့ၪကၪဆၧလၧနၧၩ လၧဆၧအလးလစီၪ့ယီၩ, ယဟိ ဝၩစံၭဝ့ၫဒၪလီၫ. ဘိၩ့နဲၪ့ယီၩမၩန့ထၪ့, ခွံၬလၩ့ခွံၬ အဝ့ၫလၧဆၧအလးဖၧၩ့, ဘဲၫယဟိဝၩအလူအၥိၭနီၪ ဆံၭ.",
			"27": "<sup>27</sup> ထီးယုဒၫအစဎွၩအၫဟဇဲအၫဒၪဘၪဝ့ၫတၭ, စဲၪ့ဝ့ၫ လၧကျိၭဂံၪ့အဖၧၩ့ၥၭတၭ, စယံဟုၫလီၩ့ဆီးဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ကျီၪ့ခွံၬဆ့အဝ့ၫလၧအလဲၪ့ၥုၭအဖၧၩ့ဆံၭ. အီၪဝ့ၫလၧဆၧလ့ၩထၪ့လၧဂၧၫ, လၧအအီၪဝ့ၫလၧ အံၭဘျံၫအၫ့အနဲၩ့လီၫ. တၭအဝ့ၫဒၪ စဲၪ့ခွံၬဝ့ၫထီၩ့",
			"28": "<sup>28</sup> လၧမဂံၭဒိၫတၭ, ၥံၫဝ့ၫထီးနီၪလီၫ.- အခ့ၫအၡၩဆိၬ ဝ့ၫလၧအလဲၪ့ၥုၭအဖၧၩ့ ထီၩ့လၧယရုစလံၫ့တၭ, ခုၪ့ လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧအၥွၪခိၪအဖၧၩ့, အီၪလၧအဖါလ",
			"29": "<sup>29</sup> ဖၪအၥိၭလၧစဒၫဝံၭအဒိၩ့ဖၧၩ့လီၫ.- တၭစအၫဟၭ အဖိၪခွၫစယိရၫ့အနံၪ့လဆံၫလနံၪ့နီၪ စအၫဟဇဲအၫ ကဲၪၥၫ့စဎွၩလၧယုဒၫအဖၫ့ခိၪလီၫ.",
			"30": "<sup>30</sup> ထီးစယံဟုၫဂဲၫထီၩ့ဝ့ၫလၧယံၭစရ့လၭတၭ, နးယ့ၭ ဇဘ့လၭ နါဂၧၫ့ဝ့ၫတၭ, ဂုၪအမ့ၬဖုၪ့အခိၪ, ယိလၩ့ဆၧ",
			"31": "<sup>31</sup> လၧဆၧဖိးလီၫ.- စယံဟုၫလၩ့နုၬလၧတရၫ့ဖၧၩ့တၭ, ၦမုၪနီၪစံၭဝ့ၫဒၪ, စဇံၫ့မရဲၫလၧအမၩၥံၫအကဆါနီၪ,",
			"32": "<sup>32</sup> အီၪလၧဆၧဘၪလိၬအိၭလိၬဆ့ဧၪ.- စယံဟုၫဘိၭထၪ့ အခိၪလၧဆၧဖိးတၭ, စံၭဝ့ၫဒၪ, ၦအီၪလၧယအီၪလခီၫ မွဲပလၫလဂၩလဲၪး တၭၦဖၫဆွံၪနံၫဂၩၥၧၫ့ဂၩယိလၩ့",
			"33": "<sup>33</sup> အဝ့ၫလီၫ.- တၭအဆၧစံၭဝ့ၫဒၪ, ခွံၬလၩ့ၦမုၪနီၪဆံၭ, ၦခွံၬလၩ့ဝ့ၫတၭ, အၥွံၪဎွံၪအၥၭလၧဆၧဒီၪ့အလီၩ့, ဒဲ လၧကၥ့ၪလဖၪအလီၩ့တၭ, ကၥ့ၪလဖၪယဲးလၩ့ထဲး",
			"34": "<sup>34</sup> ဝ့ၫလၧအခၪ့အဖၫ့လၬလီၫ.- အဝ့ၫဒၪဂဲၫနုၬဝ့ၫတၭ, အၪ့ဆၧဒဲအီၩဆၧတၭ, စံၭဝ့ၫဒၪ, လ့ၩယိၦမုၪလၧအ ဘၪဆိၪအၧၩ့ဝ့ၫလဂၩယီၩတၭ, ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ",
			"35": "<sup>35</sup> ဆံၭ. အဂဲးဘဲၫယီၩ မွဲစဎွၩအဖိၪမုၪလီၫ.- ၦလ့ၩဝ့ၫ ဘဲၫၥိၭအမိခုၪ့လၩ့ဘၧၩ့ခွံၬ အဝ့ၫလါနၫ့တၭ, ဒၪန့ဝ့ၫန့ၫ",
			"36": "<sup>36</sup> အခိၪဎွံၪလဲၫ, ဒဲအခၪ့ဒဲအစူၪယၫၥၭလီၫ.- ၦဂဲၫထဲၩ့ ထဲၩ့လီၩဘၪဝ့ၫလီၫ. အဝ့ၫဒၪစံၭ, အယီၩမွဲယဟိဝၩ အလူလၧအချဲၩ့ဆၧလၧအခ့ၫအၡၩ, ၦတံၡဘၭဖိၪ စအံၫလဲယၫတၭ, စံၭဝ့ၫဒၪ, လၧယံၭစရ့လၭအလး ဖၧၩ့နီၪထွံၪလဖၪမိအၪ့နးယ့ၭဇဘ့လၭ အဖံၭအယၪ,",
			"37": "<sup>37</sup> ဒဲနးယ့ၭဇဘ့လၭအစွၪ မိမၩအၥၭဘဲၫဆၧအ့ၪလၧဂၪ့ ခိၪအဝၩ့လၧယံၭစရ့လၭအလးဖၧၩ့နီၪ, ဘဲၫၥိၭၦမိစံၭ ဘၪဝ့ၫ,အယီၩ မွဲနးယ့ၭဇဘ့လၭနီၪ, လဂ့ၩ."
		},
		"10": {
			"1": "<sup>1</sup> တၭစအၫဟၭအဖိၪခွၫ အီၪလၧစမ့ရအၫအဖၧၩ့နွ့ၫ ဆံၫလီၫ. စယံဟုၫကွ့ၭလံၬလဖၪတၭ, ဖ့ၪယုဝ့ၫလၧ စမ့ရအၫလၧယံၭစရ့လၭအၦဒိၪဖၭဒိၪအအီၪ, လၧၦ ၥုၪ့က့ၭၥၭၡါအအီၪနီၪ, ဒဲလၧၦလၧအယိစအၫဟၭ",
			"2": "<sup>2</sup> အဖိၪလဖၪတၭ, စံၭဝ့ၫဒၪ,- ထီးလံၬလဘံၪ့ယီၩအ့ၪ ထီၩ့လၧနၥံၪအအီၪတၭ, မွဲနၥံၪအကဆါ အဖိၪခွၫလ ဖၪအီၪလၧနၥံၪအၥိၭ, ဒဲလဲၪ့ၥုၭလဖၪ, ဒဲကၥ့ၪလဖၪ, ဒဲဒိၩ့အီၪလၧအခိၪဒၧၩ့လဖျိၪ့ဆ့, ဒဲစူၪဝဲၩအီၪလၧနၥံၪ",
			"3": "<sup>3</sup> အၥိၭတၭ,- အၪ့ဎၬယိနၥံၪအကဆါအဖိၪခွၫလၧအ ဂ့ၩထုၬ,ကြၨၭထုၬလဂၩတၭ, အီၪက့ၪထၪ့လၧအဖါ အလးဆီၩ့ဆီအဖၫ့ခိၪတၭ, ဒုၭၥုၭလၧနၥံၪအကဆါအ",
			"4": "<sup>4</sup> ၡၩဂံၪ့ဖိၪအဂးနီၪဆံၭ.- မွဲလါနၫ့ဘိၩ အဝ့ၫၥံၪၥၭမဲၪ ဆၧဒိၪဒိၪလ့ၬတၭ, စံၭဝ့ၫဒၪ,ယိခွါ, စဎွၩနံၫဂၩဆၧၫ့ ထုၪ့လၧအမ့ၬယၫ လၥ့ၪဘၪတၭ, ပဝ့ၫဒၪယီၩ ပမိ",
			"5": "<sup>5</sup> ဆၧၫ့ထုၪ့ဘဲၫၥ့ၪလဲၪ.- တၭၦလၧအပၧၩ့ဂံၪ့လဂၩ,ဒဲၦ လၧအပၧၩ့ဒိၩ့လဂၩ, ၦၥုၪ့က့ၭၥၭၡါဆ့, ဒဲၦယိထဲၩ့ ခွါထဲၩ့ဖိၪဒံၩဖိၪၥၪလဖၪနီၪ အၪ့မၧၫ့လၩ့ဆၧလၧစယံ ဟုၫအအီၪတၭ, စံၭဝ့ၫဒၪပမွဲနခ့ၫနၡၩတၭ, ပမိမၩက ယဲဆၧလၧနအၪ့မၧၫ့ပၧၩထီးအလူၬ, ပမိအီၪက့ၪလၩ့ စဎွၩနးဂၩအ့ၬ. မၩနဝ့ၫဆၧလၧအဂ့ၩလၧနမ့ၬၥၪဖၧၩ့ ဆံၭ.",
			"6": "<sup>6</sup> ထီးနီၪလဖၧၫ့အဝ့ၫဒၪကွ့ၭလံၬ နံၫဖၧၫ့လဖၧၫ့တၭ, စံၭဝ့ၫဒၪ,နၥံၪအ့ၪအီၪလၧယဂး, နၥံၪအ့ၪခိၭနၪယလူ တၭ,မၩန့နၥံၪအကဆါအဖိၪခွၫလဖၪ အခိၪဎွံၪတၭ, ကဲဂီၩခိၬလၧအဆၧၫ့အထီယီၩ, ဂဲၫလၧယအီၪလၧ ယံၭစရ့လၭအဖၧၩ့ဆံၭ. (တၭၦပၧၩ့စဎွၩအဖိၪခွၫနွ့ၫ ဆံၫနီၪအီၪဝ့ၫလၧဒိၩ့အၦဒိၪလဖၪ လၧအလုအၪ့အ",
			"7": "<sup>7</sup> ဝ့ၫၥံၪအၥိၭလီၫ.)- ထီးလံၬလဘံၪ့နီၪ ထီၩ့ဝ့ၫလၧအ ဝ့ၫၥံၪအအီၪတၭ, ဆၧမၩအၥၭလၧအဝ့ၫၥံၪမၩန့စဎွၩ အဖိၪခွၫလဖၪတၭ, မၩၥံၫၦနွ့ၫဆံၫတၭ, ဒုၭနုၬအခိၪ ဎွံၪလဖၪလၧဒၩ့ဖၧၩ့တၭ, ဖ့ၪယုဝ့ၫလၧယံၭစရ့လၭ",
			"8": "<sup>8</sup> လီၫ.- အၥီၫ့လဂၩဂဲၫဝ့ၫတၭ, လီၩဘၪအဝ့ၫ,စံၭဝ့ၫဒၪ, ၦဂဲၫဆိၬစဎွၩအဖိၪခွၫလဖၪ အခိၪဎွံၪလီၫ. အဝ့ၫဒၪ စံၭ,အီၪက့ၪလၩ့အဝ့ၫၥံၪ လၧအပိၩ့နးနံၫပိၩ့လၧဆၧ",
			"9": "<sup>9</sup> လ့ၩနုၬလၧတရၫ့ဖၧၩ့ ထီးမုဆဲၪ့ထၪ့နီၪဆံၭ.- မုဆဲၪ့ ထၪ့နီၪဆၧမၩအၥၭလၧအစဲၪ့ထၪ့ဝ့ၫတၭ, ဆၧၫ့ထုၪ့ စံၭၦခမျၧးထီးအလူၬ, နၥံၪမွဲၦအတီၩလီၫ. ယိခွါ,ယ ဝ့ၫဒၪယီၩယပိၩ့ထၪ့ယကဆါ, ဒဲမၩၥံၫဝ့ၫလီၫ. မွဲပ",
			"10": "<sup>10</sup> လၫမၩၥံၫၦထီးအလူၬယီၩလဂၩလဲၪ.- ၥ့ၪယၫတၡါ ဆၧလၧယဟိဝၩအဆၧချဲၩ့ လၧယဟိဝၩချဲၩ့လၧစအၫ ဟၭအဂံၪ့အဂဲးအကၠီၪ့နီၪ လလၩ့ထ့ၬဘၪလၧဂၪ့ခိၪ နးထံၪဘၪနီၪဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩမၩဘဲၫအ",
			"11": "<sup>11</sup> ချဲၩ့ဆၧလၧအခ့ၫအၡၩစအံၫလဲယၫနီၪလီၫ.- တၭစယံ ဟုၫမၩၥံၫကယဲၦလၧအအီၪလၩ့ထး လၧစအၫဟၭအ ၡၩဂံၪ့ဖိၪအကျၩလၧယံၭစရ့လၭအဖၧၩ့, ဒဲအၦဒိၪဖၭ ဒိၪလဖၪထီးအလူၬ, အဘူၭအထံး, ဒဲအၡၩလုဆၧလ ဖၪထီးအအီၪက့ၪလၩ့ထး လၧအဂးနးဂၩအ့ၬ.",
			"12": "<sup>12</sup> အဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬတၭ, လ့ၩထီၩ့လၧစမ့ရအၫလီၫ. လၧအဝ့ၫဒၪအီၪလၧၦထံၬၥိၪဆီၪ့အဂံၪ့လၧဖၧၩ့ၥၭနဲၩ့",
			"13": "<sup>13</sup> နီၪ,- စယံဟုၫဘၪခီၩ့လၧယုဒၫအစဎွၩ အၫဟဇဲအၫ အထၧၫ့ဖုဝဲလဖၪတၭ, စံၭဝ့ၫဒၪ, နၥံၪဝ့ၫယီၩနၥံၪမွဲၦ လဖၪလဲၪ, အဝ့ၫၥံၪစံၭဆၧၫ့ဆၧ, ပမွဲစအၫဟဇဲအၫအ ထၧၫ့ဖုဝဲလဖၪတၭ, ပလ့ၩလၩ့ဘဲၫၥိၭပမိချဲၩ့ဒုၪ့စဎွၩ",
			"14": "<sup>14</sup> အဖိၪ,ဒဲနးဎွၩမုၪအဖိၪလဖၪလီၫ.- တၭအဆၧစံၭဝ့ၫ ဒၪ,ဖီၪ့န့မၧၫ့အဝ့ၫၥံၪဆံၭ. ၦလဖၪနီၪ ဖီၪ့န့မၧၫ့အဝ့ၫ ၥံၪတၭ,မၩၥံၫဝ့ၫလၧၦထံၬၥိၪဆီၪ့အဂံၪ့ အကမၫနဲၩ့ ထံၭနီၪ,ၦလံဆံၫနံၫဂၩတၭ, အီၪက့ၪလၩ့ထးဝ့ၫနးဂၩ အ့ၬ.",
			"15": "<sup>15</sup> အဝ့ၫဒၪစဲၪ့ထၪ့ထီးနီၪ, ဘၪခီၩ့လၧစရံခၭအဖိၪခွၫ စယီနဒၭလဂၩဂဲၫအၪ့ဂၬဝ့ၫတၭ, အဆၧချဲၩ့ဒုၪ့ဝ့ၫတၭ, စံၭဝ့ၫ,မွဲနၥၭတီၩဘဲၫယၥၭအီၪ လၧနၥၭအၥိၭနီၪဆ့ ဧၪ.တၭစယီနဒၭစံၭဝ့ၫဒၪ, မွဲယူၭ. အ့ၪမွဲဘဲၫနီၪတၭ, ဖ့ၪလၫ့ယၧၩလၧနစူၪဆံၭ. အဆၧဖ့ၪလၫ့ဝ့ၫလၧအ စူၪတၭ, ထုၭထၪ့ဝ့ၫလၧအအီၪလၧ လဲၪ့ၥုၭအဖၧၩ့",
			"16": "<sup>16</sup> လီၫ.- စယံဟုၫစံၭဝ့ၫဒၪ, ဂဲၫလၧယၥိၭတၭ, ဒၪဘၪယ ၥၭဆီၪ့လၧယဟိဝၩအဂးဆံၭ. တၭဒုၭထူၬအဝ့ၫလၧ",
			"17": "<sup>17</sup> အလဲၪ့ၥုၭနီၪလီၫ.- ထီးအဂဲၫထီၩ့လၧစမ့ရအၫတၭ, မၩၥံၫကယဲၦလၧအအီၪလၩ့ထး ဘၪဆဲၫ့လၧစအၫ ဟၭလၧစမ့ရအၫအဖၧၩ့ထီးအမၩဂၭဂီၩ့ခွံၬဝ့ၫ, ဘဲၫ ယဟိဝၩအလူလၧအချဲၩ့ဝ့ၫ လၧစအံၫလဲယၫအၥိၭနီၪ လီၫ.",
			"18": "<sup>18</sup> စယံဟုၫဒုၭအီၪကိၩ့အီၪကိၪ့ ၦခမျၧးထီးအလူၬ တၭ,စံၭအဝ့ၫၥံၪ, စအၫဟၭမၩဘၫအလၭအဆၧလ ဆံၭဖိၪလီၫ. အ့ၪမွဲစယံဟုၫမိမၩဝ့ၫအၪအၪလ့ၬလီၫ.- တၭဘိၩ့နဲၪ့ယီၩကိၭန့ယၧၩလၧ ဘၫအလၭအမီၪထီး",
			"19": "<sup>19</sup> အလူၬ,အခ့ၫအၡၩထီးအလူၬ, ဒဲအၡၩလုဆၧထီးအ လူၬဆံၭ. ဒုၭအီၪလၩ့ထးနးဂၩလဂ့ၩ, အဂဲးဘဲၫယီၩ ယအီၪလၧဆၧလုဖၭဒိၪ လၧဘၫအလၭအဂးလီၫ.ၦ လၧအလအီၪဘၪနီၪမိမၧၫ့ဝ့ၫနးဂၩအ့ၬ. တၭစယံဟုၫ မၩဝ့ၫလၧဆၧအၪ့လီၫဘဲၫၥိၭအမိမၩၥံၫၦၡၩ ဘၩဘၫ",
			"20": "<sup>20</sup> အလၭလဖၪနီၪလီၫ.- တၭစယံဟုၫစံၭဝ့ၫဒၪ,ကိၭထၪ့ ဆၧအီၪကီၪ့ဆံၫ့ဎံၪ လၧဘၫအလၭအဂးဆံၭ. တၭၦၡၩ",
			"21": "<sup>21</sup> ကိၭထၪ့ဝ့ၫလီၫ.- စယံဟုၫအၪ့မၧၫ့လၩ့ဆၧလၧအံၫစ ရ့လၭအကျၩထီးအလူၬတၭ, ၦလၧအဘၩဘၫအလၭ လဖၪဂဲၫဝ့ၫထီးအလူၬတၭ, ၦလၧအလဂဲၫဘၪအီၪ လၩ့ထးနးဂၩအ့ၬ. အဝ့ၫၥံၪဂဲၫလၧဘၫအလၭအဂံၪ့ ဖၧၩ့တၭဘၫအလၭအဂံၪ့ဎွ့ၩဝ့ၫ ထၧၫ့ဖျိၪ့ယၫလီၫ.",
			"22": "<sup>22</sup> အဝ့ၫဒၪစံၭၦလၧအပၧၩ့ဆၧကီၩ့ဆၧၥိၭ, ဂဲၫဆိၬဆၧအ ကီၩ့အၥိၭလၧၦၡၩ ဘၩဘၫအလၭအဂး ထီးအလူၬ",
			"23": "<sup>23</sup> ဆံၭ. တၭအဝ့ၫဒၪဂဲၫဆိၬ ဆၧကီၩ့ဆၧၥိၭနီၪလီၫ. စယံ ဟုၫဒဲစရံခၭအဖိၪခွၫ စယီနဒၭလ့ၩနုၬဝ့ၫလၧဘၫအ လၭအဂံၪ့ဖၧၩ့တၭ, စံၭၦလၧအဘၩဘၫအလၭလဖၪ နီၪ,အၪ့ဎၬယိထံၫထံၫဆၭဆၭတၭ, ယိခွါ, ဘဲၫၥိၭ ယဟိဝၩအခ့ၫအၡၩထီး အီၪဘၪလၧနၥံၪအကျၩထီး ယီၩနးဂၩလဂ့ၩ. မွဲအအီၪန့ၫၦဘၩဘၫအလၭၥံၪနီၪ",
			"24": "<sup>24</sup> ဆံၭ.- ထီးအဝ့ၫၥံၪဂဲၫနုၬဘဲၫၥိၭ အမိလုထၪ့ဆၧလုဒဲ ဆၧလုမ့ၪတၭ, စယံဟုၫအီၪက့ၪလၩ့ ၦဎိၭဆံၫလၧခီၫ့ တၭ,စံၭဝ့ၫဒၪ, ၦလၧယအီၪက့ၪလၧနၥံၪအစူၪဖၧၩ့ အ့ၪဖီၩ့ဖျ့ၭလဂၩဂၩတၭ, ၦလၧအဒုၭဖီၩ့ဖျ့ၭလဂၩနီၪ အဝ့ၫအၥၭမၧၫ့လၧ ၦလဂၩနီၪအၥၭမၧၫ့အဂးလီၫ.",
			"25": "<sup>25</sup> ထီးၦလုထၪ့ဆၧလုမ့ၪဂီၩ့တၭ, ဆၧမၩအၥၭလၧ စယံဟုၫစံၭၦခိၭထၬဆၧ, ဒဲၦၥုၭအခိၪလဖၪ, လ့ၩနုၬ မၩၥံၫအဝ့ၫၥံၪဆံၭ. ဒုၭဂဲၫထၪ့နးဂၩလဂ့ၩ. တၭအဝ့ၫ ၥံၪကျီၪ့ခွံၬဝ့ၫလၧနၭအနါတၭ, ၦခိၭထၬဆၧ, ဒဲၦၥုၭဖိၪ အခိၪလဖၪ, ခွံၬၡိၭခွံၬအဝ့ၫၥံၪတၭ, လ့ၩဝ့ၫလၧဘၫ",
			"26": "<sup>26</sup> အလၭအဂံၪ့အဒိၩ့နီၪလီၫ.- အဝ့ၫၥံၪဂဲၫဆိၬထၪ့ခွံၬ ဆၧဂၩ့ၥံၪအီၪဝ့ၫလၧဘၫအလၭအဂံၪ့ဖၧၩ့တၭ, ဆူၭ",
			"27": "<sup>27</sup> ထၪ့ခွံၬဝ့ၫလၧမ့ၪလီၫ.- မၩလၩ့ဘျ့ၭဘၫအလၭအဆၧ ဂၩ့တၭ မၩလၩ့ဎီးခွံၬဘၫအလၭအဂံၪ့တၭ, အီၪက့ၪ ဝ့ၫလၧဂၭလိၫအလး ထီးမုဆၫလနံၩယီၩလီၫ.",
			"28": "<sup>28</sup> စယံဟုၫမၩဂၭဂီၩ့ခွံၬ ဘၫအလၭ လၧအံၫစရ့လၭ",
			"29": "<sup>29</sup> အဖၧၩ့ဘဲၫနီၪၥိၭလီၫ.- မွဲလါနၫ့ဘိၩစနံဘၭအဖိၪခွၫ စယ့ၫရဘိအၫ့လၧအဒုၭမၩ အံၫစရ့လၭအဆၧဒဲၩဘၭ လဂၩနီၪ, စယံဟုၫလီၩ့ဖိၬအခဲၫ့, ဘဲၫၦစံၭဆၧအၥိၭ, ချီဖိၪထီၫ့ၥံၪလၧအအီၪဝ့ၫလၧ ဘ့ၫၥလၭအဖၧၩ့,ဒဲလၧ ဒၫ့အဖၧၩ့လီၫ.",
			"30": "<sup>30</sup> ယဟိဝၩစံၭစယံဟုၫ, မွဲနမၩဆၧဂ့ၩ လၧနမၩဆၧ တီၩလၧယမ့ၬယၫ, ဒဲမၩစအၫဟၭအဂံၪ့ဖိၪဘဲၫကယဲ ဆၧလၧအအီၪဝ့ၫလၧယၥၭခံဖၧၩ့တၭ, နဖိၪမိဆၧၫ့နၩ့ လၧအံၫစရ့လၭအလးဆီၩ့ဆီနီၪ ထီၩ့လၩ့လၧလံဆိၩ",
			"31": "<sup>31</sup> လဆိၩလီၫ.- အ့ၪမွဲစယံဟုၫထီးလၩ့အၥၭဘဲၫၥိၭအမိ လ့ၩလၧယဟိဝၩအံၫစရ့လၭအယွၩ အဆၧၥီၪ့ဆၧၥၫ့ အဖၧၩ့, လၧအၥၭထၧၫ့ဖျိၪ့ယၫအ့ၬ. စဲၪ့ဒၪစယ့ၫရဘိ အၫ့လၧအဒုၭမၩအံၫစရ့လၭ လၧဆၧဒဲၩဘၭလဂၩနီၪ အဆၧဒဲၩဘၭအ့ၬ.",
			"32": "<sup>32</sup> ဆၧလၧမုနံၩလဖၪနီၪ ယဟိဝၩဒၪ့ထ့ၬခွံၬၥၫ့အံၫစရ့ လၭလီၫ. တၭစဟၭဇအ့လၭ ကျီၪ့ခွံၬဝ့ၫလၧအံၫစရ့",
			"33": "<sup>33</sup> လၭအခးနဲၩ့အဖၧၩ့ထီးအလူၬလီၫ.- လၧယီၫဒၫ့လၧ မုထၪ့လခီၫကယဲဂၪ့ခိၪဘၪဆဲၫ့လၧဂံလအၭ, ၦဂၭဖိၪ, ဒဲၦရုဘံၫ့ဖိၪ, ဒဲၦမနၭစ့ၫဖိၪ လၧအရိအၧၫလၧအအီၪ ဝ့ၫလၧထံၫအၫနၫ့နဲၩ့, ဖိးလၧဂံလအၭ, ဒဲဘၫၡၫ့လီၫ.",
			"34": "<sup>34</sup> တၭဆၧအီၪလၩ့ထး ဘၪဆဲၫ့လၧစယံဟုၫဒဲကယဲ ဆၧလၧအမၩဝ့ၫ, ဒဲကယဲဆၧအစီၩ့အမၩ့နီၪ, ကွ့ၭအ ၥၭလၧအံၫစရ့လၭအစဎွၩ အလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့",
			"35": "<sup>35</sup> နီၪ,မွဲအ့ၬဧၪ.- စယံဟုၫမံၫဝ့ၫလၧအဖါလဖၪ အၥိၭ တၭ,ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧစမ့ရအၫအဖၧၩ့လီၫ. တၭအဖိၪခွၫစယဟိအဟၭ ကဲၪစဎွၩလၧအလးလီၫ.",
			"36": "<sup>36</sup> တၭမုနံၩလဖၪလၧစယံဟုၫကဲၪစဎွၩ လၧအံၫစရ့လၭ အဖၫ့ခိၪလၧစမ့ရအၫအဖၧၩ့နီၪ, မွဲနံၫဆံၫဎိၭနံၪ့လီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ထီးစအၫဟဇဲအၫ အမိနးအၭၥလဲအၫလဂၩဒၪဘၪ လၧအဖိၪခွၫၥံၫဝ့ၫတၭး ဂဲထုၪ့မၩဂၭဂီၩ့စဎွၩအချံၫအ",
			"2": "<sup>2</sup> ၥၪထီးအလူၬလီၫ.- အ့ၪမွဲစဎွၩယိရၫ့အဖိၪမုၪ, စအၫ ဟဇဲအၫအထၧၫ့ဖုဝဲမုၪ နးယဟီၭၡဘၫလဂၩမၩန့ စအၫဟဇဲအၫအဖိၪခွၫစယိအၭတၭ, အၪ့ဂူၪန့ဝ့ၫလၧ စဎွၩအဖိၪခွၫလၧအဘၪဆၧမၩၥံၫဝ့ၫအကျၩတၭ, အီၪ က့ၪၥူၪခွံၬဝ့ၫဒၪ, ဒဲအၡၩဒုၭအၪ့နူလဂၩဆ့လၧလးမံၫ လဖၪအဒူၭဖၧၩ့ဘံၭခွံၬ လၧနးအၭၥလဲအၫအမ့ၬယၫ",
			"3": "<sup>3</sup> တၭ,ဘၪဆၧမၩၥံၫဝ့ၫအ့ၬ.- တၭအဝ့ၫဒၪဘၪဆၧအီၪ က့ၪၥူၪခွံၬဝ့ၫလၧ ယဟိဝၩအဂံၪ့ဖၧၩ့ဎူၫနံၪ့လီၫ. တၭ နးအၭၥလဲအၫနီၪကဲၪထၪ့ နးဎွၩမုၪလၧခးအဖၫ့ခိၪလီၫ.",
			"4": "<sup>4</sup> နွ့ၫနံၪ့လနံၪ့နီၪ စယဟီအဒၫအၪ့မၧၫ့လၩ့ဆၧတၭ, ဂဲၫဆိၬၦအယၩၥံၪအၦဒိၪလဖၪ, ဒဲၦၥုၭခိၪလဖၪ, ဒဲၦ ခိၭထၬဆၧလဖၪတၭ, ဒုၭလ့ၩနုၬဝ့ၫလၧယဟိဝၩအ ဂံၪ့ဖၧၩ့တၭ, အုၩ့လၩ့ဆၧလၧအဝ့ၫၥံၪတၭ, ဒုၭဆိၪ လၩ့အၥၭလၧယဟိဝၩအဂံၪ့ဖၧၩ့တၭ, ဒုၭနဲၪဝ့ၫလၧ",
			"5": "<sup>5</sup> စဎွၩအဖိၪခွၫလီၫ.- တၭမၪလူၬအဝ့ၫၥံၪ, စံၭဝ့ၫဒၪ,အ ယီၩမွဲဆၧလၧနၥံၪမိဘၪမၩလမံၩ့, နၥံၪဝ့ၫဒၪ, ၥၧၫ့ဒီၪ့ လဒီၪ့လၧအလ့ၩနုၬ လၧမးၥံၫအနံၩလဖၪ, မိဘၪကဲၪ",
			"6": "<sup>6</sup> ထၪ့ၦခိၭဆၧလၧစဎွၩအဂံၪ့အဂး,- ၦၥၧၫ့ဒီၪ့လဒီၪ့မိ ဘၪအီၪလၧတရၫ့စၧၫအခၪ့ထံၭတၭ, ၦၥၧၫ့ဒီၪ့လဒီၪ့မိ ဘၪအီၪလၧတရၫ့လၧၦခိၭထၬဆၧအချိၫ့တၭ, နၥံၪမိ ဘၪခိၭဂံၪ့အဆၧခိၭဘဲၫၥိၭ အထီးဘၪ ဆၧဘုၪ့ဖိးဝ့ၫ",
			"7": "<sup>7</sup> လဂ့ၩလီၫ.- တၭၦလၧအစဲၪ့ထၪ့လၧမးၥံၫအနံၩထီး အလူၬအကျၩနီၪ, နံၫဒီၪ့မိဘၪခိၭယဟိဝၩအဂံၪ့လၧ",
			"8": "<sup>8</sup> စဎွၩအနဲၩ့ထံၭဝၬဝၬနီၪလီၫ.- နၥံၪမိဘၪဝၩ့ထၬစဎွၩ ဝၬဖီၩ့ဝ့ၫလဂၩလၧအစူၪဝဲၩ အီၪလၧအစူၪဖၧၩ့,လဂၩ လၧအစူၪဝဲၩလၧအစူၪဖၧၩ့တၭ, ၦလၧအလ့ၩနုၬလၧ ဆၧအဂဲးလဖၪလၧအဖၧၩ့နီၪ, မၩၥံၫဝ့ၫဆံၭ.ထီးစဎွၩ အ့ၪစဲၪ့ထၪ့တၭ, ထီးအဂဲၫနုၬတၭ, အီၪနၥံၪဝ့ၫလၧ စဎွၩအၥိၭနီၪဆံၭ.",
			"9": "<sup>9</sup> ၦအယၩၥံၪအခိၪလဖၪနီၪ, မၩဝ့ၫဘဲၫကယဲဆၧလၧ ၦလုဆၧစယဟီအဒၫ မၪလူၬဝ့ၫအၥိၭနီၪလီၫ. အဝ့ၫ ၥံၪမၩန့ၦလၧအဂဲၫနုၬလၧ မးၥံၫအနံၩဆုၬဆုၬ, ဒဲၦ လၧအစဲၪ့ထၪ့လၧမးၥံၫအနံၩတၭ, ဂဲၫလၧၦလုဆၧအ",
			"10": "<sup>10</sup> ဒိၪစယဟီအဒၫအအီၪလီၫ.- တၭၦလုဆၧလဂၩနီၪ ဖ့ၪလၫ့ၦအယၩၥံၪအခိၪလဖၪ လၧစဎွၩဒၫဝံၭအဖၩ့ ၥံၪ,ဒဲအထၩ့ဖံၭၥံၪ, လၧအအီၪဝ့ၫလၧယဟိဝၩအဂံၪ့",
			"11": "<sup>11</sup> ဖၧၩ့လီၫ.- ၦခိၭထၬဆၧဆၧၫ့ထုၪ့ဝ့ၫလဂၩ အီၪလၧအ စူၪဝဲၩလၧအစူၪဖၧၩ့တၭ, အီၪဝၬဖီၩ့စဎွၩလၧဆၧလု ဂံၪ့အနိၪ့စူၪထွ့ၪ,ဖိးလၧဆၧလုဂံၪ့အနိၪ့စူၪစ့ၪ,လၧ",
			"12": "<sup>12</sup> ဆၧလုအလးဒဲဆၧလုဂံၪ့အနဲၩ့လီၫ.- အဝ့ၫဂဲၫဆိၬစ ဎွၩအဖိၪခွၫတၭ, ဒုၭချႃၬဝ့ၫလၧၥရဖူၩတၭ, အီၪက့ၪဆၧ အုၩ့လၩ့တၭး ဒုၭကဲၪအဝ့ၫလၧစဎွၩဂုၪဝ့ၫနီၪတၭ,အ",
			"13": "<sup>13</sup> ဝ့ၫၥံၪဒဲၩအစူၪတၭ, စံၭဝ့ၫဒၪ, မွဲစဎွၩမၧၫ့ဝ့ၫဆံၭ.- ထီး နးအၭၥလဲအၫနီၪ, နါဂၧၫ့ၦခိၭထၬဆၧ, ဒဲၦခမျၧးအၥီၫ တၭ,ဂဲၫဝ့ၫလၧၦခမျၧးအအီၪ လၧယဟိဝၩအဂံၪ့ဖၧၩ့",
			"14": "<sup>14</sup> လီၫ.- ထီးအယိဝ့ၫတၭ, ယိခွါ,စဎွၩဆၧၫ့ထုၪ့ဝ့ၫလၧ အလးထၪ့ထီၫ, ဘဲၫဆၧအထူၫအရူၫအၥိၭနီၪတၭ, ၦ ဒိၪလဖၪ,ဒဲၦအူၪခွ့ၩလဖၪ အီၪဝ့ၫလၧစဎွၩအနဲၩ့ထံၭ လီၫ.ခးအၡၩခမျၧးထီးအလူၬနီၪ ၥုၪ့ထိၬၥၭထိၬတၭ, အူၪခွ့ၩလီၫ. နးအၭၥလဲအၫ ၡၫ့အဆဲၫ့တၭ,ကိၭၡၭ",
			"15": "<sup>15</sup> ထၪ့,ဆၧပိၩ့ထၪ့ဖီၩၬ ဆၧပိၩ့ထၪ့ဖီၩၬ- တၭၦလုဆၧ စယဟီအဒၫမၪလူၬ ၦအယၩၥံၪအခိၪလဖၪ, ၦၥုၭမုခ မျၧးအခိၪလဖၪတၭ, စံၭဝ့ၫ,နၫ့ထၪ့ခွံၬအဝ့ၫလၧအဂဲး လဖၪအချိၫ့တၭ, ၦလၧအလီၩ့ဝ့ၫလဖၪနီၪ မၩၥံၫဝ့ၫလၧ နၭဆံၭ. အဂဲးဘဲၫယီၩ ၦလုဆၧစံၭယူၭ, မွဲနၥံၪထီး",
			"16": "<sup>16</sup> မၩၥံၫအဝ့ၫလၧယဟိဝၩအဂံၪ့ဖၧၩ့လဂ့ၩ.- ၦလဖၪ အီၪက့ၪအစူၪလၧအလီၩ့တၭ, လ့ၩဝ့ၫလၧဖၧၩ့ၥၭလၧ ကၥ့ၪလဖၪဂဲၫနုၬဝ့ၫလၧစဎွၩအဂံၪ့တၭ ဘၪဆၧမၩၥံၫ ဝ့ၫထီးနီၪလီၫ.",
			"17": "<sup>17</sup> တၭစယဟီအဒၫမၩဆၧအုၩ့လၩ့ လၧယဟိဝၩ,ဒဲ စဎွၩဒဲၦခမျၧး, ဘဲၫၥိၭအဝ့ၫၥံၪမိကဲၪထၪ့ယဟိဝၩအ ၡၩခမျၧးလီၫ. တၭဒုၭအုၩ့လၩ့ဆၧလၧစဎွၩ ဒဲၦခမျၧး",
			"18": "<sup>18</sup> အဘိၩ့ဆၧၩ့ဆ့လီၫ.- ခးအၡၩခမျၧးထီးအလူၬနီၪလ့ၩ နုၬလၧဘၫအလၭအဂံၪ့ဖၧၩ့တၭ, မၩလၩ့ဎီးဝ့ၫတၭ, မၩခါလၩ့ဘျ့ၭအဆၧလုအလး, ဒဲအဆၧဂၩ့လဖၪတၭ, မၩၥံၫဘၫအလၭအၡၩလုဆၧ စမၭတၫ့လၧဆၧလုလး လဖၪအမ့ၬယၫလီၫ. တၭၦလုဆၧနီၪ အီၪက့ၪလၩ့ၦ",
			"19": "<sup>19</sup> ဒိၪဖၭဒိၪလဖၪလၧယဟိဝၩအဂံၪ့အဖၫ့ခိၪလီၫ.- အ ဝ့ၫဒၪမၩန့ၦအယၩၥံၪအၦဒိၪလဖၪ, ဒဲၦၥုၭခိၪလဖၪ ဒဲၦခိၭထၬဆၧလဖၪ, ဒဲခးအၡၩခမျၧးထီးအလူၬတၭ, ဂဲၫဆိၬခွံၬစဎွၩ လၧယဟိဝၩအဂံၪ့တၭ, ဂဲၫလၧဖၧၩ့ ၥၭဘၪစဎွၩအဂံၪ့ လၧအၡၩခိၭထၬဆၧအတရၫ့လီၫ. တၭအဝ့ၫဒၪဆၧၫ့နၩ့ဝ့ၫ လၧစဎွၩလဖၪအလးဆီၩ့ဆီ",
			"20": "<sup>20</sup> အဖၫ့ခိၪလီၫ.- တၭခးအၡၩခမျၧး ထီးအလူၬၥုၪ့ထိၬ ၥၭထိၬတၭ, ဒိၩ့အီၪဂုးဖုးဝ့ၫလီၫ. ၦမၩၥံၫနးအၭၥလဲ အၫလၧနၭလၧစဎွၩအဂံၪ့အနဲၩ့နီၪလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> လၧစယဟိအၭကဲၪထၪ့ၥၫ့စဎွၩနီၪ အၥၭအီၪနွ့ၫနံၪ့ လီၫ.စယံဟုၫအနံၪ့နွ့ၫနံၪ့လနံၪ့နီၪ, စယဟိအၭကဲၪ ၥၫ့စဎွၩတၭ, ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့အနံၪ့လံ ဆံၫလီၫ. အမိအမံၩ့မွဲနးဇံၫဘဲအၫ ဘၪဆဲၫ့လၧဘံအၧၫ",
			"2": "<sup>2</sup> ၡံဘၫလီၫ.- တၭကယဲမုနံၩလၧၦလုဆၧစယဟီအဒၫ ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဝ့ၫနီၪ စယဟိအၭမၩဆၧအတီၩလၧယ",
			"3": "<sup>3</sup> ဟိဝၩအမ့ၬယၫလီၫ.- လါနၫ့နီၪဆၧၥုၭခွံၬဆၧအလး ထၪ့ထီၫလဖၪအ့ၬ. ၦခမျၧးလုထၪ့ဒံၭဆၧတၭ,ဆူၭခဲၩ ဆၧနၧၫ့မၧၫ့လၧဆၧအလး ထၪ့ထီၫလဖၪလီၫ.",
			"4": "<sup>4</sup> တၭစယဟိအၭစံၭၦလုဆၧလဖၪ, ကယဲစ့ၩဘၪ ဆဲၫ့လၧဆၧဆံၫ့ဎံၪလဖၪလၧအဘၪ ဆၧဂဲၫဆိၬဝ့ၫလၧ ယဟိဝၩအဂံၪ့ဖၧၩ့, ၦအစ့ၩလၧအလ့ၩဖီၩ့ဆၧဆုၬဆုၬ, စ့ၩလၧဆၧအီၪက့ၪဝ့ၫလၧ အၥၭလဖၪအဂးဆုၬဆုၬ, ကယဲစ့ၩလၧအဂဲၫထၪ့လၧၦၡၩအၥၭခံဖၧၩ့ ဘဲၫၥိၭအ",
			"5": "<sup>5</sup> မိဂဲၫဆိၬဝ့ၫလၧယဟိဝၩအဂံၪ့ထီးအလူၬနီၪ,- မွဲၦလု ဆၧလဖၪမၩန့ဝ့ၫလဂၩလၧအထံၩအၥိၭ, လဂၩလၧ အထံၩအၥိၭတၭး မွဲအမၩဂ့ၩထၪ့ထဲၩ့ဆၧဖိးလၧဂံၪ့ ဖၧၩ့,ထီးဒၪအဒၪန့ဆၧဖိးလစီၪ့လါလါနီၪဆံၭ.",
			"6": "<sup>6</sup> တၭလၧစယဟိအၭ အနံၪ့နံၫဆံၫၥၧၫ့နံၪ့ လနံၪ့နီၪ, ဆၧမၩအၥၭလၧၦလုဆၧလဖၪ မၩဂ့ၩထၪ့ထဲၩ့ဒံၭဂံၪ့",
			"7": "<sup>7</sup> အဖိးဒံၭအ့ၬ.- တၭစဎွၩယဟိအၭကိၭန့ၦလုဆၧစယ ဟီအဒၫဒဲၦလုဆၧလဖၪတၭ, စံၭအဝ့ၫၥံၪ, နၥံၪလမၩ ဂ့ၩထၪ့ထဲၩ့ဘၪဂံၪ့ အဆၧဖိးနီၪမွဲဘၪလဲၪ. ဘိၩ့နဲၪ့ ယီၩမၩန့လၧၩ့စ့ၩလၧနၥံၪအထံၩအၥိၭလဂ့ၩ, အ့ၪမွဲ ဖ့ၪလၫ့လၧဂံၪ့ဖိးအဂးနီၪဆံၭ.",
			"8": "<sup>8</sup> တၭၦလုဆၧလဖၪဒိၭန့ လၧၩ့စ့ၩလၧၦခမျၧးမွဲဂ့ၩ, မၩဂ့ၩထၪ့ထဲၩ့ဂံၪ့အဂးလၧ ဆၧဘုၪ့ဖိးၥံၪနီၪမွဲဂ့ၩ,အုၩ့",
			"9": "<sup>9</sup> လၩ့ဝ့ၫအ့ၬ.- အ့ၪမွဲၦလုဆၧစယဟီအဒၫမၩန့တလၫ လဖျိၪ့တၭ, ဖျံၭဖိးဝ့ၫလၧအဖၫ့ခိၪတၭ, အီၪက့ၪဝ့ၫလၧ ဆၧလုလးအနဲၩ့ထံၭ, လၧစူၪထွ့ၪလခီၫထီးၦလ့ၩနုၬ လၧယဟိဝၩအဂံၪ့ဖၧၩ့လီၫ. ၦလုဆၧလဖၪလၧအပၧၩ့ ဘၪတရၫ့နီၪ ဒုၭနုၬကယဲစ့ၩလၧၦဂဲၫဆိၬဝ့ၫ လၧယဟိ ဝၩအဂံၪ့ဖၧၩ့ထီးအလူၬလီၫ.",
			"10": "<sup>10</sup> ထီးအဒၪဘၪလၧစ့ၩအီၪလၧ တလၫဖၧၩ့နီၪအၪဘံၪ့ တၭ,ဆၧမၩအၥၭလၧစဎွၩအၡၩ ကွ့ၭလံၬ,ဒဲၦလုဆၧ အခိၪဂဲၫထၪ့တၭ, ဘီၪ့ထၪ့ဝ့ၫတၭ, ဝံထၪ့နၬထၪ့စ့ၩ",
			"11": "<sup>11</sup> လၧအဒၪဝ့ၫလၧယဟိဝၩအဂံၪ့ဖၧၩ့နီၪလီၫ.- စ့ၩဘၪ ဝံထၪ့အၥၭနီၪ အဝ့ၫၥံၪဖ့ၪလၫ့ဝ့ၫ လၧၦမၩဆၧမၩလ ဖၪလၧယဟိဝၩအဂံၪ့လီၫ. အဝ့ၫၥံၪနီၪဖ့ၪလၫ့ထဲၩ့ ဝ့ၫလၧၦလဲၬၥမါၥံၪ, ဒဲၦၥုၪ့ဆၧၥံၪ လၧအမၩထဲၩ့ယ",
			"12": "<sup>12</sup> ဟိဝၩအဂံၪ့လီၫ.- ဒဲလၧၦပၠၩ့ၥမါၥံၪ, ဒဲလၧၦစိၭဖျၩ လိးၥံၪနီၪ, ဒဲဘဲၫၥိၭၦမိဎွ့ၩၥံၪ့ၥံၪ, လိးၥံၪဘၪစိၭဖျၩ အၥၭလၧအမိမၩဂ့ၩထၪ့ထဲၩ့ ဆၧဖိးလၧယဟိဝၩအ ဂံၪ့ဖၧၩ့,ဒဲလၧကယဲဆၧအဂး လၧအဖ့ၪလၫ့ဝ့ၫလၧအ",
			"13": "<sup>13</sup> ဂံၪ့အဂးဘဲၫအမိမၩဂ့ၩထၪ့ထဲၩ့ဝ့ၫလီၫ.- မွဲလါနၫ့တၭ လိၫ့စ့ၩမွဲဂ့ၩ, ထၭထံၬမ့ၪမွဲဂ့ၩ, ထွ့ၫၥံၪမွဲဂ့ၩ,ခွ့ၩၥံၪမွဲ ဂ့ၩ,ထွ့ၫထီၫ့မွဲဂ့ၩ, ထွ့ၫစ့ၩလမံၩ့မံၩ့မွဲဂ့ၩ,ၦၡၩမၩကဲၪ ထၪ့န့ဝ့ၫလၧစ့ၩလၧ ၦဂဲၫဆိၬဝ့ၫလၧယဟိဝၩအဂံၪ့နီၪ",
			"14": "<sup>14</sup> အ့ၬ.- အ့ၪမွဲအဝ့ၫၥံၪဖ့ၪလၫ့ဝ့ၫလၧ ၦမၩဆၧလဖၪ,ဒဲ",
			"15": "<sup>15</sup> မၩဂ့ၩထၪ့ထဲၩ့ယဟိဝၩအဂံၪ့လၧဆၧနီၪလီၫ.- လၧနီၪ အမ့ၬယၫၦလဖၪလၧအဝ့ၫၥံၪ ဖ့ၪလၫ့စ့ၩလၧအစူၪဖၧၩ့ ဘဲၫၥိၭအဝ့ၫၥံၪမိဖ့ၪလၫ့ထဲၩ့ ၦမၩဆၧလဖၪနီၪ,အဝ့ၫ ၥံၪဒိၭန့ဆရၫ့လၧအအီၪအ့ၬ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪ",
			"16": "<sup>16</sup> နီၪမၩဝ့ၫလၧအလူတီၩလီၫ.- တၭစ့ၩဘၪဆဲၫ့လၧဆၧ အမၪ,ဒဲစ့ၩဘၪဆဲၫ့လၧ ဆၧဒဲၩဘၭနီၪၦဂဲၫဆိၬလၧ ယဟိဝၩအဂံၪ့ဖၧၩ့အ့ၬ. မွဲၦလုဆၧလဖၪအဆၧလီၫ.",
			"17": "<sup>17</sup> ထီးနီၪလဖၧၫ့စံရအၫ အစဎွၩဟၭဇအ့လၭလ့ၩထၪ့ တၭ,ဒုၭဆၧလၧဂၫၥၭတၭ, မၩန့ဝ့ၫလီၫ. တၭစဟၭ ဇအ့လၭအီၪက့ၪအမ့ၬ လၧအမိလ့ၩထၪ့လၧယရုစ",
			"18": "<sup>18</sup> လံၫ့လီၫ.- တၭယုဒၫအစဎွၩ ယဟိအၭအၪ့မၩန့ကယဲ ဆၧဆံၫ့ဎံၪလဖၪ လၧအဖါၥံၪ, ယုဒၫအစဎွၩလဖၪ,စယ ဟီၡဖၭ,ဒဲစယိရၫ့, ဒဲအၫဟဇဲအၫလဖၪ မၩဘိၪ့ဝ့ၫအ ဆၧဒၪဝ့ၫလၧအအီၪက့ၪဆံၫ့ဎံၪဝ့ၫ, ဒဲကယဲထီၫ့ၥံၪလွ့ၫ ၥံၪလၧအဒၪန့ဝ့ၫလၧဆၧအီၪကီၪ့အလး လဖၪလၧယဟိ ဝၩအဂံၪ့ဖၧၩ့ဒဲလၧစဎွၩအဂံၪ့ဖၧၩ့ ထီးအလူၬတၭ,ဖ့ၪ ယုဝ့ၫလၧစံရအၫအစဎွၩ ဟၭဇအ့လၭလီၫ. တၭအဝ့ၫ",
			"19": "<sup>19</sup> ဒၪစဲၪ့ထၪ့ခွံၬလၧယရုစလံၫ့လီၫ.- တၭဆၧအီၪလၩ့ထး ဘၪဆဲၫ့လၧစယိအၭ, ဒဲကယဲဆၧလၧအမၩဝ့ၫထီးအ လူၬနီၪ,ကွ့ၭအၥၭလၧယုဒၫအစဎွၩအလံၬ ကွ့ၭနဲၪ့ဆၧ အဖၧၩ့နီၪ, မွဲအ့ၬဧၪ,",
			"20": "<sup>20</sup> အခ့ၫအၡၩလဖၪ ဂဲထုၪ့ထၫ့ဒၩဝ့ၫတၭ, အုၩ့လၩ့ လိၬအၥၭတၭ, မၩၥံၫစယဟိအၭ လၧမံလိၫ အဂံၪ့ဖၧၩ့",
			"21": "<sup>21</sup> လၧဆၧလ့ၩလၩ့လၧစံလၫလီၫ.- တၭစၡံၭမအၭအ ဖိၪခွၫစယီၭဇခၫ, ဒဲစၡိမၧၫ့အဖိၪခွၫ စယဟိဇဘၭ, အခ့ၫအၡၩလဖၪ ကျီၪ့ခွံၬဝ့ၫတၭ, ၥံၫဝ့ၫလီၫ.ၦခုၪ့လၩ့ ဘၧၩ့ခွံၬဝ့ၫလၧအဖါလဖၪအၥိၭ လၧစဒၫဝံၭအဒိၩ့ဖၧၩ့ တၭ,အဖိၪခွၫစအၫမဇဲအၫ ကဲၪထၪ့စဎွၩလၧအလး နီၪလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> လၧယုဒၫအစဎွၩ အၫဟဇဲအၫအဖိၪခွၫ စယိအၭ အနံၪ့နံၫဆံၫၥၧၫ့နံၪ့အဖၧၩ့နီၪ စယံဟုၫအဖိၪခွၫ စယဟိ အဟၭကဲၪထၪ့စဎွၩလၧအံၫစရ့လၭ အဖၫ့ခိၪလၧစမ့",
			"2": "<sup>2</sup> ရအၫအဖၧၩ့တၭ, ပၧၩ့ဆၧလဆံၫနွ့ၫနံၪ့လီၫ.- အဝ့ၫ မၩဆၧအၧၩ့လၧယဟိဝၩအမ့ၬယၫတၭ, လီၩ့စနံဘၭ အဖိၪခွၫစယ့ၫရဘိအၫ့ လၧအဒုၭမၩအံၫစရ့လၭလၧ ဆၧဒဲၩဘၭလဂၩ အဆၧဒဲၩဘၭလီၫ. စဲၪ့ဒၪဝ့ၫအ့ၬ.",
			"3": "<sup>3</sup> ယဟိဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪ အံၫစရ့လၭတၭ,အဝ့ၫ ဒၪဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪလၧစံရအၫအစဎွၩ ဟၭဇအ့လၭ အစူၪဖၧၩ့,ဒဲလၧစဟၭဇအ့လၭ အဖိၪခွၫစဘံၫ့ဟၫဒၭ",
			"4": "<sup>4</sup> အစူၪဖၧၩ့အမုနံၩထီးအလူၬလီၫ.- စယဟိအဟၭအၪ့ ကံၩ့အၪ့ယၫယဟိဝၩတၭ, ယဟိဝၩခိၭနၪအလူလီၫ. အဂဲးဘဲၫယီၩဒၪဘၪဝ့ၫလၧ အံၫစရ့လၭအဆၧၡၪ့ဆၧ နၭလီၫ. အဂဲးဘဲၫယီၩ စံရအၫအစဎွၩ မၩနၭမၩၡၪ့",
			"5": "<sup>5</sup> ဝ့ၫလီၫ.- (ယဟိဝၩဖ့ၪလၫ့အံၫစရ့လၭ လၧဆၧမၩ ဖီၩ့မၩဖျ့ၭဝ့ၫတၭ, အဝ့ၫၥံၪနီၪစဲၪ့ထၪ့ခွံၬလၧၦစံရအၫ ဖိၪအစူၪဖၧၩ့တၭ, ၦအံၫစရ့လၭဖိၪအီၪဝ့ၫလၧအတဲၩ လဖၪအဖၧၩ့, ဘဲၫလၧအၥၫ့ လၧအခၪ့ထံၭအၥိၭနီၪ",
			"6": "<sup>6</sup> လီၫ.- မွဲလါနၫ့ဘိၩ စဲၪ့ဒၪစယ့ၫရဘိအၫ့လၧအဒုၭမၩ အံၫစရ့လၭလၧဆၧဒဲၩဘၭလဂၩ အၡၩဂံၪ့ဖိၪအဆၧ ဒဲၩဘၭအ့ၬ. လ့ၩဝ့ၫလၧအဖၧၩ့တၭ, အၡ့ရိၫအီၪဒံၭဆ့",
			"7": "<sup>7</sup> လၧစမ့ရအၫအဖၧၩ့နီၪလီၫ.)- အဝ့ၫဒၪအီၪက့ၪလၩ့ ထးဝ့ၫလၧၦခမျၧးအကျၩ လၧစယဟိအဟၭအဂးန့ၫ ၦကၥ့ၪၥုၭယဲဆံၫ, ဒဲလဲၪ့ၥုၭဆံၫခိၪ, ဒဲၦခၪ့ၥုၭလလၬ လီၫ.အဂဲးဘဲၫယီၩ, စံရအၫအစဎွၩမၩဂၭဂီၩ့ဝ့ၫတၭ အီၪက့ၪဝ့ၫ ဘဲၫဆၧယဲးဘုၪအဆၧဘံၪၥိၭ အၥိၭနီၪ လီၫ.",
			"8": "<sup>8</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစယဟိအဟၭ,ဒဲ ကယဲဆၧလၧအမၩဝ့ၫ, ဒဲအစီၩ့အမၩ့နီၪ ကွ့ၭအၥၭ လၧအံၫစရ့လၭအစဎွၩ အလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ,",
			"9": "<sup>9</sup> မွဲအ့ၬဧၪ.- တၭစယဟိအဟၭမံၫဝ့ၫလၧ အဖါလဖၪအ ၥိၭတၭ, ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧစမ့ရအၫအဖၧၩ့တၭ, အဖိၪခွၫစယိအၭကဲၪထၪ့စဎွၩ လၧအလးနီၪလီၫ.",
			"10": "<sup>10</sup> လၧယုဒၫအစဎွၩယိအၭအနံၪ့ၥၧၫ့ဆံၫ နွ့ၫနံၪ့လနံၪ့ အဖၧၩ့နီၪ, စယဟိအဟၭအဖိၪခွၫ စယဟိအၭကဲၪထၪ့ စဎွၩလၧအံၫစရ့လၭ အဖၫ့ခိၪလၧစမ့ရအၫ အဖၧၩ့",
			"11": "<sup>11</sup> တၭ,ပၧၩ့ဆၧလဆံၫဎူၫနံၪ့လီၫ.- အဝ့ၫဒၪမၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬယၫတၭ, စဲၪ့ဒၪစနံဘၭ အဖိၪခွၫ စယ့ၫရဘိအၫ့ လၧအဒုၭမၩအံၫစရ့လၭ လၧဆၧဒဲၩ ဘၭလဂၩအဆၧဒဲၩဘၭနီၪနးမံၩ့အ့ၬ. လ့ၩဝ့ၫလၧအ",
			"12": "<sup>12</sup> ဖၧၩ့လီၫ.- ဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစယဟိအၭ, ဒဲကယဲဆၧလၧအမၩဝ့ၫ, ဒဲအစီၩ့အမၩ့လၧအဒုၭဆၧ ထၫ့ဒၩယုဒၫအစဎွၩ အၫမဇဲအၫနီၪ, ကွ့ၭအၥၭလၧအံၫ",
			"13": "<sup>13</sup> စရ့လၭအလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.- တၭ စယိအၭမံၫဝ့ၫလၧအဖါလဖၪအၥိၭတၭ, စယ့ၫရဘိ အၫ့ဆၧၫ့နၩ့လၧအလးဆီၩ့ဆီအဖၫ့ခိၪတၭ, စယိအၭ ဘၪဆၧခုၪ့လၩ့ဘၧၩ့ဝ့ၫ လၧစမ့ရအၫအဖၧၩ့ အီၪလၧ အံၫစရ့လၭအစဎွၩၥံၪအၥိၭလီၫ.",
			"14": "<sup>14</sup> စအံၫလဲၡၫဆၫဝ့ၫ လၧဆၧဆၫ လၧအၥံၫဝ့ၫလၧအ ကၠီၩ့တၭ,အံၫစရ့လၭအစဎွၩစယိအၭ ဂဲၫလၩ့လၧအ အီၪတၭ,ဂၪ့ဝ့ၫလၧအမ့ၬအဖၫ့ခိၪတၭ, စံၭဝ့ၫဒၪ,ယဖါ ဧ့,ယဖါဧ့,အံၫစရ့လၭအလဲၪ့ကၥ့ၪ, ဒဲအကၥ့ၪၥုၭဧ့,",
			"15": "<sup>15</sup> စအံၫလဲၡၫစံၭဝ့ၫ, မၩန့ချံၪဒဲဖျါလဖၪဆံၭ, တၭအဆၧ",
			"16": "<sup>16</sup> မၩန့ချံၪဒဲဖျါလဖၪနီၪလီၫ.- စံၭအံၫစရ့လၭအစဎွၩ, အီၪက့ၪနစူၪလၧချံၪအဖၫ့ခိၪဆံၭ. တၭအဆၧအီၪက့ၪ အစူၪလီၫ. တၭစအံၫလဲၡၫအီၪက့ၪအစူၪလၧစဎွၩအ",
			"17": "<sup>17</sup> စူၪအဖၫ့ခိၪလီၫ.- တၭစံၭဝ့ၫဒၪဝဲထၪ့တရၫ့လံၩလၧမု ထၪ့လခီၫဆံၭ. စအံၫလဲၡၫစံၭ, ခၭဆၧဘီၪ, တၭအ ဆၧခၭဝ့ၫလီၫ. တၭစံၭဝ့ၫဒၪ, ယဟိဝၩအဆၧမၩဖီၩ့ ဖျ့ၭအဖျါလဘံၪ့, ဒဲဆၧမၩဖီၩ့ဖျ့ၭ လၧစံရအၫအဖျါ လီၫ.အဂဲးဘဲၫယီၩ နမိကျီၪ့ခွံၬ ၦစံရအၫဖိၪလၧအၫ",
			"18": "<sup>18</sup> ဖံၭအဖၧၩ့ထီးနမၩလူၬဝ့ၫလီၫ.- တၭစံၭဝ့ၫဒၪမၩန့ဖျါ လဖၪဆံၭ. တၭအဆၧမၩန့ဝ့ၫလီၫ. တၭစံၭအံၫစရ့လၭ အစဎွၩ, ထးဂၪ့ခိၪဆံၭ. တၭအဆၧထးဝ့ၫၥၧၫ့ဖၧၫ့တၭ",
			"19": "<sup>19</sup> အီၪပထုၬဝ့ၫလီၫ.- ယွၩအၡၩၥၭထၪ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ဂ့ၩလၧနထးဆၧယဲဖၧၫ့ဎူၫဖၧၫ့လီၫ. ထီးနီၪလဖၧၫ့နမိ ထးဘၪစံရအၫ ထီးနမၩလူၬဝ့ၫလီၫ. အ့ၪမွဲဘိၩ့နဲၪ့ ယီၩနမိထးစံရအၫၥၧၫ့ဖၧၫ့လီၫ.",
			"20": "<sup>20</sup> စအံၫလဲၡၫၥံၫဝ့ၫတၭ, ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလီၫ. တၭၦမိအၭဖိၪအဒီၪ့လဖၪ, ဂဲၫနုၬဆီၪ့လၧခးဖၧၩ့လၧ",
			"21": "<sup>21</sup> နံၪ့ထၪ့ၥၫ့နီၪလီၫ.- တၭၦခုၪ့လၩ့ဘၧၩ့ၦလဂၩအဘိၩ့ ဘၭနီၪ,ယိခွါ, ဆၧမၩအၥၭလၧအဒၪဘၪ ၦလဒီၪ့တၭ, ခွံၬလၩ့ၦလဂၩနီၪ လၧစအံၫလဲၡၫ အၥွၪခိၪဖၧၩ့တၭ, ထီးၦဆဲၩလၩ့ဝ့ၫတၭ, ဘၪထံၭလၧစအံၫလဲၡၫအဎွံၪ လဖၪနီၪမၧၫ့ထၪ့ထဲၩ့ဝ့ၫတၭ, ဆၧၫ့ထုၪ့ထၪ့ဝ့ၫလၧအ ခၪ့လီၫ.",
			"22": "<sup>22</sup> စံရအၫအစဎွၩ ဟၭဇအ့လၭမၩအၧၩ့မၩနၭအံၫ စရ့လၭလၧစယဟိအဟၭအမုနံၩ ထီးအလူၬအဖၧၩ့",
			"23": "<sup>23</sup> လီၫ.- ယဟိဝၩမၩခိးမၩတၩအဝ့ၫၥံၪ, အၥၭအီၪအဝ့ၫ ၥံၪတၭ,ယိမ့ၬဝ့ၫလၧ အဆၧအုၩ့လၩ့လၧစအၫဘြဟၫ့, ဒဲစအံစၭ, ဒဲစယၫကူၭအကၠီၩ့ လမၩဂၭဂီၩ့ဘၪအဝ့ၫ",
			"24": "<sup>24</sup> ၥံၪတၭ,ခွံၬၡိၭခွံၬဝ့ၫလၧ အမ့ၬယၫအ့ၬ.- စံရအၫအ စဎွၩဟၭစအ့လၭၥံၫဝ့ၫတၭ, အဖိၪခွၫစဘံၫ့ဟၫဒၭ",
			"25": "<sup>25</sup> ကဲၪထၪ့စဎွၩလၧအလးနီၪလီၫ.- တၭစယဟိအဟၭ အဖိၪခွၫစယဟိအၭ မၩန့ထဲၩ့ဒိၩ့လဖၪ, လၧစဟၭ ဇအ့လၭအဖိၪခွၫ စဘံၫ့ဟၫဒၭအစူၪဖၧၩ့ လၧအမၩန့ လၧအဖါစယဟိအဟၭအစူၪဖၧၩ့ လၧဆၧဒုၭၥုၭလီၫ. တၭစယိအၭမၩစၪဝ့ၫၥၧၫ့ဖၧၫ့တၭ, မၩန့ထဲၩ့အံၫစရ့ လၭအဒိၩ့လဖၪနီၪလီၫ."
		},
		"14": {
			"1": "<sup>1</sup> လၧအံၫစရ့လၭအစဎွၩ စယဟိအဟၭအဖိၪခွၫစယိ အၭအနံၪ့နံၫနံၪ့လနံၪ့အဖၧၩ့နီၪ, ယုဒၫအစဎွၩယိအၭ",
			"2": "<sup>2</sup> အဖိၪခွၫစအၫမဇဲအၫကဲၪထၪ့စဎွၩလီၫ.- ထီးအကဲၪ ၥၫ့စဎွၩနီၪအၥၭၡါနံၫဆံၫယဲနံၪ့တၭ, ကဲၪစဎွၩလၧယ ရုစလံၫ့အဖၧၩ့နံၫဆံၫခွံၫနံၪ့လီၫ. အမိအမံၩ့မွဲနးယဟိ",
			"3": "<sup>3</sup> အၭဒၫ့လၧယရုစလံၫ့လီၫ.- အဝ့ၫနီၪမၩဆၧတီၩဆၧ လီၩ့လၧယဟိဝၩအမ့ၬယၫလါနၫ့ဘိၩ, မၩဝ့ၫဘဲၫအဖါ စဒၫဝံၭအၥိၭအ့ၬ. မွဲအမၩဝ့ၫဘဲၫအဖါစယိအၭ မၩ",
			"4": "<sup>4</sup> ဝ့ၫအၥိၭနီၪလီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, ဆၧၥုၭခွံၬအ လးထၪ့ထီၫလဖၪအ့ၬ. ၦခမျၧးလုထၪ့ဒံၭဆၧတၭ,ဆူၭ ခဲၩဒံၭဆၧနၧၫ့မၧၫ့ လၧဆၧအလးထၪ့ထီၫ အဖၫ့ခိၪနီၪ",
			"5": "<sup>5</sup> လီၫ.- တၭထီးအဘၩ့အမုးအီၪဂုးအီၪခၧၫ့လၧအစူၪ ဖၧၩ့တၭ,ဆၧမၩအၥၭလၧ အမၩၥံၫအခ့ၫအၡၩလဖၪ,",
			"6": "<sup>6</sup> လၧအမၩၥံၫအဝ့ၫဒၪအဖါနီၪလီၫ.- အ့ၪမွဲၦမၩၥံၫဆၧ အဖိၪအလံၩလဖၪနီၪ မၩၥံၫဝ့ၫအ့ၬ. ဘဲၫဆၧကွ့ၭအၥၭ လၧစမိစ့ၭအဆၧၥီၪ့ဆၧၥၫ့အလံၬဖၧၩ့အၥိၭ, ထီးယ ဟိဝၩမၪလူၬဆၧစံၭဝ့ၫဒၪ, ဖါလဖၪဘၪဆၧမၩၥံၫဝ့ၫ လၧဖိၪလဖၪအကၠီၩ့အ့ၬ. ဒဲဖိၪလဖၪဘၪဆၧမၩၥံၫဝ့ၫ လၧဖါလဖၪအကၠီၩ့ဆ့အ့ၬ. အ့ၪမွဲၦမိဘၪၥံၫလၧအဆၧ",
			"7": "<sup>7</sup> ဒဲၩဘၭဒၪဝ့ၫအကၠီၩ့နီၪကိၭဂၩဒ့ၭဆုၬဆုၬလီၫ.- အဝ့ၫ ဒၪမၩၥံၫၦအံဒၧၫ့ဖိၪလလၬ လၧခိၪလီၩ့ထံၫလၪအဆူၭ ဖၧၩ့တၭ,လၧအဒုၭဆၧအဖၧၩ့နီၪ, မၩန့စံလၫတၭ,ဖျိၬ အမံၩ့လၧယီၭၥၪအ့လၭ ထီးမုဆၫလနံၩယီၩလီၫ.",
			"8": "<sup>8</sup> ထီးနီၪလဖၧၫ့ စအၫမဇဲအၫ အၪ့မၧၫ့လၩ့အၥီၫ့လ ဖၪလၧအံၫစရ့လၭအစဎွၩ ယံဟုၫအဖိၪခွၫစယဟိအ ဟၭအဖိၪခွၫစယိအၭတၭ, စံၭဝ့ၫဒၪ,ဂဲၫဘီၪ, မွဲပယိ",
			"9": "<sup>9</sup> လိၬပမ့ၬဆံၭ.- တၭအံၫစရ့လၭ အစဎွၩယဟိအၭအၪ့ မၧၫ့လၩ့ ဆၧလၧယုဒၫအစဎွၩအၫမဇဲအၫနီၪ, စံၭဝ့ၫ ဒၪ,ဆၧဆူၪလၧလံၭဘနၧၫ့အလီၩ့, အၪ့မၧၫ့လၩ့ဆၧ လၧၥံၪ့ၡိၫအ့ရ့ၭလၧလံၭဘနၧၫ့အလီၩ့တၭ, စံၭဝ့ၫဒၪ, ဖ့ၪလၫ့နဖိၪမုၪလၧ ယဖိၪခွၫအမၫအဂးဆံၭ. တၭဆၧ ဖိၪဆၧဎါအမံၩ့ လၧလံၭဘနၧၫ့အလီၩ့ လဒုၩလ့ၩဆၧ",
			"10": "<sup>10</sup> တၭယဲးထဲးလၩ့ဆၧဆူၪနီၪလီၫ.- နကျီၪ့ခွံၬယူၭအံ ဒၧၫ့တၡါယူၭတၭ နၥၭအီၪက့ၪထၪ့ထီၫနၧၩလီၫ. အီၪ က့ၪဖိၪလိၫနၥၭတၭ, အီၪဒၪဆၧလၧနဂံၪ့ဆံၭ. နမိမၩ ဆၧလၧနဆၧအၧၩ့အဂးတၭ လၩ့ထံၩဖါနဝ့ၫဒၪ, ဒဲယု",
			"11": "<sup>11</sup> ဒၫအီၪလၧနၥိၭနီၪမွဲဘၪလဲၪ.- အ့ၪမွဲစအၫမဇဲအၫခိၭ နၪဆၧအ့ၬ. အခိးမွဲအံၫစရ့လၭအစဎွၩ ယဟိအၭလ့ၩ ထၪ့တၭ,အဝ့ၫဒၪဒဲယုဒၫအစဎွၩ အၫမဇဲအၫယိလိၬ",
			"12": "<sup>12</sup> အမ့ၬလၧဘ့ၭၥၡ့မ့ၭ ဘၪဆဲၫ့လၧယုဒၫလီၫ.- ယုဒၫ ဘၪဆၧမၩနၧၩ့မၩစၪဝ့ၫ လၧအံၫစရ့လၭ အမ့ၬယၫ တၭ,ၦစဲၪ့ထၪ့ခွံၬလဂၩလၧ အတဲၩဒၪဝ့ၫ,လဂၩလၧအ",
			"13": "<sup>13</sup> တဲၩဒၪဝ့ၫနီၪလီၫ.- အံၫစရ့လၭအစဎွၩယဟိအၭမၩ န့ယုဒၫအစဎွၩ, စအၫမဇဲအၫ, စယိအၭအဖိၪခွၫစအၫ ဟဇဲအၫအဖိၪခွၫ, လၧဘ့ၭၥၡ့မ့ၭအဖၧၩ့တၭ, ဂဲၫဝ့ၫ လၧယရုစလံၫ့တၭ, မၩလၩ့ဎီးယရုစလံၫ့အခိၪဒၧၩ့ အဖျါလံယၩ, လၧတရၫ့အံဖြံၫ့ထီၩ့လၧဆၧအနိၪ့အ",
			"14": "<sup>14</sup> တရၫ့လီၫ.- တၭမၩန့ထီၫ့ၥံၪလွ့ၫၥံၪ, ဒဲကျိၪၥံၪစ့ၩၥံၪ ထီးအလူၬ, ဒဲဆၧအဎၧၩ့အဎီလၧအဒၪန့ဝ့ၫလၧယဟိ ဝၩအဂံၪ့ဖၧၩ့ထီးအလူၬ, ဒဲဆၧလူဒိၪဎွ့ၩဒိၪ,လၧစဎွၩ အဂံၪ့ဖၧၩ့ဒဲဆၧလၧၦပီၩ့လၩ့ဝ့ၫလဖၪတၭ, ထဲၩ့ကဒၩ ထဲၩ့ဝ့ၫလၧစမ့ရအၫနီၪလီၫ.",
			"15": "<sup>15</sup> ဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧစယဟိအၭ, ကယဲဆၧ လၧအမၩဝ့ၫ,ဒဲအစီၩ့အမၩ့, ဒဲဒုၭၥုၭလၧယုဒၫအစဎွၩ အၫမဇဲအၫအဂဲးအကၠီၪ့နီၪ ကွ့ၭအၥၭလၧအံၫစရ့လၭ",
			"16": "<sup>16</sup> အစဎွၩအလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.- စယ ဟိအၭမံၫဝ့ၫ လၧအဖါၥံၪအၥိၭတၭ, ဘၪဆၧခုၪ့လၩ့ ဘၧၩ့ဝ့ၫလၧစမ့ရအၫအဖၧၩ့ အီၪလၧအံၫစရ့လၭအ စဎွၩလဖၪအၥိၭတၭ, အဖိၪခွၫစယ့ၫရဘိအၫ့ကဲၪထၪ့ စဎွၩလၧအလးနီၪလီၫ.",
			"17": "<sup>17</sup> တၭယုဒၫအစဎွၩစယိအၭအဖိၪခွၫ စအၫမဇဲအၫ, မၧၫ့ဒံၭဝ့ၫလၧအံၫစရ့လၭ အစဎွၩယဟိအဟၭအဖိၪ ခွၫစယဟိအၭၥံၫဝ့ၫအလးခဲၫ့နီၪ လဆံၫယဲနံၪ့လီၫ.",
			"18": "<sup>18</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စအၫမဇဲအၫကွ့ၭအ ၥၭလၧယုဒၫအစဎွၩၥံၪအလံၬ ကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ,",
			"19": "<sup>19</sup> မွဲအ့ၬဧၪ.- ၦကိၪ့ဆၧအၧၩ့ထၫ့ဒၩဝ့ၫလၧ ယရုစလံၫ့အ ဖၧၩ့တၭ, အဝ့ၫဒၪစဲၪ့ဝ့ၫလၧလၫခံၭတၭ, အဝ့ၫၥံၪအၪ့ မၧၫ့လၩ့ၦလီၩ့အဝ့ၫ ထီၩ့လၧလၫခံၭတၭ, မၩၥံၫဝ့ၫ",
			"20": "<sup>20</sup> ထီးနီၪလီၫ.- ၦဂဲၫဆိၬဝ့ၫလၧကၥ့ၪအလီၩ့တၭ, ခုၪ့လၩ့ ဘၧၩ့ခွံၬဝ့ၫလၧ ယရုစလံၫ့အဖၧၩ့ လၧအဖါၥံၪအၥိၭ လၧစဒၫဝံၭအဒိၩ့ဖၧၩ့လီၫ.",
			"21": "<sup>21</sup> ယုဒၫအၡၩခမျၧးထီးအလူၬ မၩန့စအၭဇရဲအၫလၧ အၥၭအီၪလဆံၫဎူၫနံၪ့လဂၩတၭ, အီၪက့ၪဝ့ၫလၧစဎွၩ",
			"22": "<sup>22</sup> လၧအဖါစအၫမဇဲအၫအလးနီၪလီၫ.- အဝ့ၫဒၪမၩ ဂ့ၩထၪ့ထဲၩ့ အံလၫတၭ, မၩန့ထဲၩ့ဝ့ၫလၧယုဒၫအဂး တၭ,လၧဆၧနီၪအလးခဲၫ့ စဎွၩမံၫလၧအဖါၥံၪအၥိၭ လီၫ.",
			"23": "<sup>23</sup> လၧယုဒၫအစဎွၩယိအၭအဖိၪခွၫ စအၫမဇဲအၫအ နံၪ့လဆံၫယဲနံၪ့လနံၪ့အဖၧၩ့နီၪ, အံၫစရ့လၭ, အစဎွၩ ယိအၭအဖိၪခွၫ စယ့ၫရဘိအၫ့ကဲၪၥၫ့စဎွၩ လၧစမ့ရ",
			"24": "<sup>24</sup> အၫလံဆံၫလနံၪ့လီၫ.- အဝ့ၫဒၪမၩဆၧအၧၩ့လၧယဟိ ဝၩအမ့ၬယၫတၭ, စဲၪ့ဒၪခွံၬစနံဘၭအဖိၪခွၫ စယ့ၫရ ဘိအၫ့လၧအဒုၭမၩအံၫစရ့လၭ, လၧဆၧဒဲၩဘၭလဂၩ",
			"25": "<sup>25</sup> အဆၧဒဲၩဘၭအ့ၬ.- အဝ့ၫမၩန့ထဲၩ့အံၫစရ့လၭအခး နဲၩ့လၧဆၧလ့ၩနုၬလၧဟၫမၭ ထီၩ့လၧဆၧပျၩ့ဖၧၩ့အ မၫဆမံၭ,ဘဲၫယဟိဝၩအံၫစရ့လၭ အယွၩအလူလၧ အချဲၩ့ဝ့ၫလၧအခ့ၫအၡၩ, စအမံၭတ့ၫအဖိၪခွၫစယိ နၫ,မီၪ,လၧအဘၪဆဲၫ့လၧ ဂၫၥၭဟံဖၧၫအစူၪဖၧၩ့အ",
			"26": "<sup>26</sup> ၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩ ယဟိဝၩဒၪဘၪအံၫစရ့ လၭအဆၧနၭဆၧၡၪ့နၭမၬလီၫ. အဂဲးဘဲၫယီၩၦလၧ အဘၪဆၧဒုၭထၬဝ့ၫလအီၪ, ဒဲၦအီၪလၩ့ထးလအီၪ, ဒဲၦမၩဘိၭမၩဆၧၩ့ လၧအံၫစရ့လၭအဂး အီၪနးဂၩ",
			"27": "<sup>27</sup> အ့ၬ.- တၭယဟိဝၩစံၭလၧ အမိထူၭခွံၬ အံၫစရ့လၭ အမံၩ့လၧမူၭခိၪအဖၫ့လၬမွဲအ့ၬ. မွဲအမၩဖီၩ့မၩဖျ့ၭဝ့ၫ လၧစယိအၭအဖိၪခွၫ စယ့ၫရဘိအၫ့အစူၪဖၧၩ့နီၪလီၫ.",
			"28": "<sup>28</sup> ဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စယ့ၫရဘိအၫ့,ဒဲကယဲ ဆၧလၧအမၩဝ့ၫဒဲအစီၩ့အမၩ့ လၧအဒုၭဆၧတၭ,မၩ န့ထဲၩ့ဒမၭစကၧၭ, ဒဲဟၫမၭဘၪဆဲၫ့လၧယုဒၫလၧအံၫ စရ့လၭအဂးနီၪ, ကွ့ၭအၥၭလၧအံၫစရ့လၭအစဎွၩအ လံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.",
			"29": "<sup>29</sup> တၭစယ့ၫရဘိအၫ့မံၫဝ့ၫလၧ အဖါၥံၪအၥိၭလၧအံၫ စရ့လၭအစဎွၩလဖၪအၥိၭတၭ, အဖိၪခွၫစဇၭခရဲ အၫကဲၪထၪ့စဎွၩလၧ အလးနီၪလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> လၧအံၫစရ့လၭအစဎွၩ ယ့ၫရဘိအၫ့အနံၪ့နံၫဆံၫ နွ့ၫနံၪ့အဖၧၩ့နီၪ ယုဒၫအစဎွၩအၫမဇဲအၫ အဖိၪခွၫ",
			"2": "<sup>2</sup> စအၭဇရဲအၫကဲၪထၪ့ၥၫ့စဎွၩလီၫ.- လၧအကဲၪၥၫ့ စဎွၩနီၪအၥၭအီၪလဆံၫဎူၫနံၪ့တၭ, ကဲၪစဎွၩလၧယ ရုစလံၫ့အဖၧၩ့ ယဲဆံၫနံၫနံၪ့လီၫ. အမိအမံၩ့မွဲနးယ့ၭ",
			"3": "<sup>3</sup> ကလဲအၫလၧယရုစလံၫ့လီၫ.- အဝ့ၫမၩဆၧအဂ့ၩလၧ ယဟိဝၩအမ့ၬယၫ, ဘဲၫကယဲဆၧလၧအဖါ စအၫမဇဲ",
			"4": "<sup>4</sup> အၫမၩဝ့ၫအၥိၭနီၪလီၫ.- မွဲလါနၫ့ဘိၩ ၥုၭခွံၬဆၧအ လးထၪ့ထီၫလဖၪအ့ၬ. ၦခမျၧးလုထၪ့ဒံၭဆၧ, ဒဲဆူၭခဲၩ ဒံၭဆၧနၧၫ့မၧၫ့ လၧဆၧအလးထၪ့ထီၫလဖၪ အဖၫ့ခိၪ နီၪလီၫ.",
			"5": "<sup>5</sup> ယဟိဝၩထးစဎွၩတၭ, အဝ့ၫကဲၪထၪ့ၦခံၫထူၬဆၫ အၧၩ့ထီးမုလနံၩလၧအၥံၫလီၫ. တၭအီၪဝ့ၫလၧဆၧ ဆၫအဂံၪ့ဖၧၩ့လီၫ. စဎွၩအဖိၪခွၫ စယိၥၫ့အီၪဝ့ၫလၧ ဂံၪ့အဖၫ့ခိၪတၭ စ့ၩရၫ့ခးအၡၩခမျၧးလီၫ.",
			"6": "<sup>6</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စအၭဇရဲအၫ,ဒဲ ကယဲဆၧလၧအမၩဝ့ၫထီးအလူၬနီၪ ကွ့ၭအၥၭလၧယု ဒၫအစဎွၩအလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.",
			"7": "<sup>7</sup> စအၭဇရဲအၫမံၫဝ့ၫ လၧအဖါၥံၪအၥိၭတၭ, ၦခုၪ့လၩ့ ဘၧၩ့ခွံၬဝ့ၫလၧအဖါၥံၪအၥိၭ လၧစဒၫဝံၭအဒိၩ့ဖၧၩ့ တၭ,အဖိၪခွၫစယိၥၫ့ကဲၪထၪ့စဎွၩ လၧအလးနီၪလီၫ.",
			"8": "<sup>8</sup> လၧယုဒၫအစဎွၩအၭဇရဲအၫ အနံၪ့ၥၧၫ့ဆံၫဎိၭနံၪ့ လနံၪ့အဖၧၩ့နီၪ, စယ့ၫရဘိအၫ့အဖိၪခွၫ စဇၭခရဲအၫ ကဲၪထၪ့စဎွၩလၧ အံၫစရ့လၭအဖၫ့ခိၪ လၧစမ့ရအၫအ",
			"9": "<sup>9</sup> ဖၧၩ့လၩဎူၫဘံၪ့လီၫ.- အဝ့ၫဒၪမၩဆၧအၧၩ့လၧယဟိ ဝၩအမ့ၬယၫဘဲၫအဖါလဖၪမၩဝ့ၫအၥိၭနီၪလီၫ. တၭ စဲၪ့ဒၪစနံဘၭ အဖိၪခွၫ စယ့ၫရဘိအၫ့လၧအဒုၭမၩ အံၫစရ့လၭလၧဆၧဒဲၩဘၭ လဂၩအဆၧဒဲၩဘၭအ့ၬ.",
			"10": "<sup>10</sup> တၭစယၫဘံၭအဖိၪခွၫ စၡၫလၧၫ့ကိၪ့ဆၧအၧၩ့ထၫ့ဒၩ ဝ့ၫတၭ,ကျီၪ့ခွံၬဝ့ၫလၧၦခမျၧးအမ့ၬယၫ, မၩၥံၫဝ့ၫ တၭ,ကဲၪထၪ့စဎွၩလၧအလးလီၫ.",
			"11": "<sup>11</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစဇၭခရဲအၫနီၪ, ယိခွါ,ကွ့ၭအၥၭ လၧအံၫစရ့လၭ အစဎွၩအလံၬကွ့ၭ",
			"12": "<sup>12</sup> နဲၪ့ဆၧအဖၧၩ့နီၪလီၫ.- အယီၩမွဲယဟိဝၩအလူလၧ အချဲၩ့ဆၧလၧစယံဟုၫတၭ, စံၭဝ့ၫဒၪ, နဖိၪခွၫမိဆၧၫ့ နၩ့လၧအံၫစရ့လၭ အလးဆီၩ့ဆီအဖၫ့ခိၪ ထီးအဎွ့ၩ ထၪ့လံဆိၩလဆိၩနီၪလီၫ. တၭဆၧမၩအၥၭဘဲၫနီၪ လီၫ.",
			"13": "<sup>13</sup> လၧယုဒၫအစဎွၩ အၧၭဇဲအၫ အနံၪ့ၥၧၫ့ဆံၫခွံၫနံၪ့ လနံၪ့အဖၧၩ့နီၪ, စယၫဘံၭအဖိၪခွၫစၡၫလၧၫ့ကဲၪထၪ့ ၥၫ့စဎွၩတၭ, ပၧၩ့ဆၧလၧစမ့ရအၫအဖၧၩ့ ဎွ့ၩထၪ့လၩ",
			"14": "<sup>14</sup> လဘံၪ့လီၫ.- တၭစဂၫဒံၫအဖိၪခွၫ စမံၫ့နဟံၫ့စဲၪ့ထၪ့ ခွံၬလၧတၧဇၫတၭ, ဂဲၫထီၩ့ဝ့ၫလၧစမ့ရအၫတၭ, ကျီၪ့ ခွံၬစယၫဘံၭအဖိၪခွၫစၡၫလၧၫ့ လၧစမ့ရအၫအဖၧၩ့ တၭ, မၩၥံၫဝ့ၫတၭ, ကဲၪထၪ့စဎွၩလၧအလးနီၪလီၫ.",
			"15": "<sup>15</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စၡၫလၧၫ့,ဒဲအဆၧ ကိၪ့အၧၩ့လၧအကိၪ့ဝ့ၫနီၪ, ယိခွါ,ကွ့ၭအၥၭလၧအံၫ စရ့လၭအစဎွၩအလံၬကွ့ၭနဲၪ့ဆၧ အဖၧၩ့နီၪလီၫ.",
			"16": "<sup>16</sup> ထီးနီၪလဖၧၫ့ စမံၫ့နဟံၫ့ကျီၪ့ခွံၬတံပစၫ, ဒဲကယဲ ၦလၧအအီၪဝ့ၫလၧအဖၧၩ့, ဒဲခးအီၪဝ့ၫလၧအနဲၩ့ထံၭ လၧတၧဇၫလီၫ. အဂဲးဘဲၫယီၩ ၦၡၩဝဲထၪ့ဆၧအ့ၬ. မၩအၥၭဘဲၫနီၪတၭ အဝ့ၫဒၪကျီၪ့ခွံၬဝ့ၫလီၫ. တၭၦမုၪ လၧအဒၧၩ့ထီးအလူၬနီၪ ဎွ့ၭဖၭဝ့ၫဒၪလီၫ.",
			"17": "<sup>17</sup> လၧယုဒၫအစဎွၩအၭဇရဲအၫ အနံၪ့ၥၧၫ့ဆံၫခွံၫနံၪ့ လနံၪ့အဖၧၩ့နီၪ, စဂၭဒံၫအဖိၪခွၫ စမံၫ့နဟံၫ့ ကဲၪထၪ့ ၥၫ့စဎွၩလၧအံၫစရ့လၭ အဖၫ့ခိၪတၭ,ပၧၩ့ဆၧဆံၫနံၪ့",
			"18": "<sup>18</sup> လၧစမ့ရအၫအဖၧၩ့လီၫ.- အဝ့ၫဒၪမၩဆၧအၧၩ့လၧ ယဟိဝၩအမ့ၬယၫလီၫ. လဆိၩဒၪအဝ့ၫနီၪစဲၪ့ဒၪစနံ ဘၭအဖိၪခွၫ စယ့ၫရဘိအၫ့ လၧအဒုၭမၩအံၫစရ့လၭ",
			"19": "<sup>19</sup> လၧဆၧဒဲၩဘၭလဂၩအဆၧဒဲၩဘၭအ့ၬ.- အစံရအၫ အစဎွၩပုလၭဂဲၫထၫ့ဒၩ ထံၫၥံၪခးၥံၪတၭ, စမံၫ့နဟံၫ့ ဖ့ၪလၫ့စပုလၭ လၧစ့ၩအကံကၫလထီၫ့, ဘဲၫၥိၭအဝ့ၫ ၥံၪအစူၪမိအီၪလၧအၥိၭ, ဘဲၫၥိၭအမိဒုၭအီၪဂုးအီၪ",
			"20": "<sup>20</sup> ခၧၫ့ဘၩ့မုးလၧအစူၪဖၧၩ့လီၫ.- တၭစမံၫ့နဟံၫ့မၩန့ ဆီၪ့စ့ၩလၧအံၫစရ့လၭ ဒဲလၧကယဲၦအထူၭအလၧၫ့ အၪ,လဂၩစ့ၩၡက့လၭယဲဆံၫ, လဂၩစ့ၩၡက့လၭယဲ ဆံၫ,ဘဲၫၥိၭအမိဖ့ၪလၫ့အစံရအၫအစဎွၩလီၫ. အစံ ရအၫအစဎွၩထဲၩ့ကဒၩထဲၩ့တၭ, အီၪဝ့ၫလၧခးဖၧၩ့နီၪ အ့ၬ.",
			"21": "<sup>21</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစမံၫ့နဟံၫ့ဒဲကယဲ ဆၧလၧအမၩဝ့ၫနီၪ ကွ့ၭအၥၭလၧအံၫစရ့လၭအစဎွၩ",
			"22": "<sup>22</sup> အလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ,မွဲအ့ၬဧၪ.- စမံၫ့နဟံၫ့မံၫ ဝ့ၫလၧအဖါၥံၪအၥိၭတၭ, အဖိၪခွၫစပ့ၭကဟဲအၫကဲၪ ထၪ့စဎွၩလၧအလးနီၪလီၫ.",
			"23": "<sup>23</sup> လၧယုဒၫအစဎွၩအၭဇရဲအၫအနံၪ့ယဲဆံၫနံၪ့လ နံၪ့အဖၧၩ့နီၪ, စမံၫ့နဟံၫ့အဖိၪခွၫ စပ့ၭကဟဲအၫကဲၪ ၥၫ့စဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪ လၧစမ့ရအၫအဖၧၩ့",
			"24": "<sup>24</sup> နံၫနံၪ့လီၫ.- အဝ့ၫမၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬယၫ တၭ,စဲၪ့ဒၪစနံဘၭအဖိၪခွၫ စယ့ၫရဘိအၫ့လၧအဒုၭ မၩအံၫစရ့လၭလၧဆၧဒဲၩဘၭ လဂၩ အဆၧဒဲၩဘၭ",
			"25": "<sup>25</sup> အ့ၬ.- အၡၩအခိၪလဂၩစရ့ၫမလဲအၫအဖိၪခွၫစပံကၫ ကိၪ့ဆၧအၧၩ့ထၫ့ဒၩအဝ့ၫတၭ, ကျီၪ့ခွံၬဝ့ၫလၧစမ့ရ အၫအဖၧၩ့ လၧစဎွၩအဂံၪ့အနီးဖၧၩ့, အီၪလၧစအၫ ဂီၭ,ဒဲစအၫရအံၭ, ဒဲၦဂံလအၭဖိၪယဲဆံၫအီၪလၧအၥိၭ တၭ,မၩၥံၫဝ့ၫတၭ, ကဲၪထၪ့စဎွၩလၧအလးနီၪလီၫ.",
			"26": "<sup>26</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစဎွၩပ့ၭကဟဲအၫ ဒဲကယဲဆၧလၧအမၩဝ့ၫထီးအလူၬနီၪ, ယိခွါ,ကွ့ၭအ ၥၭလၧအံၫစရ့လၭအစဎွၩ အလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့ လီၫ.",
			"27": "<sup>27</sup> လၧယုဒၫအစဎွၩ အၭဇရဲအၫအနံၪ့ယဲဆံၫနံၫနံၪ့ လနံၪ့အဖၧၩ့နီၪ, စရ့ၫမလဲအၫအဖိၪခွၫ စပံကၫကဲၪၥၫ့",
			"28": "<sup>28</sup> စဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪအနံၪ့နံၫဆံၫလီၫ.- အဝ့ၫ ဒၪမၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬယၫလီၫ. တၭစဲၪ့ ဒၪစနံဘၭအဖိၪခွၫစယ့ၫရဘိအၫ့ လၧအဒုၭမၩအံၫစရ့ လၭလၧဆၧဒဲၩဘၭလဂၩအဆၧဒဲၩဘၭအ့ၬ.",
			"29": "<sup>29</sup> လၧအံၫစရ့လၭ အစဎွၩပံကၫ အမုနံၩလဖၪနီၪအ စံရအၫအစဎွၩထံၭစလၭပလံစၫဂဲၫဝ့ၫ, မၩန့အဲယၧၫ့ ဒဲအၫဘလၭဘ့ၭၥမၫကၫ, ဒဲယနိအၫ, ဒဲကၫဒ့ၭ,ဒဲဟၫ ဇီၫ,ဒဲဂံလအၭ, ဒဲဂၫလလံၫ,ဒဲနၭၥလဲၫအၡၩခးဖိၪထီး အလူၬတၭ, ဆိၬထၪ့အၪ့မၧၫ့ဎီးဝ့ၫ လၧအစံရအၫအ ဖၧၩ့လီၫ.",
			"30": "<sup>30</sup> စအံလၫအဖိၪခွၫစဟိၫစံအၫကိၪ့ဆၧအၧၩ့ ထၫ့ဒၩ စရ့ၫမလဲအၫအဖိၪခွၫစပံကၫတၭ, ကျီၪ့ခွံၬဝ့ၫ,ဒဲမၩၥံၫ ဝ့ၫတၭ,ကဲၪထၪ့စဎွၩလၧအလး လၧစအၧၭဇဲအၫအ ဖိၪခွၫစယိၥၫ့အနံၪ့ဘၪ နံၫဆံၫနံၪ့လနံၪ့အဖၧၩ့နီၪလီၫ.",
			"31": "<sup>31</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစပံကၫ,ဒဲကယဲ ဆၧလၧအမၩဝ့ၫ ထီးအလူၬနီၪ, ယိခွါ, ကွ့ၭအၥၭလၧ အံၫစရ့လၭအစဎွၩအလံၬကွ့ၭနဲၪ့ဆၧ အဖၧၩ့နီၪလီၫ.",
			"32": "<sup>32</sup> လၧအံၫစရ့လၭအစဎွၩ ရ့ၫမလဲအၫအဖိၪခွၫစပံ ကၫအနံၪ့နံၫနံၪ့လနံၪ့နီၪ, ယုဒၫအစဎွၩ စအၧၭဇဲအၫ",
			"33": "<sup>33</sup> အဖိၪခွၫစယိၥၫ့ကဲၪၥၫ့စဎွၩလီၫ.- လၧအကဲၪစဎွၩနီၪ အၥၭၡါနံၫဆံၫယဲနံၪ့တၭ, ကဲၪထၪ့စဎွၩလၧယရုစလံၫ့ အဖၧၩ့လဆံၫဎူၫနံၪ့လီၫ. အမိအမံၩ့မွဲနးယရုၡၫ, စဇၫ",
			"34": "<sup>34</sup> ဒီၭအဖိၪမုၪလီၫ.- အဝ့ၫဒၪမၩဆၧဂ့ၩလၧယဟိဝၩအ မ့ၬယၫတၭ, မၩဝ့ၫဘဲၫကယဲဆၧလၧအဖါစအၧၭဇဲအၫ",
			"35": "<sup>35</sup> မၩယူၭဝ့ၫအၥိၭနီၪလီၫ.- မွဲလါနၫ့ဘိၩၥုၭခွံၬ ဆၧအ လးထၪ့ထီၫလဖၪအ့ၬ. ၦခမျၧးလုထၪ့ဒံၭဆၧ,ဒဲဆူၭ ခဲၩထၪ့ဒံၭဆၧနၧၫ့မၧၫ့ လၧဆၧအလးထၪ့ထီၫလဖၪအ ဖၫ့ခိၪလီၫ. အဝ့ၫဒၪနီၪမၩထၪ့ထဲၩ့ ယဟိဝၩအဂံၪ့အ တရၫ့လၧဆၧထၪ့ထီၫလစီၪ့နီၪလီၫ.",
			"36": "<sup>36</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧစယိၥၫ့, ဒဲကယဲ ဆၧလၧအမၩဝ့ၫထီးအလူၬနီၪ, ကွ့ၭအၥၭလၧယုဒၫ အစဎွၩ အလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.",
			"37": "<sup>37</sup> လၧမုနံၩလဖၪနီၪ ယဟိဝၩအၪ့မၧၫ့ၥၫ့စံရအၫအစ ဎွၩရံဇံၫ့, ဒဲစရ့ၫမလဲအၫအဖိၪခွၫ စပံကၫလဖၪနီၪထၫ့ဒၩ",
			"38": "<sup>38</sup> ယုဒၫလီၫ.- စယိၥၫ့မံၫဝ့ၫလၧအဖါၥံၪအၥိၭတၭ ၦခုၪ့ လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧ အဖါၥံၪအၥိၭလၧအဖါစဒၫဝံၭအ ဒိၩ့ဖၧၩ့တၭ, အဖိၪခွၫစအၫဟဇၭ ကဲၪထၪ့စဎွၩလၧ အလးနီၪလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> လၧစရ့ၫမလဲအၫအဖိၪခွၫ စပံကၫအနံၪ့လဆံၫနွ့ၫ နံၪ့လနံၪ့အဖၧၩ့နီၪ, ယုဒၫအစဎွၩယိၥၫ့အဖိၪခွၫစအၫ",
			"2": "<sup>2</sup> ဟဇၭကဲၪၥၫ့စဎွၩလီၫ.- လၧစအၫဟဇၭကဲၪၥၫ့စဎွၩ နီၪ,အၥၭအီၪအနံၪ့နံၫဆံၫတၭ, ကဲၪထၪ့စဎွၩလၧယရု စလံၫ့အဖၧၩ့လဆံၫဎူၫနံၪ့တၭ, မၩဆၧဂ့ၩလၧယဟိ",
			"3": "<sup>3</sup> ဝၩအမ့ၬယၫဘဲၫအဖါစဒၫဝံၭအၥိၭနီၪအ့ၬ.- အ့ၪမွဲဖိၬ အံၫစရ့လၭအစဎွၩလဖၪ အဖၧၩ့ၥၭတၭ,မွဲမၬ,အၪ့ မၧၫ့ဆ့အဖိၪခွၫလ့ၩခၫ့ဂၬမ့ၪ ဘဲၫၦဆၨၩဂူၫဂၩအဆၧ ဘၪၥၭလိၪအၥိၭလၧ ယဟိဝၩနၫ့ထၪ့ခွံၬဝ့ၫလၧၦအံၫ",
			"4": "<sup>4</sup> စရ့လၭဖိၪအမ့ၬယၫနီၪလီၫ.- တၭလုထၪ့ဆၧ, ဒဲဆူၭ ခဲၩဆၧနၧၫ့မၧၫ့လၧဆၧအလး ထၪ့ထီၫလဖၪအဖၫ့ခိၪ ဒဲလၧဆၧစီၩ့ခိၪ ဒဲလၧကယဲၥံၪ့ၥံၫ့ဆ့ၬ အဖၫ့လၬလီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့စံရအၫအစဎွၩရံဇံၫ့, ဒဲအံၫစရ့လၭ အစဎွၩရ့ၫမလဲအၫအဖိၪခွၫ စပံကၫဂဲၫဒုၭၥုၭလၧယရု စလံၫ့တၭ,ဝၩ့ထၬစအၫဟဇၭ, မွဲလါနၫ့,မၩနၧၩ့ဝ့ၫၥ့ၪ",
			"6": "<sup>6</sup> အ့ၬ.- အဆၧၫ့အထီထီးနီၪ, စံရအၫအစဎွၩရံဇံၫ့မၩန့ ထဲၩ့အံလၫလၧစံရအၫအဂးတၭ, နၫ့ထၪ့ခွံၬၦယုဒၫဖိၪ လၧအံလၫအဖၧၩ့တၭ, ၦစံရအၫဖိၪ ဂဲၫဝ့ၫလၧအံလၫ",
			"7": "<sup>7</sup> တၭ,အီၪဝ့ၫထီးနီၪ ထီးမုဆၫလနံၩယီၩလီၫ.- စအၫ ဟဇၭအၪ့မၧၫ့လၩ့အၥီၫ့လဖၪ လၧအစံရအၫအစဎွၩ တံၭဂလၭပလံစၫတၭ, စံၭဝ့ၫဒၪ, ယမွဲနခ့ၫနၡၩ,ဒဲနဖိၪ ခွၫလီၫ. ဂဲၫမၩဖီၩ့မၩဖျ့ၭယၧၩလၧ စံရအၫအစဎွၩအ စူၪဖၧၩ့,ဒဲလၧအံၫစရ့လၭအစူၪဖၧၩ့လၧ အဂဲထုၪ့ထၫ့",
			"8": "<sup>8</sup> ဒၩယၧၩဆံၭ.- စအၫဟဇၭမၩန့စ့ၩ, ဒဲထီၫ့လၧအဒၪန့ လၧယဟိဝၩအဂံၪ့ဖၧၩ့, ဒဲလၧစဎွၩအဂံၪ့အဆၧလူဒိၪ ဎွ့ၩဒိၪအကျၩတၭ, ဖ့ၪယုဝ့ၫလၧလၬဆီၪ့လၧအစံရအၫ",
			"9": "<sup>9</sup> အစဎွၩနီၪလီၫ.- အစံရအၫအစဎွၩ ခိၭနၪအလူလီၫ. အစံရအၫအစဎွၩ လ့ၩထၫ့ဒၩဒမၭစကၧၭတၭ,မၩန့ဝ့ၫ တၭ,ဆိၬအၪ့မၧၫ့ဎီးဝ့ၫလၧကၧၫ ဒဲမၩၥံၫစရံဇံၫ့လီၫ.",
			"10": "<sup>10</sup> စဎွၩအၫဟဇၭလ့ၩထၪ့ဒၪလိၬအၥၭ လၧအစံရအၫ အစဎွၩတံၭဂလၭပလံစၫ လၧဒမၭစကၧၭတၭ, ဒၪဘၪ ဆၧလုလးလဖျိၪ့လၧအအီၪဝ့ၫ လၧဒမၭစကၧၭအဖၧၩ့ တၭ,စဎွၩအၫဟဇၭဖ့ၪယု ၦလုဆၧစယုၫရဲယၫလၧ ဆၧလုလးအခံးအဂၩ့, ဒဲအဒီၩ့လဖျိၪ့ဘဲၫကယဲအဆၧ",
			"11": "<sup>11</sup> မၩအၥိၭနီၪလီၫ.- တၭၦလုဆၧစယုၫရဲယၫမၩထၪ့ဆၧ လုလးဘဲၫကယဲဆၧလၧ စဎွၩအၫဟဇၭဖ့ၪယုဝ့ၫလၧ ဒမၭစကၧၭအၥိၭနီၪလီၫ. ၦလုဆၧစယုၫရဲယၫမၩဝ့ၫ ဘဲၫနီၪၥိၭထီးအဂီၩ့လၧစဎွၩအၫဟဇၭ လချႃၭဂဲၫထဲၩ့",
			"12": "<sup>12</sup> လၧဒမၭစကၧၭနီၪလီၫ.- ထီးစဎွၩဂဲၫထဲၩ့လၧဒမၭစ ကၧၭတၭ, စဎွၩဒၪဘၪဆၧလုလးနီၪတၭ, စဎွၩၥုၭဘူၭ အၥၭလၧဆၧလုလးအအီၪ လုထၪ့ဆၧလၧအဖၫ့ခိၪ",
			"13": "<sup>13</sup> လီၫ.- ဆူၭခဲၩထၪ့အဆၧလုမ့ၪတၭ, မၩဘိၪ့အဆၧမၩ ဘိၪ့ကိၪမုၬ, ဒဲဂါလၩ့အဆၧမၩဘိၪ့အီၩဆၧ, ဒဲဎွံၪဆၧ ဘိၪ့ဘၪလိၬအိၭလိၬအၥွံၪ လၧဆၧလုလးအဖၫ့ခိၪနီၪ",
			"14": "<sup>14</sup> လီၫ.- ဆၧလုလးထီးဝီၩ လၧအအီၪဝ့ၫလၧယဟိဝၩ အမ့ၬယၫနီၪ ဆိၬဝ့ၫလၧဂံၪ့အမ့ၬယၫလၧဆၧလုလး ဒဲယဟိဝၩအဂံၪ့အဘိၩ့ဆၧၩ့တၭ, အီၪက့ၪဝ့ၫလၧဆၧ",
			"15": "<sup>15</sup> လုလးမုဖၩလခီၫနီၪလီၫ.- စဎွၩအၫဟဇၭမၪလူၬၦ လုဆၧစယုၫရဲယၫတၭ, စံၭဝ့ၫဒၪ,လၧဆၧလုလးဖၭဒိၪ အဖၫ့ခိၪနီၪ ဆူၭခဲၩထၪ့ဆၧလုမ့ၪလၧဂီၩလခီၫ, ဒဲမၩ ဘိၪ့ကိၪမုၬလၧဂၪလခီၫ, ဒဲစဎွၩအဆၧလုမ့ၪ,ဒဲအဆၧ မၩဘိၪ့ကိၪမုၬ, ဒဲခးအၡၩခမျၧးထီးအလူၬ အဆၧလု မ့ၪ,ဒဲအဝ့ၫၥံၪအဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲအဝ့ၫၥံၪအဆၧ မၩဘိၪ့အီၩဆၧတၭ, ဎွံၪဆၧလုမ့ၪအၥွံၪထီးအလူၬဒဲ ဆၧလုအၥွံၪထီးအလူၬလၧအဖၫ့ခိၪနီၪဆံၭ. တၭဆၧ လုအလးထီးဝီၩလဖျိၪ့နီၪ မိဘၪကဲၪထၪ့ဆၧလၧယမိ",
			"16": "<sup>16</sup> အၪ့စၪ့ဆၧလၧအဝ့ၫနီၪလီၫ.- ၦလုဆၧစယုၫရဲယၫနီၪ မၩဝ့ၫဘဲၫကယဲဆၧလၧစဎွၩအၫဟဇၭမၪလူၬဝ့ၫအ",
			"17": "<sup>17</sup> ၥိၭနီၪလီၫ.- စဎွၩအၫဟဇၭဒၪ့ထ့ၬခွံၬဆၧ အခၪ့အနဲၩ့ ထံၭတၭ, ဆိၬလၩ့ခွံၬအံၫ့ဒိၫ့လၧအဖၫ့ခိၪ,ဒဲကမၫလၧ ချီဖၫထီးဝီၩၥံၪ အီၪလၧအဖၫ့လၬနီၪ, ဆိၬလၩ့ခွံၬဝ့ၫ လၧချီခိၪတၭ, အီၪက့ၪလၩ့ဝ့ၫလၧဎၫ့လိးလဖၪအဖၫ့",
			"18": "<sup>18</sup> ခိၪလီၫ.- ဆၧခိၪၥိၭထၪ့အၥၭလၧမးၥံၫအနံၩအဂးလၧ ၦမၩဝ့ၫလၧဂံၪ့ဖၧၩ့, ဒဲစဎွၩဂဲၫနုၬအလး လၧခီၫ့နီၪ, ဆိၬခွံၬဝ့ၫလၧ ယဟိဝၩအဂံၪ့ဖၧၩ့ လၧအစံရအၫအ စဎွၩအဂးလီၫ.",
			"19": "<sup>19</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စဎွၩအၫဟဇၭလၧ အမၩဝ့ၫလဖၪနီၪ ကွ့ၭအၥၭလၧယုဒၫအစဎွၩအလံၬ",
			"20": "<sup>20</sup> ကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.- တၭစအၫဟဇၭမံၫ ဝ့ၫလၧအဖါၥံၪအၥိၭတၭ, ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧအ ဖါၥံၪအၥိၭလၧစဒၫဝံၭအဒိၩ့ဖၧၩ့တၭ, အဖိၪခွၫစဟ့ၭ ဇကဲအၫကဲၪထၪ့စဎွၩ လၧအလးနီၪလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> လၧယုဒၫအစဎွၩ အၫဟဇၭအနံၪ့လဆံၫနံၫနံၪ့လ နံၪ့အဖၧၩ့နီၪ စအံလၫအဖိၪခွၫ စဟိၫၡံအၫကဲၪထၪ့ၥၫ့ စဎွၩလၧစမ့ရအၫအဖၧၩ့ အီၪဝ့ၫလၧအံၫစရ့လၭအဖၫ့",
			"2": "<sup>2</sup> ခိၪခွံၫနံၪ့လီၫ.- အဝ့ၫဒၪမၩဆၧအၧၩ့လၧယဟိဝၩအ မ့ၬယၫလါနၫ့တၭ, မီၪ့ဎီၩ့လၧအံၫစရ့လၭအစဎွၩလ",
			"3": "<sup>3</sup> ဖၪလၧအအီၪဝ့ၫလၧ အမ့ၬယၫအၥိၭနီၪအ့ၬ.- အစံရ အၫအစဎွၩၡၫလမၫနံဇၧၫ လ့ၩထၫ့ဒၩဝ့ၫတၭ,စဟိၫ ၡံအၫကဲၪထၪ့အခ့ၫအၡၩတၭ, ဖ့ၪလၫ့ဝ့ၫအခီၫ့နီၪလီၫ.",
			"4": "<sup>4</sup> အစံရအၫအစဎွၩဒၪန့လၧ စဟိၫၡံအၫကိၪ့ဆၧအၧၩ့ လၧအမိပိၩ့ထၪ့ဆၧလီၫ. အဂဲးဘဲၫယီၩအၪ့မၧၫ့လၩ့ အၥီၫ့လဖၪ လၧအံဇံၭအစဎွၩစိၫတၭ, ဂဲၫဆိၬအခီၫ့ လၧအစံရအၫအစဎွၩအအီၪ ဘဲၫကိၭနံၪ့ဒ့ၭအၥိၭအ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, အစံရအၫအစဎွၩဒုၭထၬအဝ့ၫ, ဒဲစၧၩ့ထၬဝ့ၫလၧထီၫ့ဖၧၩ့လီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့အစံရအၫအစဎွၩ ဂဲၫထၪ့လၧခးဖၧၩ့ ထၧၫ့ဘံၪ့ယၫတၭ, လ့ၩထၪ့လၧစမ့ရအၫတၭ, ဝၩ့ထၬဝ့ၫ",
			"6": "<sup>6</sup> ၥၧၫ့နံၪ့လီၫ.- လၧစဟိၫၡံအၫ အနံၪ့ခွံၫနံၪ့လနံၪ့အဖၧၩ့နီၪ အစံရအၫ အစဎွၩမၩန့စမ့ရအၫတၭ, ဆိၬထၪ့ခွံၬ အံၫစရ့လၭ အၪ့မၧၫ့ဎီးဝ့ၫလၧအစံရအၫအဖၧၩ့တၭ, အီၪက့ၪလၩ့ဝ့ၫလၧဟၫလၫအဖၧၩ့, ဒဲလၧဟၫဘီၫအဖၧၩ့ လၧထံၫမိၡါကိဇၫ့အနဲၩ့, လၧၦမံဒၠၫ့ဖိၪအဒိၩ့လဖၪ အဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> တၭဆၧမၩအၥၭ လၧၦအံၫစရ့လၭဖိၪမၩမၪဘၪ ယဟိဝၩအဝ့ၫၥံၪအယွၩ လၧအဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫလၧ ခးအံဇံၭအဖၧၩ့, လၧအံဇံၭ စဎွၩဖၫရိၫအစူၪဖၧၩ့",
			"8": "<sup>8</sup> လဂၩနီၪ, ၥၭမဲၪယွၩအဂူၫဂၩလဖၪနီၪ,- လ့ၩဆၧလၧ ၦဆၨၩလဖၪ, လၧယဟိဝၩနၫ့ထၪ့ခွံၬ လၧၦအံၫစရ့လၭ ဖိၪအမ့ၬယၫ အထူၫအရူၫအဖၧၩ့, ဒဲလ့ၩဝ့ၫဘဲၫအံၫ စရ့လၭအစဎွၩၥံၪ ဒုၭအီၪထၪ့ဝ့ၫအၥိၭနီၪဆ့လီၫ.",
			"9": "<sup>9</sup> တၭၦအံၫစရ့လၭဖိၪ မၩၥူၪဝ့ၫဆၧလၧအလဂ့ၩဘၪနီၪ ထၫ့ဒၩယဟိဝၩအဝ့ၫၥံၪအယွၩတၭ, မၩဆၧအလး ထၪ့ထီၫလဖၪလၧအဒိၩ့ဖၧၩ့ ထီးအလူၬအဖၧၩ့လၧၦ ခိၭဆၧအတၨၭထၪ့ထီၫ, ဖိးလၧဒိၩ့အီၪလၧအခိၪဒၧၩ့",
			"10": "<sup>10</sup> နီၪလီၫ.- အဝ့ၫၥံၪအီၪက့ၪထၪ့ဝ့ၫလၧဆၧဂၩ့, ဒဲအၡ့ ရိၫလၧကယဲဆၧစီၩ့ခိၪအလီၩ့, ဒဲလၧကယဲၥံၪ့ၥံၫ့ဆ့ၬ",
			"11": "<sup>11</sup> အဖၫ့လၬနီၪလီၫ.- တၭအဝ့ၫၥံၪဆူၭခဲၩဆၧနၧၫ့မၧၫ့ ထီးနီၪလၧကယဲဆၧ အလးထၪ့ထီၫအဖၫ့ခိၪ,ဘဲၫၦ ဆၨၩလဖၪအၥိၭ လၧယဟိဝၩနၫ့ထၬခွံၬဝ့ၫလၧအဝ့ၫ ၥံၪအမ့ၬယၫတၭ, မၩဆၧအၧၩ့လဖၪ လၧအထိၪဂဲၩ",
			"12": "<sup>12</sup> ယဟိဝၩအၥၭထၪ့လီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမၩ ဆၧဂၩ့အဆၧလၧယဟိဝၩစံၭဝ့ၫ လၧအဂဲးအကၠီၪ့နီၪ, နၥံၪထီးမၩဆၧယီၩလမံၩ့လဂ့ၩ.",
			"13": "<sup>13</sup> ယဟိဝၩထိးအၥၭထၫ့ဒၩ အံၫစရ့လၭ,ဒဲထၫ့ဒၩယု ဒၫ,လၧမီၪထီးအလူၬ, လၧၦဒၪဆၧလၧယၫထီးအလူၬ တၭ,စံၭဝ့ၫဒၪ,ကၠၪခွံၬနၥံၪအၥၭ လၧနၥံၪအဖၧၩ့ၥၭ အၧၩ့တၭ,ထီးန့ယဆၧၥီၪ့ဆၧၥၫ့, ဒဲယဆၧမၪလူၬလ ဖၪ,ဘဲၫကယဲဆၧၥနိၫလဖၪ လၧယမၪလူၬနၥံၪအဖါ ၥံၪ,ဒဲဖ့ၪယုနၥံၪလၧယခ့ၫယၡၩ မီၪလဖၪအစူၪဖၧၩ့",
			"14": "<sup>14</sup> အၥိၭနီၪဆံၭ.- မွဲလါနၫ့ဘိၩ အဝ့ၫၥံၪခိၭနၪဆၧအ့ၬ. မၩဆီၪ့အခိၬ ဘဲၫအဖါလဖၪအခိၬ လၧအလနဲၩထဲၩ့",
			"15": "<sup>15</sup> ဘၪယဟိဝၩအဝ့ၫၥံၪအယွၩအၥိၭနီၪလီၫ.- အဝ့ၫၥံၪ ခွံၬၡိၭအဆၧမၪလူၬ, ဒဲအဆၧအုၩ့လၩ့ လၧအဝ့ၫၥံၪ အဖါလဖၪ, ဒဲအဆၧထိးအၥၭ ထၫ့ဒၩအဝ့ၫၥံၪတၭ, လ့ၩဖိၬထွ့ၫဆၧပျီၩပျီၩအခဲၫ့တၭ, ကဲၪထၪ့ၦဂၭဂီၩ့ဖိၪ, ဒဲဖိၬၦဆၨၩဂူၫဂၩလဖၪ လၧအအီၪဝၬဖီၩ့ဝ့ၫအခဲၫ့တၭ ယဟိဝၩမၪလူၬဝ့ၫလၧဆၧလဖၪနီၪ အဂဲးအကၠီၪ့လၧ",
			"16": "<sup>16</sup> အဝ့ၫၥံၪထီးမၩဝ့ၫဘဲၫအဝ့ၫၥံၪအၥိၭနီၪလဂ့ၩ.- အဝ့ၫ ၥံၪစဲၪ့ဒၪယဟိဝၩအဝ့ၫၥံၪအယွၩ အဆၧမၪလူၬလဖၪ တၭ,တဲၩ့ဆၧဂၩ့ၥိၫ့အၥၭလၧအဂး ဒဲချီဖိၪနံၫဒုၩတၭ, တဲၩ့အၡ့ရိၫ, ဒဲဘၩထၪ့မူၭခိၪအၥုၭမုထီးအလူၬတၭ,",
			"17": "<sup>17</sup> မၩဘၫအလၭအဆၧလီၫ.- အဝ့ၫၥံၪအၪ့မၧၫ့အဖိၪမုၪ ဒဲအဖိၪခွၫလဖၪလ့ၩခၫ့ဂၬမ့ၪ ဒဲအၪ့ဖၩ့ဆၧ ဒဲမၩဆၧ အူၪဆၧပီၩ,ဆၧလီးဆၧဘွဲတၭ, အၪ့ဆၫခွံၬအနၫ့ဆါ ဒၪဝ့ၫလဖၪ ဘဲၫၥိၭအမိမၩဆၧအၧၩ့ လၧယဟိဝၩအ",
			"18": "<sup>18</sup> မ့ၬယၫဒဲထိၪဂဲၩအၥၭထၪ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩၥၭထၪ့ဘၪအံၫစရ့လၭဒိၪမၬတၭ, ၥုၭခွံၬအ ဝ့ၫၥံၪလၧအမ့ၬယၫလီၫ. ဆၧအီၪလၩ့ထးဝ့ၫအ့ၬ. အီၪ",
			"19": "<sup>19</sup> န့ၫယုဒၫလဒီၪ့လီၫ.- ယုဒၫထီးန့ယဟိဝၩအဝ့ၫၥံၪအ ယွၩအဆၧမၪလူၬဆ့အ့ၬ. အ့ၪမွဲလ့ၩဝ့ၫလၧအံၫစရ့ လၭအဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့ လၧအဝ့ၫၥံၪမၩကဲၪထၪ့ ဝ့ၫလီၫ.",
			"20": "<sup>20</sup> ယဟိဝၩခွံၬၡိၭခွံၬ အံၫစရ့လၭအချံၫအၥၪထီးအ လူၬတၭ,မၩၡၪ့မၩနၭဝ့ၫတၭ, ဖ့ၪလၫ့ခွံၬဝ့ၫလၧၦအၪ့ ဂူၬန့ဆၧလဖၪအစူၪဖၧၩ့ ထီးအခွံၬၡိၭခွံၬအဝ့ၫၥံၪလၧ",
			"21": "<sup>21</sup> အမ့ၬယၫလီၫ.- အဂဲးဘဲၫယီၩ ၡၫ့ခွံၬအံၫစရ့လၭလၧ စဒၫဝံၭအဂံၪ့ဖိၪအစူၪဖၧၩ့တၭး အဝ့ၫၥံၪအီၪက့ၪစနံ ဘၭအဖိၪခွၫစယ့ၫရဘိအၫ့ လၧစဎွၩတၭ,စယ့ၫရဘိ အၫ့နီၪနၫ့ထၪ့ခွံၬအံၫစရ့လၭ လၧဆၧဖိၬယဟိဝၩအခဲၫ့",
			"22": "<sup>22</sup> တၭ,ဒုၭမၩဝ့ၫလၧဆၧဒဲၩဘၭဖၭဒိၪလီၫ.- တၭၦအံၫ စရ့လၭဖိၪလ့ၩလၧစယ့ၫရဘိအၫ့ အဆၧဒဲၩဘၭလၧ",
			"23": "<sup>23</sup> အမၩဝ့ၫထီးအလူၬအဖၧၩ့း လစဲၪ့ဒၪဘၪဝ့ၫ,- ထီး ယဟိဝၩၥုၭခွံၬအံၫစရ့လၭလၧအမ့ၬယၫ, ဘဲၫအစံၭ ဝ့ၫလၧအခ့ၫအၡၩ မီၪလဖၪထီးအလူၬအစူၪဖၧၩ့အၥိၭ နီၪလီၫ. ဆၧဆိၬထၪ့ခွံၬအံၫစရ့လၭ လၧအခးဖၧၩ့ဒၪ ဝ့ၫတၭ, အၪ့မၧၫ့ဎီးဝ့ၫလၧအစံရအၫအဖၧၩ့ ထီးမုဆၫ လနံၩယီၩလီၫ.",
			"24": "<sup>24</sup> အစံရအၫအစဎွၩ ဂဲၫဆိၬၦၡၩလၧဘၭဘလၧၫ့,ဒဲ လၧကူၥၭ, ဒဲလၧအၫဝၫ,လၧဟၫမၭ ဒဲလၧစ့ၭဖၫဝံၫ့ တၭအီၪက့ၪလၩ့ဝ့ၫလၧ စမ့ရအၫအဒိၩ့လဖၪအဖၧၩ့, လၧၦအံၫစရ့လၭဖိၪအလးတၭး အဝ့ၫၥံၪမၩန့စမ့ရ",
			"25": "<sup>25</sup> အၫတၭအီၪဝ့ၫလၧဒိၩ့လဖၪအဖၧၩ့နီၪလီၫ.- တၭလၧ အအီၪၥၫ့ထီးနီၪဆၧမၩအၥၭ လၧအဝ့ၫၥံၪၥၭမဲၪယ ဟိဝၩအ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩအၪ့မၧၫ့ ဆၬလၥၧၫ့လဖၪ လ့ၩထၪ့လၧအကျၩလၧအမၩၥံၫၦ",
			"26": "<sup>26</sup> လၧအကျၩနီၪလီၫ.- အခိးမွဲဘဲၫနီၪတၭ ၦၡၩချဲၩ့ဆၧ လၧအစံရအၫအစဎွၩတၭ, စံၭဝ့ၫဒၪ,ၦဆၨၩလဖၪလၧ နၥုၭအလးတၭ, အီၪက့ၪလၩ့လၧစမ့ရအၫအဒိၩ့လဖၪ အဖၧၩ့နီၪၥ့ၪယၫခးအယွၩနီၪ အထူၫအရူၫအ့ၬ. မၩ အၥၭဘဲၫနီၪတၭ အဆၧအၪ့မၧၫ့လၩ့ဆၬလၥၧၫ့လဖၪ လၧအကျၩ,ယိခွါ, မွဲအဝ့ၫၥံၪလၥ့ၪယၫဘၪခးအယွၩ",
			"27": "<sup>27</sup> အထူၫအရူၫတၭ,မၩၥံၫဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့အစံရ အၫအစဎွၩမၪလူၬဝ့ၫတၭ, စံၭဝ့ၫဒၪ,ထဲၩ့ဆိၬထဲၩ့ၦလု ဆၧနးဂၩလၧနၥံၪဂဲၫဆိၬခွံၬ ထီးနီၪတၭ,မွဲအဝ့ၫၥံၪ လ့ၩအီၪထီးနီၪ, ဒဲအဝ့ၫလဂၩၥီၪ့လိၪအဝ့ၫၥံၪ လၧခး",
			"28": "<sup>28</sup> အယွၩအထူၫအရူၫနီၪဆံၭ.- တၭၦလုဆၧလဂၩလၧ ၦဆိၬခွံၬဝ့ၫလၧစမ့ရအၫနီၪ, ဂဲၫဝ့ၫတၭအီၪဝ့ၫလၧဘ့ ၥလၭအဖၧၩ့တၭ, ၥီၪ့လိၪအဝ့ၫၥံၪလၧဆၧၥၭမဲၪယဟိ ဝၩလီၫ.",
			"29": "<sup>29</sup> ဆၧမၩအၥၭလၧၦကိၭဆၨၩဒ့ၭ မၩကဲၪထၪ့အယွၩ ဒၪဝ့ၫဆုၬဆုၬတၭ, အီၪက့ၪလၩ့ဝ့ၫလၧဆၧအလးထၪ့ ထီၫလဖၪအဂံၪ့ဖၧၩ့ လၧၦစမ့ရအၫဖိၪမၩဝ့ၫ, ၦကိၭ ဆၨၩဒ့ၭလၧအဒိၩ့လၧအအီၪဝ့ၫလၧ အဖၧၩ့ဆုၬဆုၬ",
			"30": "<sup>30</sup> လီၫ.- တၭဘၭဘလၧၫ့အၡၩမၩကဲၪထၪ့ စၧကီၭဘနီၭ တၭ,ကူၥၭအၡၩမၩကဲၪထၪ့န့ရဂၫလၭ, ဒဲဟၫမၭအ",
			"31": "<sup>31</sup> ၡၩမၩကဲၪထၪ့ၡံမၫတၭ,- ၦအၫဝၫဖိၪမၩကဲၪထၪ့နံဘ ဟၭ,ဒဲတၫတၭး ၦစ့ၭမၫဝံၫ့ဖိၪၥံၪ ဆူၭထၪ့ခွံၬအဖိၪလ ဖၪလၧမ့ၪဖၧၩ့,လၧအဒၫမ့လ့ၭ, ဒဲအၫနမ့လၭ. ၦစ့ၭဖၫ",
			"32": "<sup>32</sup> ဝံၫ့ဖိၪအယွၩလဖၪအမ့ၬယၫလီၫ.- ဆၧမၩအၥၭလၧ ၦလဖၪၥၭမဲၪယဟိဝၩတၭ, အီၪက့ၪၦအၡၪ့ထုၬလၧ ၦခမျၧးအကျၩ လၧဆၧအလးထၪ့ထီၫအၡၩလုဆၧ, လၧဆၧလုထၪ့ ဆၧလၧအဝ့ၫၥံၪအဂး လၧဆၧအလး",
			"33": "<sup>33</sup> ထၪ့ထီၫလဖၪအဂံၪ့ဖၧၩ့နီၪလီၫ.- အဝ့ၫၥံၪၥၭမဲၪယဟိ ဝၩတၭ,မၩအယွၩဒၪဝ့ၫ အဆၧဘဲၫၦဆၨၩဂူၫဂၩလ ဖၪအထူၫအရူၫလၧအဆိၬခွံၬဝ့ၫ ထီးနီၪအၥိၭလီၫ.",
			"34": "<sup>34</sup> ထီးမုဆၫလနံၩယီၩ အဝ့ၫၥံၪမၩဝ့ၫဘဲၫအထူၫအ ရူၫလၧအၥၫ့အၥိၭနီၪလီၫ. ဘဲၫအၥနိၫလဖၪမွဲဂ့ၩ, အ ဆၧစ့ၩရၫ့လဖၪမွဲဂ့ၩ, အဆၧၥီၪ့ဆၧၥၫ့ ဒဲဆၧမၪလူၬ လၧယဟိဝၩမၪလူၬ စယၫကူၭအဖိၪၥံၪ လၧအဖျိၬဝ့ၫ အမံၩ့အံၫစရ့လၭအၥိၭနီၪ, အဝ့ၫၥံၪလမၩဘၪတၭ,",
			"35": "<sup>35</sup> ၥၭမဲၪယဟိဝၩနီၪဆ့အ့ၬ.- ယဟိဝၩအုၩ့လၩ့ဆၧလၧ အဝ့ၫၥံၪတၭ, မၪလူၬဆၧစံၭဝ့ၫဒၪ, နၥံၪထီးၥၭမဲၪယွၩ အဂူၫဂၩလဖၪလဂ့ၩတၭ, ဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫလဂ့ၩ, မၩအဆၧလဂ့ၩ, တၭလုထၪ့ဝ့ၫလၧဆၧနးမံၩ့လဂ့ၩ,",
			"36": "<sup>36</sup> အ့ၪမွဲယဟိဝၩလၧအဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪလၧအံဇံၭ အဖၧၩ့လၧအစီၩ့ဒိၪအမၩ့ဒိၪ, ဒဲအစူၪယူၬထၪ့အၥၭ လဂၩနီၪ, နၥံၪဘၪၥၭမဲၪအဝ့ၫ, ဒဲနၥံၪဘၪဘၩထၪ့ဝ့ၫ",
			"37": "<sup>37</sup> တၭ,နၥံၪမိဘၪလုထၪ့ဆၧလၧအဝ့ၫလီၫ.- တၭၥနိၫလ ဖၪဒဲဆၧစ့ၩရၫ့, ဒဲဆၧၥီၪ့ဆၧၥၫ့, ဒဲဆၧမၪလူၬလၧအ ကွ့ၭန့နၥံၪအဂးနီၪ, နၥံၪဘၪထီးန့ အဆိၩဆိၩအကၠၪ ကၠၪတၭ,နၥံၪထီးၥၭမဲၪ ယွၩအဂူၫဂၩလဖၪလဂ့ၩ.",
			"38": "<sup>38</sup> တၭဆၧအုၩ့လၩ့လၧယအုၩ့လၩ့နၥံၪနီၪ နၥံၪထီးၥၭနၪ့",
			"39": "<sup>39</sup> လဂ့ၩ,နၥံၪထီးၥၭမဲၪယွၩအဂူၫဂၩလဖၪလဂ့ၩ.- အ့ၪ မွဲနၥံၪဘၪၥၭမဲၪယဟိဝၩ နၥံၪအယွၩတၭ,အဝ့ၫဒၪ မိမၩဖီၩ့မၩဖျ့ၭနၥံၪလၧ နၥံၪအဒုၪအဒၩထီးအလူၬအ စူၪဖၧၩ့လီၫ.",
			"40": "<sup>40</sup> မွဲလါနၫ့အဝ့ၫၥံၪလခိၭနၪဘၪဆၧတၭ, မၩဝ့ၫဘဲၫအ",
			"41": "<sup>41</sup> ထူၫအရူၫလၧအၥၫ့အၥိၭနီၪလီၫ.- ဆၧမၩအၥၭလၧၦ ဆၨၩလဖၪနီၪၥၭမဲၪယဟိဝၩ, ဒဲမၩအဆၧဂၩ့အဆၧ, အဝ့ၫၥံၪဒဲအဖိၪလဖၪ, ဒဲအဖိၪလဖၪအဖိၪၥံၪလီၫ. ဘဲၫ အဖါၥံၪမၩဝ့ၫအၥိၭနီၪ, အဝ့ၫၥံၪမၩဝ့ၫ ဘဲၫနီၪအၥိၭ ထီးမုဆၫလနံၩယီၩလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> လၧအံၫစရ့လၭအစဎွၩ အံလၫအဖိၪခွၫစဟိၫၡံအၫ အနံၪ့ၥၧၫ့ဆံၫလနံၪ့အဖၧၩ့နီၪ, ဆၧမၩအၥၭလၧယုဒၫ အစဎွၩအၫဟဇၭအဖိၪခွၫ စဟ့ၭဇကဲအၫ ကဲၪၥၫ့",
			"2": "<sup>2</sup> စဎွၩလီၫ.- လၧအကဲၪၥၫ့စဎွၩနီၪ အၥၭၡါနံၫဆံၫယဲနံၪ့ ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့ နံၫဆံၫခွံၫနံၪ့လီၫ. တၭ အမိအမံၩ့မွဲနးအၫဘံၫ, စဇ့ၭခရဲအၫ အဖိၪမုၪလီၫ.",
			"3": "<sup>3</sup> တၭအဝ့ၫဒၪမၩဆၧဂ့ၩ လၧယဟိဝၩအမ့ၬယၫ, ဘဲၫ",
			"4": "<sup>4</sup> ကယဲဆၧလၧအဖါစဒၫဝံၭမၩဝ့ၫအၥိၭနီၪလီၫ.- ၥုၭခွံၬ ဆၧအလးထၪ့ထီၫလဖၪတၭ, မၩခါလၩ့ဘျ့ၭဆၧဂၩ့ လဖၪတၭ, ခူၬလၩ့ခွံၬအၡ့ရိၫတၭ, မၩခါလၩ့ဘျ့ၭဂူ ထီးဝီၩလၧစမိစ့ၭတဲၩ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩၦအံၫစရ့ လၭဖိၪဆူၭခဲၩဆၧနၧၫ့မၧၫ့ လၧအမ့ၬယၫထီၩ့လၩ့လၧ",
			"5": "<sup>5</sup> မုနံၩနီၪလီၫ. တၭကိၭဝ့ၫလၧနဟုၡတၫ့လီၫ.- အဝ့ၫ ဒိၭနဲၩ့အၥၭလၧယဟိဝၩ အံၫစရ့လၭအယွၩတၭ,ၦ လၧအလးခဲၫ့, ဒဲၦလၧအမ့ၬယၫမီၪ့ဎီၩ့လၧအဝ့ၫဒၪလၧ ယုဒၫအစဎွၩထီးအလူၬ အကျၩနီၪအီၪနးဂၩအ့ၬ.",
			"6": "<sup>6</sup> အဝ့ၫဒၪအၥၭအီၪဂုးခၧၫ့ လၧယဟိဝၩအဖၧၩ့တၭ, လီၩ့ဖိၬအခဲၫ့, ဒဲထီးန့အဆၧၥီၪ့ဆၧၥၫ့ လၧယဟိဝၩမၪ",
			"7": "<sup>7</sup> လူၬစမိစ့ၭနီၪလီၫ.- တၭယဟိဝၩအီၪလၧအၥိၭလီၫ. ဒဲထီးဒၪအလ့ၩထၪ့လစီၪ့လါလါနီၪ ဘီၪထၪ့ယီၫထၪ့ ဝ့ၫလီၫ. ပိၩ့ထၪ့အစံရအၫ အစဎွၩတၭ, မၩအဆၧ",
			"8": "<sup>8</sup> အ့ၬ.- ကျီၪ့ခွံၬၦဖလံၡၫဖိၪ ထီၩ့လၧဂၫဇၫဒဲခးအနဲၩ့ ထံၭ,လၧခိၭဆၧအတၨၭထၪ့ထီၫ ထီၩ့လၧဒိၩ့အီၪလၧ အခိၪဒၧၩ့လီၫ.",
			"9": "<sup>9</sup> တၭဆၧမၩအၥၭလၧစဎွၩ ဟ့ၭဇကဲအၫအနံၪ့လံ နံၪ့လနံၪ့အဖၧၩ့, လၧအမွဲအံၫစရ့လၭအစဎွၩအံလၫ အဖိၪခွၫစဟိၫၡံအၫအနံၪ့နွ့ၫနံၪ့လနံၪ့နီၪ အစံရအၫအ စဎွၩၡၫလမနံဇၧၫ ဂဲၫထၫ့ဒၩစမ့ရအၫတၭ, ဝၩ့ထၬ",
			"10": "<sup>10</sup> ဝ့ၫလီၫ.- ၥၧၫ့နံၪ့ဖီၩ့ခွံၬတၭ, မၩဝ့ၫလီၫ. လၧစဟ့ၭဇ ကဲအၫအနံၪ့ဎူၫနံၪ့လနံၪ့အဖၧၩ့, ဘဲၫၦစံၭဆၧအၥိၭ အံၫစရ့လၭအစဎွၩ ဟိၫၡံအၫအနံၪ့ခွံၫနံၪ့လနံၪ့အဖၧၩ့",
			"11": "<sup>11</sup> နီၪစမ့ရအၫဘၪဆၧမၩန့ဝ့ၫလီၫ.- တၭအစံရအၫအ စဎွၩဆိၬထၪ့ခွံၬအံၫစရ့လၭ ထီၩ့လၧခးအစံရအၫတၭ, အီၪက့ၪလၩ့ဝ့ၫလၧဟၫလၫအဖၧၩ့, ဒဲလၧဟၫဘိၫအ ဖၧၩ့လၧထံၫမိၡါဂိဇၫ့အနဲၩ့, လၧၦမံဒအၫ့ဖိၪ အဒိၩ့",
			"12": "<sup>12</sup> ၥံၪအဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪခိၭနၪယဟိဝၩ အဝ့ၫၥံၪအယွၩအလူအ့ၬ, အ့ၪမွဲလုခၫ့ဖၬ အဆၧအုၩ့ လၩ့,ကယဲဆၧလၧယဟိဝၩအခ့ၫအၡၩ စမိစ့ၭမၪလူၬ ဝ့ၫထီးအလူၬနီၪ, လခိၭနၪဘၪဝ့ၫ ဒဲလမၩဘၪဝ့ၫဆ့ လီၫ.",
			"13": "<sup>13</sup> လၧစဎွၩဟ့ၭဇကဲအၫ အနံၪ့လဆံၫလံနံၪ့အဖၧၩ့ နီၪ,အစံရအၫအစဎွၩ စနၭခရံၭဂဲၫထၫ့ဒၩယုဒၫအဒိၩ့",
			"14": "<sup>14</sup> အီၪလၧအခိၪဒၧၩ့ထီးအလူၬ, ဒဲမၩန့ဝ့ၫလီၫ.- တၭယု ဒၫအစဎွၩဟ့ၭဇကဲအၫ အၪ့မၧၫ့လၩ့ဆၧလၧအစံရ အၫအစဎွၩလၧအအီၪလၧ လၫခံၭအဖၧၩ့တၭ, စံၭဝ့ၫ ဒၪ,ယမၩမၪဘၪယူၭ, ထဲၩ့ကဒၩထဲၩ့လါလၧယအီၪ ဆံၭ.ဆၧလၧနအီၪက့ၪ လၧယလီၩ့နီၪ ယမိဆိၬလီၫ. တၭအစံရအၫအစဎွၩ အီၪက့ၪလၩ့ယုဒၫအစဎွၩဟ့ၭ ဇကဲအၫလၧစ့ၩအကံကၫၥၧၫ့ယၩ, ဒဲထီၫ့အကံကၫၥၧၫ့",
			"15": "<sup>15</sup> ဆံၫလီၫ.- တၭဟ့ၭဇကဲအၫဖ့ၪလၫ့ကယဲစ့ၩလၧအဒၪ န့ဝ့ၫလၧယဟိဝၩအဂံၪ့ဖၧၩ့, ဒဲလၧဆၧအီၪက့ၪကီၪ့အ",
			"16": "<sup>16</sup> လးလၧစဎွၩအဂံၪ့ဖၧၩ့လီၫ.- အဆၧၫ့အထီနီၪစဟ့ၭ ဇကဲအၫကျိၬလၩ့ခွံၬဆၧလၧ ယဟိဝၩအနီးအတရၫ့, ဒဲလၧထုၪ့ဖၭဒိၪလဖၪ လၧယုဒၫအစဎွၩ ဟ့ၭဇကဲအၫ ဖီၪ့ထၬဝ့ၫတၭ, ဖ့ၪလၫ့ဝ့ၫလၧအစံရအၫအစဎွၩနီၪလီၫ.",
			"17": "<sup>17</sup> အစံရအၫအစဎွၩ အၪ့မၧၫ့လၩ့စတၫတၫ့,ဒဲစရၭ ဘစၫရံၭ,ဒဲစရၭဘၡၫက့ၫလဖၪ လၧလၫခံၭနီၪ, လၧအ ဘၪလ့ၩလၧစဎွၩဟ့ၭဇကဲအၫအအီၪ, ဒဲအၡၩၥုၭမုခ မျၧးထၫ့ဒၩယရုစလံၫ့တၭ, အဝ့ၫၥံၪလ့ၩဝ့ၫတၭ, ထီၩ့ လၧယရုစလံၫ့လီၫ. ထီးအဝ့ၫၥံၪဂဲၫထီၩ့ဝ့ၫတၭ, ဂဲၫ ဆၧၫ့ထုၪ့ဝ့ၫလၧကမၫ လၧထၭလခီၫလစီၪ့အထံၫချိၬ အနဲၩ့ထံၭလၧၦစုၪဆၧကဲၩ့ယၬ အဂၪ့ခိၪအဝၩ့အဖၧၩ့",
			"18": "<sup>18</sup> ၥၭမုနီၪလီၫ.- ထီးအဝ့ၫၥံၪကိၭထၪ့လၧစဎွၩတၭ,ၦဂဲၫ ထၪ့လၧအအီၪ, စဟံၫလကဲအၫအဖိၪခွၫ စအံၫလဲအ ကံၫ့လၧအအီၪလၧဂံၪ့အဖၫ့ခိၪ, ဒဲၦကွ့ၭလံၬစၡံဘနၫ, ဒဲၦကွ့ၭနဲၪ့ဆၧစအၫစၭအဖိၪခွၫ စယိအၭနီၪလီၫ.",
			"19": "<sup>19</sup> တၭစရၭဘၡၫက့ၫစံၭအဝ့ၫၥံၪ, လီၩဘၪစဟ့ၭဇကဲ အၫ,စဎွၩဖၭဒိၪအစံရအၫ အစဎွၩစံၭဘဲၫယီၩ, ဆၧ ဒိၭနဲၩ့အၥၭအီၪလၧနၧၩ လၧနဒိၭနဲၩ့နၥၭလၧအဝ့ၫမွဲ",
			"20": "<sup>20</sup> ဆၧနီၪလမံၩ့လဲၪ.- နစံၭ, (မွဲန့ၫဆၧချဲၩ့) ယအီၪလၧ ဆၧကိၪ့ဆၧဖၭ, ဒဲဆၧအဂဲးအဘၭ လၧဒုၭဆၧအဂး ဘိၩ့နဲၪ့ယီၩလၧနပိၩ့ထၪ့ယၧၩနီၪ မွဲနဒိၭနဲၩ့နၥၭလၧ",
			"21": "<sup>21</sup> ပလၫလဂၩလဲၪ.- ယိခွါ, နဒိၭနဲၩ့နၥၭလၧနိၪထိၭဖီး ဘီၩ့လၧအဆ့ၫဖိလဘီၩ့ယီၩ လၧအံဇံၭ,လၧၦအ့ၪဒိၭ နဲၩ့အၥၭလၧအဝ့ၫတၭ, မိနုၬဝ့ၫလၧအစူၪဖၧၩ့တၭ, မိ ဆ့ၭဖျီၫ့ဝ့ၫလီၫ. အံဇံၭအစဎွၩဖၫရိၫမၩအၥၭဘဲၫနီၪ, လၧကယဲၦလၧအဒိၭနဲၩ့အၥၭလၧအဝ့ၫလီၫ.",
			"22": "<sup>22</sup> အ့ၪမွဲနၥံၪအ့ၪစံၭယၧၩ, ပဒိၭနဲၩ့ပၥၭလၧယဟိဝၩ ပယွၩနီၪတၭ, အဝ့ၫဒၪမွဲၦလၧစဟ့ၭဇကဲအၫမၩန့ခွံၬ ယူၭအလးထၪ့ထီၫလဖၪ, ဒဲအဆၧလုလးလဖၪတၭ, စံၭယုဒၫဒဲယရုစလံၫ့, နၥံၪမိဘၪဘိၪ့ဆၧဘၩဆၧလၧ ဆၧလုအလးယီၩ, အမ့ၬယၫ လၧယရုစလံၫ့အဖၧၩ့",
			"23": "<sup>23</sup> ဧၪ.- ဘိၩ့နဲၪ့ယီၩ ဖ့ၪလၫ့ၦထိးအၥၭလဖၪလၧယက ဆါအစံရအၫအစဎွၩနီၪဆံၭ. တၭနဝ့ၫဒၪလခီၫနအီၪ က့ၪၦထူၬကၥ့ၪ လၧအလီၩ့အ့ၪၥ့ၪတၭ, ယမိဖ့ၪလၫ့",
			"24": "<sup>24</sup> နၧၩလၧကၥ့ၪနံၫထီၫ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, လၧ ယကဆါအခ့ၫအၡၩအကျၩၥုၭခိၪ လၧအဆံၭထုၬ လဂၩနမိဘိၭကၠၪကဒၩခွံၬအမ့ၬတၭ, ဒိၭနဲၩ့နၥၭလၧ အံဇံၭလၧအလဲၪ့ၥုၭအဂး, ဒဲလၧအကၥ့ၪၥုၭအဂးဘဲၫ",
			"25": "<sup>25</sup> ၥ့ၪလဲၪ.- တၭဘိၩ့နဲၪ့ယီၩယဟိဝၩ လအီၪဘၪလၧယ ၥိၭတၭ, ယဂဲၫထၫ့ဒၩဆၧအလးယီၩ ဘဲၫၥိၭယမိမၩ ဂၭဂီၩ့ဆ့ဧၪ. ယဟိဝၩစံၭယၧၩ, လ့ၩထၪ့ထၫ့ဒၩခး လဘံၪ့ယီၩဒဲမၩဂၭဂီၩ့ဝ့ၫဆံၭ.",
			"26": "<sup>26</sup> တၭစဟံၫလကဲအၫ အဖိၪခွၫစအံၫလဲအကံၫ့,ဒဲစ ၡ့ဘနၫ,ဒဲစယိအၭလဖၪ, စံၭစရၭဘၡၫက့ၫနီၪ, ချဲၩ့လါ ဆၧလၧၦစံရအၫဖိၪအလၨလၧနခ့ၫနၡၩဆံၭ. အဂဲး ဘဲၫယီၩပနၪၥ့ၪလီၫ. ချဲၩ့ဆၧလၧၦယုဒၫအလၨလၧ ၦခမျၧးလၧအအီၪလၧခိၪဒၧၩ့ အဖၫ့ခိၪနီၪအနါဖၧၩ့လ",
			"27": "<sup>27</sup> ဂ့ၩ.- တၭစရၭဘၡၫက့ၫစံၭအဝ့ၫၥံၪ, ယကဆါအၪ့ မၧၫ့လၩ့ယချဲၩ့ဆၧချဲၩ့လဖၪယီၩ လၧနကဆါဒဲနၧၩ ဆ့ဧၪ. မွဲလၧၦဆၧၫ့နၩ့လၧခိၪဒၧၩ့ အဖၫ့ခိၪ ဘဲၫအဝ့ၫ ၥံၪမိအၪ့အအ့ၪဒၪဝ့ၫ, ဒဲအီၩအဆံၪထံၫဒၪဝ့ၫလဖၪနီၪ လၧနၥံၪအၥိၭ, မွဲအ့ၬဧၪ.",
			"28": "<sup>28</sup> ထီးနီၪလဖၧၫ့စရၭဘၡၫက့ၫဆၧၫ့ထုၪ့တၭ, ကိၭထၪ့ လၧအလူဖၭဒိၪလၧယုဒၫအလၨနီၪ, ခိၭနၪစဎွၩဖၭဒိၪ",
			"29": "<sup>29</sup> အစံရအၫအစဎွၩအလူနီၪဆံၭ.- စဎွၩစံၭဘဲၫယီၩ,မွဲ စဟ့ၭဇကဲအၫ ထီးအၪ့လီၫန့ နၥံၪလဂ့ၩး အဂဲးဘဲၫ ယီၩအဝ့ၫဒၪမၩဖီၩ့မၩဖျ့ၭ နၥံၪလၧစဎွၩနီၪအစူၪဖၧၩ့",
			"30": "<sup>30</sup> ၥ့ၪအ့ၬ.- တၭစဟ့ၭဇကဲအၫ မိစံၭနၥံၪ, ယဟိဝၩမိမၩ ဖီၩ့မၩဖျ့ၭတၡါပၧၩ, ဒဲအဒိၩ့လဖျိၪ့ယီၩ ဆၧလဖ့ၪ လၫ့ခွံၬဘၪလၧအစံရအၫအစဎွၩ အစူၪဖၧၩ့တၭ,မွဲအ ထီးဒုၭဒိၭနဲၩ့နၥံၪအၥၭ လၧယဟိဝၩအစူၪဖၧၩ့နီၪလ",
			"31": "<sup>31</sup> ဂ့ၩ.- ခိၭနၪစဟ့ၭဇကဲအၫအလူလဂ့ၩ, အဂဲးဘဲၫယီၩ အစံရအၫအစဎွၩစံၭဘဲၫယီၩ, မၩဆၧလၧယၧၩလၧ ဆၧဆိၪဂ့ၩတၭ, ဂဲၫထၪ့လၧယအီၪတၭ, အၪ့လဂၩလၧ အစဘံၭမုဒၪဝ့ၫ, လဂၩလၧအချိၪ့ဒိၩ့ဒၪဝ့ၫတၭ, အီၩ လဂၩလၧအထံၫဖၧၩ့ဒၪဝ့ၫ, လဂၩလၧအထံၫဖၧၩ့ဒၪ",
			"32": "<sup>32</sup> ဝ့ၫနီၪ,- ထီးယဂဲၫဆိၬထၪ့ခွံၬ နၥံၪထီၩ့လၧခးလဘံၪ့ မၩအၥၭဘဲၫနၥံၪအခးဒၪနၥံၪဝ့ၫအၥိၭ, ခးလဘံၪ့အီၪ လၧဘုၪကၠိၩ့ဒဲစဘံၭထံၫ, ခးလဘံၪ့အီၪလၧကိၪ,ဒဲစ ဘံၭမုအလးလဖၪ, ခးလဘံၪ့အီၪလၧၥံၪ့အလဲအိၫ့အ ၥိၪ,ဒဲန့ၫစၩ့နီၪ, ဘဲၫၥိၭနၥံၪမိမၧၫ့ဒံၭတၭ, ၥံၫလဂ့ၩ. ထီးစဟ့ၭဇကဲအၫစံၭ, ယဟိဝၩမိမၩဖီၩ့ဖျ့ၭပၧၩတၭ,",
			"33": "<sup>33</sup> အၪ့ယၫနၥံၪတၭ, မွဲနၥံၪထီးခိၭနၪလဂ့ၩ.- ၦဆၨၩၥံၪ အယွၩလဖၪ မၩဖီၩ့ဖျ့ၭတၡါအထံၫအခး လၧအစံရ",
			"34": "<sup>34</sup> အၫအစဎွၩအစူၪဖၧၩ့ဆ့ဧၪ.- ဟၫမၭဒဲအၫပၭအယွၩ လဖၪနီၪ, မွဲအအီၪခီၫခီၫလဲၪ, စ့ၭဖၫဝံၫ့,ဟံနၫ, ဒဲအံဝၫ အယွၩလဖၪနီၪ, မွဲအအီၪခီၫခီၫလဲၪ. မွဲအမၩဖီၩ့မၩ",
			"35": "<sup>35</sup> ဖျ့ၭစမ့ရအၫလၧယစူၪဖၧၩ့ဆ့ဧၪ.- ဘဲၫၥိၭယဟိဝၩ မိမၩဖီၩ့မၩဖျ့ၭယရုစလံၫ့လၧယစူၪဖၧၩ့နီၪတၭ, လၧ ခးလဖၪအယွၩ ထီးအလူၬအကျၩနီၪ, မွဲပလၫမၩဖီၩ့ မၩဖျ့ၭအထံၫအခးလၧယစူၪဖၧၩ့လဂၩလဲၪ.",
			"36": "<sup>36</sup> ၦခမျၧးအီၪလၩ့မါပံၭတၭ, ချဲၩ့ဆၧၫ့အဝ့ၫနးထံၪ အ့ၬ. အဂဲးဘဲၫယီၩ စဎွၩမၪလူၬဆၧတၭစံၭဝ့ၫဒၪ,စံၭ ဆၧၫ့အဝ့ၫနးထံၪလဂ့ၩ.",
			"37": "<sup>37</sup> ထီးနီၪလဖၧၫ့စဟ့ၭဇကဲအၫအဖိၪခွၫ စအံၫလဲအ ကံၫ့လၧအအီၪလၧဂံၪ့အဖၫ့ခိၪ, ဒဲၦကွ့ၭလံၬစၡ့ၭဘနၫ, ဒဲၦကွ့ၭနဲၪ့ဆၧစအၫစၭအဖိၪခွၫ စယိအၭလဖၪနီၪ,ထဲၩ့ ထဲၩ့လၧစဟ့ၭဇကဲအၫအအီၪလၧ အကီၩ့အၥိၭအယၬ တၭ,လီၩဘၪဝ့ၫလၧစရၭဘၡၫက့ၫ အဆၧချဲၩ့လဖၪ နီၪလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ထီးစဎွၩဟ့ၭဇကဲအၫ နါဂၧၫ့ဆၧနီၪတၭ, ဆၧမၩ အၥၭလၧအၡၫ့အဆဲၫ့တၭ, ၥိၭဝ့ၫလၧရၧၬအဆၧယၬ",
			"2": "<sup>2</sup> တၭလ့ၩနုၬလၧယဟိဝၩအဂံၪ့ဖၧၩ့နီၪလီၫ.- အၪ့မၧၫ့ လၩ့စအံၫလဲအကံၫ့လၧ အအီၪလၧအဂံၪ့အဖၫ့ခိၪ,ဒဲၦ ကွ့ၭလံၬစၡ့ၭဘနၫ ဒဲၦလုဆၧအၡၩၥုၪ့က့ၭၥၭၡါၥိၭ ဝ့ၫလၧရၧၬအဆၧယၬ လၧစအၫမူၭအဖိၪခွၫမီၪစအဲၫ",
			"3": "<sup>3</sup> စ့ယၫအအီၪလီၫ.- တၭအဝ့ၫၥံၪနီၪစံၭအဝ့ၫ, စဟ့ၭဇ ကဲအၫစံၭဘဲၫယီၩ, ဆၧလၧမုဆၫလနံၩယီၩမွဲဆၧခိ ဆၧဝီၩ,ဒဲဆၧအၪ့ၥီၪ့, ဒဲဆၧဒုၪဒွ့ၪအနံၩလီၫ. အဂဲး ဘဲၫယီၩဖိၪၥၪၥံၪဘၪလၧ အအီၪဖျဲၪအခၫတၭ, ဆၧဂဲး",
			"4": "<sup>4</sup> ဆၧဘၭလၧအမိအီၪဖျဲၪန့ဝ့ၫနီၪအီၪအ့ၬ.- ဘၪလဘၪ ယဟိဝၩနယွၩမိနါဂၧၫ့ စရၭဘၡၫက့ၫအဆၧချဲၩ့လၧ အကဆါအစံရအၫအစဎွၩ အၪ့မၧၫ့လၩ့ဘဲၫၥိၭအမိဒုၪ ဒွ့ၪယွၩလၧအမၧၫ့ဝ့ၫနီၪ, ဒဲမိအၪ့ၥီၪ့ဆၧချဲၩ့လၧယဟိ ဝၩနယွၩနါဂၧၫ့ယူၭနီၪတၭး မၩအၥၭဘဲၫနီၪတၭ, ဆိၬ ထၪ့ဆၧဘၩဆိၪဖၪ လၧၦအီၪလၩ့ထးဒံၭလဖၪအဂး ဆံၭ.",
			"5": "<sup>5</sup> တၭစဎွၩဟ့ၭဇကဲအၫအခ့ၫအၡၩနီၪ လ့ၩလၧစ အဲၫစ့ယၫအအီၪလီၫ.",
			"6": "<sup>6</sup> တၭစအဲၫစ့ယၫစံၭအဝ့ၫၥံၪ, နၥံၪမိဘၪစံၭနၥံၪအက ဆါဘဲၫယီၩ, ယဟိဝၩစံၭဘဲၫယီၩ, ၥၭမဲၪဆၧချဲၩ့လၧ နနါဂၧၫ့လၧအစံရအၫအစဎွၩ အခ့ၫအၡၩဒုၪဒွ့ၪဆၧ",
			"7": "<sup>7</sup> နီၪလဂ့ၩ.- ယိခွါ,ယအီၪက့ၪၥၭလမံၩ့လၧ အဖၧၩ့တၭ, မိနါဂၧၫ့ဆၧအပရၧၫ့တၭ, မိထဲၩ့ကဒၩထဲၩ့ လၧအခး ဒၪဝ့ၫတၭ, ယမိဒုၭလၩ့ထံၩဖါဝ့ၫ လၧနၭလၧအခးဒၪ ဝ့ၫအဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> စရၭဘၡၫက့ၫနီၪထဲၩ့ကဒၩထဲၩ့ဝ့ၫတၭ, ဒၪန့အစံ ရအၫအစဎွၩဒုၭဆၧလၧလံၭဘနၫလီၫ. အဂဲးဘဲၫယီၩ နါဂၧၫ့ဘၪဝ့ၫ လၧအစဲၪ့ထၪ့ခွံၬယူၭ လၧလၫခ့ၭနီၪ",
			"9": "<sup>9</sup> လီၫ.- ထီးအဝ့ၫဒၪနါဂၧၫ့လၧဆၧစံၭ လၧကူၡၫအစဎွၩ တၧၫဟၫကၫအဂဲးတၭး ယိခွါ,အဝ့ၫဒၪဂဲၫထၪ့ဘဲၫအ မိဒုၭဆၧထၫ့ဒၩနၧၩလီၫ. အဝ့ၫအၪ့မၧၫ့လၩ့ဒီၭအၥီၫ့",
			"10": "<sup>10</sup> လဖၪလၧစဟ့ၭဇကဲအၫအအီၪတၭ, စံၭဝ့ၫဒၪ,- နၥံၪမိ ဘၪစံၭယုဒၫအစဎွၩ စဟ့ၭဇကဲအၫဘဲၫယီၩ, ယွၩလၧ နဒိၭနဲၩ့နၥၭ လၧအဝ့ၫလဂၩစံၭနၧၩ ဆၧလဖ့ၪလၫ့ ဘၪယရုစလံၫ့လၧ အစံရအၫအစဎွၩအစူၪဖၧၩ့လါနၫ့",
			"11": "<sup>11</sup> တၭ,မွဲအထီးအၪ့လီၫန့နၧၩလဂ့ၩ.- ယိခွါ,ဆၧလၧအ စံရအၫအစဎွၩလဖၪ မၩထံၫၥံၪခးၥံၪထီးအလူၬ,လၧ အမၩဂၭဂီၩ့ဝ့ၫလူၬထူၬဆံၫ့ဘၩ့နီၪ နနါဂၧၫ့ယူၭတၭ,",
			"12": "<sup>12</sup> နမိဖီၩ့ဖျ့ၭနဝ့ၫဆ့ဧၪ. ၦအဆၨၩၥံၪလၧယဖါလဖၪမၩ ဂၭဂီၩ့ဝ့ၫ,ဂိဇၫ့ ဒဲဟၫရၫ့,ဒဲရ့ဇ့ၭ, ဒဲၦအံဒံၫ့ဖိၪလၧအ အီၪလၧၥလၭစၫအဖၧၩ့နီၪ အယွၩလဖၪမၩဖီၩ့ဖျ့ၭအ",
			"13": "<sup>13</sup> ဝ့ၫၥံၪဆ့ဧၪ.- ဟၫမၭအစဎွၩ, ဒဲအၫဖၭအစဎွၩ,ဒဲဒိၩ့ စ့ၭဖၫဝံၫ့,ဟံနၫ, ဒဲအံဝၫအစဎွၩနီၪ, မွဲအအီၪခီၫခီၫလဲၪ.",
			"14": "<sup>14</sup> စဟ့ၭဇကဲအၫနီၪ န့ဘၪလံၬလၧအၥီၫ့လဖၪအစူၪ ဖၧၩ့တၭဖီဘၪဝ့ၫတၭ, စဟ့ၭဇကဲအၫလ့ၩထၪ့လၧယ ဟိဝၩအဂံၪ့ဖၧၩ့တၭ, ပၠၪလၩ့ဝ့ၫလၧယဟိဝၩအမ့ၬ",
			"15": "<sup>15</sup> ယၫလီၫ.- တၭစဟ့ၭဇကဲအၫ ဘၩဆိၪဖၪယဟိဝၩ တၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩအံၫစရ့လၭအယွၩလၧအအီၪ ဝ့ၫလၧခ့ၫရူၬအဘိၩ့ဆၧၩ့လဂၩဧ့, နဝ့ၫနမွဲယွၩ,န့ၫနၧၩ လဂၩဎးလၧဂၪ့ခိၪအဘၩ့မုးထီးအလူၬ အဖၫ့ခိၪလီၫ.",
			"16": "<sup>16</sup> နတဲၩ့လၩ့မူၭခိၪ,ဒဲဂၪ့ခိၪလီၫ.- ဒိၭနနါ, ယဟိဝၩဧ့, ခိၭနၪဆံၭ,စၪ့ထၪ့နမ့ၬၥၪ, ယဟိဝၩဧ့, ယိခွါ,ဒဲခိၭနၪ စနၭခရံၭအဆၧချဲၩ့ ထီးအလူၬ လၧအအၪ့မၧၫ့လၩ့",
			"17": "<sup>17</sup> ဆၧဘဲၫၥိၭအမိဒုၪဒွ့ၪယွၩလၧအမၧၫ့ဝ့ၫနီၪဆံၭ.- မွဲတ ၡါယဟိဝၩဧ့, အစံရအၫအစဎွၩလဖၪ မၩဂၭဂီၩ့ခွံၬ",
			"18": "<sup>18</sup> ယူၭၦဆၨၩၥံၪ, ဒဲအထံၫၥံၪခးၥံၪ,- ဒဲခွံၬၡိၭခွံၬအယွၩ လဖၪလၧမ့ၪဖၧၩ့, (အဂဲးဘဲၫယီၩ, မွဲယွၩလဖၪအ့ၬ.မွဲ ၥံၪ့ၥံၪဝၪၥံၪ, ဒဲလိးၥံၪလဲၫ့ၥံၪ ၦမၩဝ့ၫလၧအစူၪလီၫ.)",
			"19": "<sup>19</sup> တၭမၩဂၭဂီၩ့ခွံၬဝ့ၫလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, ယဟိဝၩ ပယွၩဧ့,မၩဖီၩ့မၩဖျ့ၭပၧၩ လၧအဝ့ၫဒၪအစူၪဖၧၩ့ဆံၭ. တၭဂၪ့ခိၪအဘၩ့အမုးထီးအလူၬ မိၥ့ၪယၫလၧနမွဲယ ဟိဝၩန့ၫနၧၩလဂၩဎးလီၫ.",
			"20": "<sup>20</sup> ထီးနီၪလဖၧၫ့စအၫမူၭအဖိၪခွၫ စအဲၫစ့ယၫအၪ့မၧၫ့ လၩ့ဆၧလၧစဟ့ၭဇကဲအၫ အအီၪတၭ, စံၭဝ့ၫဒၪ,ယ ဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, ဆၧလၧနဘၩ ဆိၪဖၪယၧၩလၧအစံရအၫအစဎွၩ စနၭခရံၭအဂဲးနီၪ,",
			"21": "<sup>21</sup> ယနါဂၧၫ့ဆ့ယူၭ.- အယီၩမွဲဆၧချဲၩ့လၧယဟိဝၩချဲၩ့ ဆၧလၧအဂဲးၦမုၪနၩ့ ဇံအိၫ့အဖိၪမုၪ အီၪက့ၪနၧၩ လၧဆၧနးမံၩ့အ့ၬ. နံဒုၪဒွ့ၪဘၪနၧၩ, ယရုစလံၫ့အဖိၪ",
			"22": "<sup>22</sup> မုၪဂံၩဂုအခိၪလၧနၧၩလီၫ.- နဒုၪဒွ့ၪ,ဒဲမၩကြၩ့ထမး ပလၫလဂၩလဲၪ. တၭနထုၭထၪ့နလူ လၧပလၫလဂၩ အဖၫ့ခိၪ,ဒဲကျဲၪ့ထၪ့နမ့ၬ လၧပလၫလဂၩအဖၫ့ခိၪလဲၪ. ထၫ့ဒၩဒၪလ့ၬအံၫစရ့လၭ, အဆၧဆံၫ့ဎံၪလဂၩနီၪ လီၫ.",
			"23": "<sup>23</sup> နဒုၪဒွ့ၪယဟိဝၩလၧနၥီၫ့လဖၪအစူၪဖၧၩ့တၭ နစံၭ, ယထၪ့ဘၭခိၪလီၩ့လဖၪ အဆၧထီၫ,လ့ၭဘနၧၫ့အနဲၩ့ ဖၩ,လၧယလဲၪ့ၥုၭခမျၧး, ဒဲယမိခူၬလၩ့ခွံၬ အၥံၪ့ၡိၫ အ့ရ့ၭအထီၫ,ဒဲအၥံၪ့ၡိၫအဂ့ၩထုၬတၭ, ယမိထၪ့ဘၭ",
			"24": "<sup>24</sup> အလးထီၫထုၬ, ကျိၭလၧမံၩ့လၬကျၩလီၫ.- ယခုၪ့လၩ့ ဆၧတၭ,အီၩထံၫလၩ့မဲၩဒၪအဆၧတၭ, မိမၩလၩ့ၥံၭ အံဇံၭအထံၫချိၬထီးအလူၬ လၧယခၪ့ယၫၥၭလီၫ.",
			"25": "<sup>25</sup> လၧအၥၫ့လၧအခၪ့ထံၭယမၩယဝ့ၫတၭ, လၧမုနံၩ လဖၪလၧဖျိၩ့ယမၩဝ့ၫနီၪမွဲနနါဂၧၫ့အ့ၬဧၪ. တၭဘိၩ့နဲၪ့ ယီၩယဒုၭမၩအၥၭ ဘဲၫၥိၭနမိအီၪလၧဆၧမၩဂၭဂီၩ့ ဒိၩ့အီၪလၧအခိၪဒၧၩ့လဖၪဘဲၫဆၧအပိၩ့အီၪယူဝ့ၫအ ၥိၭနီၪအဂးလီၫ.",
			"26": "<sup>26</sup> တၭၦအီၪဝ့ၫလဖၪနီၪ အစူၪလၩ့ဖၨၪဝ့ၫလီၫ. မိၥၭ မဲၪၥၭဖျဲၩ့ဆၧတၭ, အီၪက့ၪမဲအမ့ၬလီၫ. မွဲထးမုလၧ မံၩ့လၬကျၩ, ဒဲနၪ့ၥံၪမံၩ့ၥံၪၥံၫ့ဆ့ၬ, နၪ့အီၪလၧဂံၪ့အ ခိၪ,ဒဲဘုၪဘၪလံၩအခိ လၧအလချႃၭဒိၪထၪ့ဒံၭဘၪ",
			"27": "<sup>27</sup> လီၫ.- တၭနဆၧၫ့နၩ့, ဒဲနလ့ၩထၪ့, ဒဲနလ့ၩနုၬဒဲနၥၭ ထၪ့ဘၪယၧၩနီၪ, ယၥ့ၪယၫလီၫ.",
			"28": "<sup>28</sup> မွဲနၥၭထၪ့ယၧၩ, ဒဲနအီၪက့ၪထၪ့ထီၫနၥၭနီၪဂဲၫထၪ့ လၧယနါဖၧၩ့တၭ, ယမိအီၪက့ၪယခွၩ့လၧနနၫဖၧၩ့,ဒဲ ယဖျံၩလၧနနိၭဖၧၩ့တၭ, ယမိဘိၭကၠၪကဒၩထဲၩ့နၧၩ လၧဖၧၩ့ၥၭလၧနဂဲၫလီၫ.",
			"29": "<sup>29</sup> တၭအယီၩမိကဲၪထၪ့ဆၧနဲၪ့လၧနဂး, အယီၩလနံၪ့ ယီၩနၥံၪမိအၪ့ဆၧလၧအမဲၪထၪ့ဒၪအဆၧတၭ, နံၫနံၪ့ လနံၪ့နီၪဆၧလၧအမဲၪထၪ့ ဒၪဆၧလၧအဝ့ၫနီၪတၭ, ၥၧၫ့နံၪ့လနံၪ့နီၪဎွံၪဆၧ, ဒဲကူၭဆၧ,ဒဲၥုၪ့စဘံၭမုအလး လဖၪတၭ, အၪ့အဆၧၥၪနီၪဆံၭ.",
			"30": "<sup>30</sup> တၭဆၧဖီၩ့ဖျ့ၭလၧယုဒၫအၡၩဂံၪ့ဖိၪ လၧအအီၪ လၩ့ထးနီၪ,မိဆဲၩလၩ့အဝံလၧလၬလခီၫတၭ, ၥၪထၪ့ လၧထၭလခီၫလီၫ.",
			"31": "<sup>31</sup> အဂဲးဘဲၫယီၩ လၧယရုစလံၫ့အဖၧၩ့နီၪ ၦလၧအအီၪ လၩ့ထးမိစဲၪ့ထၪ့, ဒဲၦလၧအစဲၪ့ဖီၩ့ဖျ့ၭလဖၪနီၪလၧ ခိၪလီၩ့ဇံအိၫ့လီၫ. ဆၧၥုၭမုခမျၧးအယဟိဝၩအၥၭ ဆီၪ့မိမၩဆၧနီၪလီၫ.",
			"32": "<sup>32</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩစံၭဆၧလၧအစံရအၫ အစဎွၩအဂဲးနီၪဘဲၫယီၩ, မိဂဲၫနုၬဘၪလၧဒိၩ့လဖျိၪ့ ယီၩအဖၧၩ့အ့ၬ. ဒဲခၭဘၪဖျါလဘံၪ့ ထီးနီၪဆ့အ့ၬ. ဒဲဂဲၫထၪ့လၧအမ့ၬယၫ, လၧအထၩ့ဖံၭအ့ၬ, ဒဲမၩထၪ့",
			"33": "<sup>33</sup> ဘၪဆၧခိၪဒၧၩ့ထၫ့ဒၩဝ့ၫဆ့အ့ၬ.- တၭဖၧၩ့ၥၭလၧအ ဂဲၫနီၪ,မိထဲၩ့ထဲၩ့လၧဖၧၩ့ၥၭလဘီၩ့နီၪတၭ, ဂဲၫနုၬဘၪ",
			"34": "<sup>34</sup> လၧဒိၩ့ဖၧၩ့ယီၩအ့ၬး ယဟိဝၩစံၭဝ့ၫဒၪ,- အဂဲးဘဲၫ ယီၩယမိအီၪဖီၩ့ဒိၩ့လဖျိၪ့ယီၩ ဘဲၫၥိၭယမိမၩဖီၩ့မၩ ဖျ့ၭဝ့ၫလၧယကၠီၩ့ဒၪယဝ့ၫ, ဒဲလၧယခ့ၫယၡၩစဒၫဝံၭ အကၠီၩ့လီၫ.",
			"35": "<sup>35</sup> တၭလၧမုလနၩနီၪဆၧမၩအၥၭ လၧယဟိဝၩအၥီၫ့ နီၪစဲၪ့ထၪ့ကျီၪ့ခွံၬၦၡၩလကုၬ ဎိၭလၬယဲထီၫ့လၧအစံ ရအၫၥုၪ့တဲၩအလးဖၧၩ့နီၪ, ထီးမုဆဲၪ့ထၪ့နီၪၦၡၩဂဲ ထုၪ့ဂီၩဂီၩတၭ, ယိခွါ,ၦလဖၪထီးအလူၬနီၪမွဲၦအစွၪ",
			"36": "<sup>36</sup> လီၫ.- အစံရအၫအစဎွၩစနၭခရံၭစဲၪ့ထၪ့ဝ့ၫထဲၩ့က",
			"37": "<sup>37</sup> ဒၩထဲၩ့ဝ့ၫတၭ, အီၪဝ့ၫလၧနံနဝ့ၫလီၫ.- တၭအဝ့ၫဒၪ ဘိၪ့ထၪ့ဘၩထၪ့ဆၧလၧအယွၩနံၭစရီၭအဂံၪ့ဖၧၩ့အ ဘိၩ့ဘၭနီၪ, အဖိၪခွၫၥံၪ, စအဒၫ့မလ့ၭ,ဒဲစၡၫရ့ဇၧၫ နီၪကျီၪ့ခွံၬဝ့ၫလၧအနၭတၭ, အဝ့ၫၥံၪစဲၪ့ဖီၩ့ဖျ့ၭလၧအ ခးအၫရရၭအဖၧၩ့တၭ, အဖိၪခွၫစအံစၫဟၭဒၧၫ့ကဲၪ ထၪ့စဎွၩလၧအလးနီၪလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> ဆၧလၧမုနံၩလဖၪနီၩ စဟ့ၭဇကဲအၫဆၫထၪ့ဝ့ၫထီး အမိၥံၫလီၫ. စအၫမူၭအဖိၪခွၫမီၪစအဲၫစ့ယၫနီၪလ့ၩ လၧအအီၪတၭ, စံၭအဝ့ၫ, မၪလူၬနၡၩဂံၪ့ဖိၪအဆၧ",
			"2": "<sup>2</sup> ဆံၭ.အဂဲးဘဲၫယီၩနမိၥံၫတၭ, နမၧၫ့နဝ့ၫအ့ၬ.- အဝ့ၫ ဒၪကၠၪဒံၩ့ခံၫ့အမ့ၬ လၧဆၧဒီၪ့တၭ, ဘၩဆိၪဖၪယဟိ",
			"3": "<sup>3</sup> ဝၩတၭ,စံၭဝ့ၫဒၪ,- ယဟိဝၩဧ့, ယလ့ၩဆၧလၧနမ့ၬ ယၫလၧဆၧမွဲဆၧတီၩ အဖၧၩ့ဒဲလၧယၥၭထၧၫ့ဖျိၪ့ယၫ တၭ,ယမၩယူၭဆၧအဂ့ၩလၧနမ့ၬယၫနီၪ နၪ့ထၪ့ထဲၩ့ လါဆံၭ. စဟ့ၭဇကဲအၫဂၪ့ဝ့ၫနၭမၬလီၫ.",
			"4": "<sup>4</sup> တၭစအဲၫစ့ယၫလချႃၭထီၩ့ဒံၭဘၪ လၧဆၧအဝၩ့အ ဖၧၩ့နီၪဆၧမၩအၥၭ လၧယဟိဝၩအလူလၩ့ဘၪဝ့ၫ",
			"5": "<sup>5</sup> စံၭဝ့ၫဒၪ,- ထဲၩ့ထဲၩ့တၭ, လီၩဘၪယၡၩခမျၧးအခိၪ, စဟ့ၭဇကဲအၫ, ယဟိဝၩနဖါစဒၫဝံၭအယွၩ စံၭဘဲၫ ယီၩ,ယနါဂၧၫ့ယူၭနဘၩဆိၪဖၪဆၧယူၭ, ယဒၪဘၪ နမ့ၬထံၫယူၭ,ယိခွါ, ယမိမၩဘျၪထဲၩ့နၧၩလီၫ. လၧ ၥၧၫ့နံၩလနံၩနီၪနမိလ့ၩထၪ့လၧယဟိဝၩ အဂံၪ့ဖၧၩ့",
			"6": "<sup>6</sup> လီၫ.- ယမိမၩအၪထၪ့နနံၩလဖၪ လၧလဆံၫယဲနံၪ့လီၫ. ယမိမၩဖီၩ့မၩဖျ့ၭနၧၩ ဒဲဒိၩ့လဖျိၪ့ယီၩလၧအစံရအၫ စဎွၩအစူၪဖၧၩ့တၭ, ယမိအီၪဖီၩ့ဒိၩ့လဖျိၪ့ယီၩလၧ ယကၠီၩ့ဒၪယဝ့ၫ, ဒဲလၧယခ့ၫယၡၩစဒၫဝံၭ အကၠီၩ့",
			"7": "<sup>7</sup> လီၫ.- တၭစအဲၫစ့ယၫစံၭဝ့ၫဒၪ, မၩန့ချိၪ့ဒိၩ့ၥၪနးလီၪ့ ဆံၭ.အဝ့ၫၥံၪမၩန့ဝ့ၫတၭ, အီၪက့ၪလၩ့ဝ့ၫလၧဝံၫ့အ ဖၫ့ခိၪတၭဘျၪထဲၩ့ဝ့ၫလီၫ.",
			"8": "<sup>8</sup> စဟ့ၭဇကဲအၫစံၭစအဲၫစ့ယၫ, လၧယဟိဝၩမိမၩ ဘျၪထဲၩ့ယၧၩတၭ, လၧယမိလ့ၩထၪ့လၧယဟိဝၩအဂံၪ့ ဖၧၩ့ၥၧၫ့နံၩလနံၩနီၪ, ဆၧမၩနဲၪ့မွဲဆၧနီၪလမံၩ့လဲၪ.",
			"9": "<sup>9</sup> တၭစအဲၫစ့ယၫစံၭဝ့ၫဒၪ, အယီၩမွဲဆၧမၩနဲၪ့လၧနဂး လၧနမိန့ဘၪဆၧလၧယဟိဝၩ, လၧယဟိဝၩမိမၩဆၧ လၧအချဲၩ့ယူၭဝ့ၫနီၪလီၫ. ဆၧအလၩရှူၪမိဘၪလ့ၩ လၩ့လၧယၫအဆၫ့ဆံၫဆၫ့နီၪဧၪ, အ့ၪလမွဲဘၪမွဲအ",
			"10": "<sup>10</sup> ဘၪထဲၩ့ကဒၩထဲၩ့လခီၫ အဆၫ့ဆံၫဆၫ့နီၪလဲၪ.- တၭ စဟ့ၭဇကဲအၫစံၭဆၧၫ့ဝ့ၫဒၪ, ဆၧအလၩရှူၪလ့ၩလၩ့ လၧယၫအဆၫ့ဆံၫဆၫ့နီၪ, မွဲဆၧအယီၫတၭ,မွဲအထဲၩ့",
			"11": "<sup>11</sup> ကဒၩထဲၩ့လခီၫအဆၫ့ဆံၫဆၫ့နီၪဆံၭ.- တၭမီၪစအဲၫ စ့ယၫအၪ့ကံၩ့အၪ့ယၫယဟိဝၩနီၪ, အဆၧဒုၭကဒၩ ထဲၩ့အလၩရှူၪအဆၫ့ဆံၫဆၫ့ လၧအလ့ၩဖီၩ့ခွံၬယူၭ လၧစအၫဟဇၭအမုနၩရံၩအလီၩ့နီၪလီၫ.",
			"12": "<sup>12</sup> ဆၧလၧ အဆၧၫ့အထီနီၪဘၭဘလၧၫ့အစဎွၩ စဘၫလဒၫ့အဖိၪခွၫ စဘရီဒၭဘၫလဒၫ့လဂၩ ဖ့ၪယုလံၬ, ဒဲလၬဆီၪ့လၧ စဟ့ၭဇကဲအၫလီၫ. အဂဲးဘဲၫယီၩနါဂၧၫ့ဝ့ၫ လၧအဆၧဘျၪထဲၩ့ယူၭ",
			"13": "<sup>13</sup> လီၫ.- စဟ့ၭဇကဲအၫနီၪခိၭနၪအဝ့ၫၥံၪ အလူ တၭ,ဒုၭနဲၪ့ဝ့ၫလၧဆၧလူဒိၪဎွ့ၩဒိၪအဂံၪ့ထၧၫ့ ဂံၪ့ယၫ, စ့ၩ, ဒဲထီၫ့,ဒဲဆၧနၧၫ့မၧၫ့, ဒဲၥိၪအဂ့ၩ,ဒဲအစူၪ ဝဲၩအဂံၪ့ထၧၫ့ဖျိၪ့ယၫ, ဒဲကယဲအဆၧလၧအအီၪလၧ ဆၧလူဒိၪဎွ့ၩဒိၪအကျၩနီၪလီၫ. ဆၧလၧစဟ့ၭဇကဲ အၫလဒုၭနဲၪဘၪဝ့ၫနီၪ, အီၪလၧၩ့လၧအဂံၪ့ဖၧၩ့,ဒဲအီၪ လၧၩ့လၧအဘၩ့အမုး ထၧၫ့ဘံၪ့ယၫအဖၧၩ့နးမံၩ့ အ့ၬ.",
			"14": "<sup>14</sup> ထီးနီၪလဖၧၫ့မီၪစအဲၫစ့ယၫနီၪ ဂဲၫလၧစဎွၩဟ့ၭဇကဲ အၫအအီၪတၭ, စံၭဝ့ၫၦလဖၪနီၪ စံၭဘဲၫၥ့ၪလဲၪ,မွဲအ ဂဲၫစိၩလၧနအီၪအထံၭခီၫခီၫလဲၪ. တၭစဟ့ၭဇကဲအၫ စံၭဝ့ၫဒၪ, ဂဲၫစိၩလၧယအီၪလၧထံၫယဲၩ့ခးယဲၩ့လဘံၪ့,",
			"15": "<sup>15</sup> လၧဘၭဘလၧၫ့နီၪလီၫ.- တၭအဆၧစံၭဝ့ၫဒၪ, မွဲအဒၪ ဘၪဆၧနီၪလၫ လၧနဂံၪ့ဖၧၩ့လမံၩ့လဲၪ. တၭစဟ့ၭဇ ကဲအၫစံၭဆၧၫ့ဝ့ၫဒၪ, ဒၪဘၪယူၭကယဲဆၧလၧအအီၪ လၧယဂံၪ့ဖၧၩ့ထီးအလူၬယူၭ, ဆၧလၧယလဒုၭနဲၪ ဘၪဝ့ၫနီၪ အီၪလၧယဆၧလူဒိၪဎွ့ၩဒိၪအကျၩနးမံၩ့ အ့ၬ.",
			"16": "<sup>16</sup> တၭစအဲၫစ့ယၫ စံၭစဟ့ၭဇကဲအၫ,ခိၭနၪယဟိဝၩ",
			"17": "<sup>17</sup> အလူဆံၭ.- ယိခွါ,မုနံၩလဖၪ မိဂဲၫလၧကယဲဆၧအီၪ လၧနဂံၪ့ဖၧၩ့,ဒဲဆၧလၧနဖါၥံၪအီၪက့ၪကီၪ့ဝ့ၫ ထီးမု ဆၫလနံၩယီၩ, ဆၧမိလ့ၩဆိၬဝ့ၫ လၧဘၭဘလၧၫ့အ ဖၧၩ့နီၪလီၫ. ဆၧမိအီၪလၩ့ထးနးမံၩ့အ့ၬး ယဟိဝၩ",
			"18": "<sup>18</sup> စံၭဝ့ၫဒၪ,- မိဆိၬထၪ့ခွံၬနဖိၪခွၫၥံၪလၧအလၩ့ဆၨၩလၧ နၧၩ,လၧနထၪ့ဖိၪတၭ, မိကဲၪထၪ့ၦဖၫဆွံၪလၧဘၭ",
			"19": "<sup>19</sup> ဘလၧၫ့အစဎွၩအနီးဖၧၩ့လီၫ.- ထီးနီၪလဖၧၫ့စဟ့ၭ ဇကဲအၫ,စံၭစအဲၫစ့ယၫ, ယဟိဝၩအဆၧချဲၩ့လၧအ ချဲၩ့ယူၭဝ့ၫနီၪဂ့ၩဝ့ၫလီၫ. တၭစံၭဝ့ၫဒၪ, ဆၧဘၪလိၬ အိၭလိၬ,ဒဲဆၧမွဲဆၧတီၩမိအီၪဝ့ၫ လၧယမုနံၩလဖၪအ ဖၧၩ့နီၪ,မွဲအ့ၬဧၪ.",
			"20": "<sup>20</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စဟ့ၭဇကဲအၫ,ဒဲ အစီၩ့အမၩ့ထီးအလူၬ, လၧအမၩကမၫ ဒဲထံၫကၠီၪ့ လၧအဒုၭဂဲၫနုၬထံၫလၧဒိၩ့ဖၧၩ့ အဂဲးအကၠီၪ့နီၪ,ကွ့ၭ အၥၭလၧယုဒၫအစဎွၩ အလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ,",
			"21": "<sup>21</sup> မွဲအ့ၬဧၪ.- စဟ့ၭဇကဲအၫမံၫဝ့ၫ လၧအဖါၥံၪအၥိၭ တၭ, အဖိၪခွၫစမနၭစ့ၫ ကဲၪထၪ့စဎွၩ လၧအလးနီၪ လီၫ."
		},
		"21": {
			"1": "<sup>1</sup> စမနၭစ့ၫကဲၪထၪ့ၥၫ့စဎွၩနီၪ အၥၭအီၪလဆံၫနံၫနံၪ့ တၭ,ကဲၪထၪ့စဎွၩလၧယရုစလံၫ့အဖၧၩ့ယဲဆံၫယဲနံၪ့",
			"2": "<sup>2</sup> လီၫ.အမိအမံၩ့နီၪ, မွဲနးဟ့ဇဘၫလီၫ.- တၭအဝ့ၫဒၪ မၩဆၧအၧၩ့လၧယဟိဝၩ အမ့ၬယၫဘဲၫၦဆၨၩလဖၪ အဆၧဘၪၥၭလိၪလၧယဟိဝၩ နၫ့ထၪ့ခွံၬလၧၦအံၫ",
			"3": "<sup>3</sup> စရ့လၭဖိၪအမ့ၬယၫလီၫ.- မၩထဲၩ့ဆၧအလးထၪ့ထီၫ လဖၪလၧအဖါစဟ့ၭဇကဲအၫ မၩဂၭဂီၩ့ဝ့ၫတၭ,မၩ ထၪ့ဆၧလုလးလဖၪ လၧဘၫအလၭအဂးတၭ, တဲၩ့ အၡ့ရိၫတၭ, မၩဝ့ၫဘဲၫအံၫစရ့လၭအစဎွၩ အၫဟၭ အၥိၭတၭ, ဘၩထၪ့မူၭခိၪအၥုၭမုခမျၧး ထီးအလူၬ",
			"4": "<sup>4</sup> ဒဲမၩအဆၧလီၫ.- တၭမၩဆၧလုလးလဖၪလၧယဟိ ဝၩအဂံၪ့လၧယဟိဝၩစံၭလၧအဂဲး, ယမိအီၪက့ၪယ မံၩ့လၧယရုစလံၫ့အဖၧၩ့လီၫ.",
			"5": "<sup>5</sup> တၭမၩဆၧလုလးလဖၪ လၧမူၭခိၪအၥုၭမုထီးအ လူၬအဂးလၧယဟိဝၩအဂံၪ့အဝၩ့ နံၫစီၪ့အဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> တၭအၪ့မၧၫ့အဖိၪခွၫခၫ့ဂၬမ့ၪ, ဒဲဒုၪဆၧအဆၧၫ့အထီ, ဒဲမၩဆၧလီးဆၧဘွဲၩ, ဆၧအူၪဆၧပီၩ, ဒဲမၩဎုၬဆၧ လၧဆၧယူၬၥံၪဒဲၦအီၪလၧဆၧနၪၥံၪတၭ, မၩဆၧအၧၩ့ အၪမံၩ့လၧယဟိဝၩအမ့ၬယၫ လၧအဒုၭထၪ့အၥၭ",
			"7": "<sup>7</sup> လီၫ.- တၭအီၪက့ၪလၩ့ အၡ့ရိၫအဂၩ့ လၧအတဲၩ့ဝ့ၫ လၧဂံၪ့ဖၧၩ့, လၧယဟိဝၩစံၭစဒၫဝံၭအဖိၪခွၫစစီလမၧၫ့ လၧအဂဲး,လၧဂံၪ့လဖျိၪ့ယီၩအဖၧၩ့, ဒဲလၧယရုစလံၫ့ အဖၧၩ့လၧယရွံန့ဝ့ၫလၧအံၫစရ့လၭ အဒီၪ့ထီးအလူၬ အကျၩနီၪ, ယမိအီၪက့ၪယမံၩ့အဆိၩဆိၩအကၠၪကၠၪ",
			"8": "<sup>8</sup> လီၫ.- အဝ့ၫၥံၪအ့ၪထီးန့ဆၧဘဲၫကယဲဆၧလၧယမၪ လူၬအဝ့ၫၥံၪဒဲဘဲၫကယဲဆၧၥီၪ့ဆၧၥၫ့ လၧယခ့ၫယၡၩ စမိစ့ၭမၪလူၬအဝ့ၫၥံၪအၥိၭနီၪတၭ, ယဒုၭစဲၪ့ထၪ့လၧၩ့ အံၫစရ့လၭအခၪ့လၧခးလဘံၪ့ယီၩ လၧယဖ့ၪလၫ့အ",
			"9": "<sup>9</sup> ဖါၥံၪအဖၧၩ့အ့ၬ.- မွဲလါနၫ့ဘိၩအဝ့ၫၥံၪခိၭနၪဆၧအ့ၬ. တၭစမနၭစ့ၫအၪ့လွ့ၫန့ဝ့ၫ ဘဲၫၥိၭအမိမၩဆၧအၧၩ့အၪ နဲၪ့ၦဆၨၩလဖၪလၧယဟိဝၩမၩဂၭဂီၩ့ဝ့ၫ လၧအံၫစရ့ လၭအမ့ၬယၫလီၫ.",
			"10": "<sup>10</sup> ယဟိဝၩချဲၩ့ဆၧလၧအခ့ၫအၡၩ မီၪလဖၪအစူၪဖၧၩ့",
			"11": "<sup>11</sup> တၭ,စံၭဝ့ၫဒၪ,- မွဲယုဒၫအစဎွၩမနၭစ့ၫမၩဆၧဘၪၥၭ လိၪလဖၪနီၪ, မၩဆၧအၧၩ့အၪနဲၪ့ၦအၫမၧၫ့ဖိၪလၧအ အီၪဝ့ၫလၧအမ့ၬယၫမၩဝ့ၫတၭ, ဒုၭမၩဆ့ယုဒၫလၧ",
			"12": "<sup>12</sup> ဆၧဒဲၩဘၭလၧအဆၧဂၩ့ဆၧဖၪ့,- မၩအၥၭဘဲၫနီၪ တၭ,ယဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫယီၩ, ယိခွါ, ယမိဒုၭဂဲၫဘၪယရုစလံၫ့, ဒဲယုဒၫလၧဆၧအၧၩ့လမံၩ့, လၧထီးဒၪၦလၧအနါဂၧၫ့ဝ့ၫလဂၩလါလါနီၪ, အနါမိ",
			"13": "<sup>13</sup> ၥီၫထၪ့နံၫခီၫလူၬလီၫ.- တၭယမိဆုးထၪ့စမ့ရအၫအ ဖျံၩဒဲစအၫဟၭအဂံၪ့အပနီၫ့ လၧယရုစလံၫ့အဖၫ့ခိၪ တၭ,ယမိထူၭခွံၬယရုစလံၫ့ ဘဲၫၦထူၭခွံၬထွ့ၫအၥိၭ",
			"14": "<sup>14</sup> နီၪ,ထူၭခွံၬဝ့ၫတၭ, ချႃၬလၩ့ဝ့ၫဒၪလီၫ.- ယမိလ့ၩဒၪ ခွံၬယဆၧန့ၥၫအဆၧအီၪလၩ့ထးတၭ, ဖ့ၪလၫ့ခွံၬဝ့ၫ လၧအဒုၪအဒၩအစူၪဖၧၩ့တၭ, မိကဲၪထၪ့ဆၧအၪ့ဂူၬ န့အလး,ဒဲဆၧမၩန့ဆီၪ့လၧအဝ့ၫၥံၪအဒုၪအဒၩထီး",
			"15": "<sup>15</sup> အလူၬအဂးလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမၩဆၧအၧၩ့ လၧယမ့ၬယၫတၭ, ဒုၭၥၭထၪ့ယၧၩအခီၫလၧမုလနံၩ လၧအဖါၥံၪဂဲၫထၪ့လၧအံဇံၭအဖၧၩ့ ထီးမုဆၫလနံၩ ယီၩလီၫ.",
			"16": "<sup>16</sup> စမနၭစ့ၫဂါလၩ့ခွံၬဆ့ဆၧၥွံၪ လၧအဆၧဒဲၩဘၭလ အီၪဘၪနီၪအၪအၪလ့ၬ ထီးအမၩဎွ့ၩထၪ့ယရုစလံၫ့ လၧအယီၩလခီၫ ထီၩ့လၧအနီၪလခီၫတၭး မွဲလၧအ ဆၧဒဲၩဘၭလၧအဒုၭမၩယုဒၫ လၧဆၧဒဲၩဘၭအဖၫ့ ခိၪနီၪ,ဘဲၫၥိၭအမိမၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬယၫ လီၫ.",
			"17": "<sup>17</sup> ဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစမနၭစ့ၫ,ဒဲကယဲဆၧ လၧအမၩဝ့ၫ, ဒဲအဆၧဒဲၩဘၭလၧအမၩဘၪဝ့ၫနီၪကွ့ၭ အၥၭလၧယုဒၫအစဎွၩ အလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ,",
			"18": "<sup>18</sup> မွဲအ့ၬဧၪ.- စမနၭစ့ၫမံၫဝ့ၫလၧအဖါၥံၪအၥိၭတၭ, ၦခုၪ့ လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧအဂံၪ့ဒၪဝ့ၫအကျိၭဖၧၩ့, လၧစအၧၭ ဇၫအကျိၭဖၧၩ့လီၫ. တၭအဖိၪခွၫစအၫမၧၫ့ကဲၪထၪ့ စဎွၩလၧအလးနီၪလီၫ.",
			"19": "<sup>19</sup> လၧစအၫမၧၫ့ကဲၪစဎွၩနီၪ အၥၭၡါနံၫဆံၫနံၫနံၪ့ တၭ,ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့ နံၫနံၪ့လီၫ.တၭ အမိအမံၩ့မွဲနးမရှုလမံၭ, စဟၫရၧၭအဖိၪမုၪလၧယီၬ",
			"20": "<sup>20</sup> ဘၫလီၫ.- အဝ့ၫဒၪမၩဆၧအၧၩ့လၧယဟိဝၩအမ့ၬယၫ,",
			"21": "<sup>21</sup> ဘဲၫအဖါစမနၭစ့ၫမၩဝ့ၫအၥိၭနီၪလီၫ.- ဖိၬဖၧၩ့ၥၭလ ဖၪလၧအဖါဖိၬဝ့ၫတၭ, မၩဆၧဂၩ့အဆၧလၧအဖါမၩ",
			"22": "<sup>22</sup> ဝ့ၫတၭ,ဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫလီၫ.- လ့ၩဒၪခွံၬအဖါလ",
			"23": "<sup>23</sup> ဖၪအယွၩတၭ, ဖိၬယဟိဝၩအဖၧၩ့ၥၭအ့ၬ.- စအၫမၧၫ့ အခ့ၫအၡၩၥံၪကိၪ့ဆၧအၧၩ့ထၫ့ဒၩအဝ့ၫတၭ, မၩၥံၫ စဎွၩလၧအဂံၪ့ဒၪဝ့ၫအဖၧၩ့နီၪလီၫ.",
			"24": "<sup>24</sup> ခးအၡၩခမျၧးမၩၥံၫကယဲ ၦလၧအကိၪ့ဆၧအၧၩ့ ထၫ့ဒၩစဎွၩအၫမၧၫ့ထီးအလူၬတၭ, အၡၩခမျၧးအီၪ က့ၪအဖိၪခွၫစယိၫစဲအၫ လၧစဎွၩအလးနီၪလီၫ.",
			"25": "<sup>25</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစအၫမၧၫ့လၧအ မၩဝ့ၫနီၪကွ့ၭအၥၭ လၧယုဒၫအစဎွၩ အလံၬကွ့ၭနဲၪ့",
			"26": "<sup>26</sup> ဆၧအဖၧၩ့နီၪ,မွဲအ့ၬဧၪ.- ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧအ ဆၧၥွၪခိၪအဖၧၩ့လၧစအၧၭဇၫအကျိၭဖၧၩ့တၭ, အဖိၪ ခွၫစယိၫစဲအၫ ကဲၪထၪ့စဎွၩလၧအလးနီၪလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> လၧစယိၫစဲအၫကဲၪထၪ့ၥၫ့စဎွၩနီၪ အၥၭအီၪဎိၭနံၪ့ တၭပၧၩ့ဆၧလၧယရုစလံၫ့အဖၧၩ့ ၥၧၫ့ဆံၫလနံၪ့လီၫ. အမိအမံၩ့မွဲနးယၭဒဒဲအၫ, စအၭဒဲအၫအဖိၪမုၪလၧ",
			"2": "<sup>2</sup> ဘီၭစကၭလီၫ.- အဝ့ၫမၩဆၧဂ့ၩ လၧယဟိဝၩအမ့ၬ ယၫတၭဖိၬအဖါစဒၫဝံၭအဖၧၩ့ၥၭ ထၧၫ့ဘီၩ့ယၫ တၭ, လၧစူၪထွ့ၪမွဲဂ့ၩ, လၧစူၪစ့ၪမွဲဂ့ၩ, ကၠၪခွံၬအၥၭ အ့ၬ.",
			"3": "<sup>3</sup> လၧစယိၫစဲအၫအနံၪ့ လဆံၫဎိၭနံၪ့လနံၪ့အဖၧၩ့ နီၪ,ဆၧမၩအၥၭလၧစဎွၩအၪ့မၧၫ့လၩ့ ၦကွ့ၭလံၬစမ ၡၧလၫ့အဖိၪခွၫ, စအၭဇလဲအၫအဖိၪခွၫ, စၡၫဖၫ့လၧ",
			"4": "<sup>4</sup> ယဟိဝၩအဂံၪ့, စံၭဝ့ၫဒၪ,- လ့ၩထၪ့လၧၦလုဆၧအခိၪ စဟံၫလကဲအၫအအီၪ ဘဲၫၥိၭအမိဝံထၪ့နၬထၪ့စ့ၩလၧ ၦဂဲၫဆိၬဝ့ၫလၧယဟိဝၩအဂံၪ့ဖၧၩ့, လၧၦပၧၩ့တရၫ့",
			"5": "<sup>5</sup> ၥံၪအၪ့ထုၫ့ကီၪ့ဝ့ၫ လၧၦခမျၧးအအီၪနီၪဆံၭ.- မွဲအဝ့ၫ ၥံၪဖ့ၪလၫ့ဝ့ၫလၧၦမၩဆၧမၩ လၧအယိယဟိဝၩအဂံၪ့ လဖၪအစူၪဖၧၩ့တၭ, မွဲအဝ့ၫၥံၪဖ့ၪလၫ့ထဲၩ့ၦလၧအမၩ ဆၧမၩလၧယဟိဝၩအဂံၪ့ဖၧၩ့ ဘဲၫၥိၭအမိမၩဂ့ၩထဲၩ့",
			"6": "<sup>6</sup> ဆၧဖိးလၧဂံၪ့ဖၧၩ့နီၪ,- လၧၦလဲၬၥမါၥံၪ, ဒဲလၧၦၥုၪ့ ဂံၪ့ၥံၪ,ဒဲလၧၦပၠၩ့ၥမါၥံၪ, ဘဲၫၥိၭအမိဎွ့ၩၥံၪ့,ဒဲလိးစိၭ",
			"7": "<sup>7</sup> ဖျၩအၥၭလၧဆၧမၩထဲၩ့ဂံၪ့အဂးနီၪဆံၭ.- မွဲလါနၫ့ ဘိၩ,ဆၧဒိၭန့ဆရၫ့ လၧၦလၧဆၧဖ့ၪလၫ့စ့ၩလၧအစူၪ ဖၧၩ့အကၠီၩ့နီၪ, ဆၧဒိၭန့ဆရၫ့အ့ၬ. အဂဲးဘဲၫယီၩအ ဝ့ၫၥံၪမၩလၧအလူတီၩလီၫ.",
			"8": "<sup>8</sup> တၭၦလုဆၧအခိၪ စဟံၫလကဲအၫ, စံၭၦကွ့ၭလံၬ စၡၫဖၫ့,ယဒၪန့လံၬဆၧၥီၪ့ဆၧၥၫ့ လၧယဟိဝၩအဂံၪ့ ဖၧၩ့လီၫ. တၭစဟံၫလကဲအၫ ဖ့ၪလၫ့လံၬနီၪလၧစၡၫ",
			"9": "<sup>9</sup> ဖၫ့တၭ,အဝ့ၫဒၪဖီဝ့ၫလီၫ.- ၦကွ့ၭလံၬစၡၫဖၫ့ဂဲၫထဲၩ့ လၧစဎွၩအအီၪတၭ, ဂဲၫဆိၬဆၧချဲၩ့လၧစဎွၩအအီၪ နီၪ,စံၭဝ့ၫဒၪ,နခ့ၫနၡၩလဖၪ အၪ့ထုၫ့ကီၪ့ယူၭစ့ၩလၧ အဒၪန့ဝ့ၫလၧဂံၪ့ဖၧၩ့တၭ, ဖ့ၪလၫ့ယူၭၦလၧအမၩဆၧ မၩ,လၧအယိထဲၩ့ယဟိဝၩအဂံၪ့အစူၪဖၧၩ့ယူၭ.",
			"10": "<sup>10</sup> ၦကွ့ၭလံၬစၡၫဖၫ့ဒုၭနဲၪဆၧလၧစဎွၩတၭ, စံၭဝ့ၫဒၪ,ၦ လုဆၧအခိၪ စဟံၫလကဲအၫနီၪ ဖ့ၪလၫ့ယၧၩလၧလံၬ လထူၫလီၫ. တၭစၡၫဖၫ့ဖီဝ့ၫလၧစဎွၩအမ့ၬယၫလီၫ.",
			"11": "<sup>11</sup> ထီးစဎွၩနါဂၧၫ့ လံၬအဆၧၥီၪ့ဆၧၥၫ့ အလူအထၫ တၭ,ဆၧမၩအၥၭ လၧအၡၫ့ယၬ အကီၩ့အၥိၭလီၫ.",
			"12": "<sup>12</sup> တၭစဎွၩမၪလူၬၦလုဆၧ စဟံၫလကဲအၫ, ဒဲစၡၫဖၫ့ အဖိၪခွၫစအဟဲကၫ့, ဒဲစမံၫခ့ယၫအဖိၪခွၫစအၫဘီၫ,ဒဲ ၦကွ့ၭလံၬ,စၡၫဖၫ့, ဒဲစဎွၩအခ့ၫအၡၩစအၭစအဲအၫ,",
			"13": "<sup>13</sup> စံၭဝ့ၫဒၪ,- လ့ၩအၪ့စၪ့ယဟိဝၩ လၧယဂး,ဒဲလၧၦ ခမျၧးအဂး, ဒဲလၧယုဒၫထီးအလူၬအဂး, လၧလံၬလၧ ၦဒၪန့ဝ့ၫလထူၫယီၩ လၧဆၧချဲၩ့အဂဲးအကၠီၪ့ဆံၭ. အ ဂဲးဘဲၫယီၩ ယဟိဝၩအဆၧၥၭထၪ့လၧအခဲၩထၪ့ဘၪ ပၧၩမွဲအဒိၪမၬလီၫ. အဂဲးဘဲၫယီၩ ပဖါၥံၪခိၭနၪလံၬ ယီၩအဆၧချဲၩ့ဘဲၫၥိၭအမိမၩဝ့ၫ ဘဲၫကယဲဆၧကွ့ၭအ ၥၭဘၪဆဲၫ့လၧပၧၩ အၥိၭနီၪအ့ၬ.",
			"14": "<sup>14</sup> ၦလုဆၧစဟံၫလကဲအၫ, ဒဲစအဟဲကၫ့,ဒဲစအၭ ဘီၫ,ဒဲစၡၫဖၫ့, စအၭစဟဲအၫၥံၪနီၪ လ့ၩဝ့ၫလၧၦပၧၩ့ဆၧ အကီၩ့အၥိၭစဟၫဟၭအဖိၪခွၫ စတံၭဝၫအဖိၪခွၫစၡၫ လၧၫ့အမၫမီၪမုၪ နးဟၧလဒၫလဂၩ အအီၪတၭ,ချဲၩ့ ဆၧလၧအဝ့ၫလီၫ. အဝ့ၫဒၪအီၪလၧယရုစလံၫ့လၧဆၧ အလးနံၫစီၪ့လစီၪ့တၭ အဝ့ၫၥံၪကၩ့ကၩ ဆၧလၧအဝ့ၫ",
			"15": "<sup>15</sup> နီၪလီၫ.- တၭၦမုၪနီၪစံၭအဝ့ၫၥံၪ, ယဟိဝၩအံၫစရ့ လၭအယွၩစံၭဘဲၫယီၩ, လီၩဘၪၦလၧအအၪ့မၧၫ့လၩ့",
			"16": "<sup>16</sup> နၥံၪလၧယအီၪ,- ယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ,ယမိ ဒုၭဂဲၫဆၧအၧၩ့လၧအလးယီၩ ဒဲလၧၦအီၪဝ့ၫလၧအ ဖၧၩ့အလီၩ့, ကယဲလံၬအဆၧချဲၩ့လၧယုဒၫအစဎွၩဖီ",
			"17": "<sup>17</sup> ဝ့ၫထီးအလူၬလီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪလ့ၩဒၪ ယၧၩတၭ, ဆူၭခဲၩဆၧနၧၫ့မၧၫ့လၧယွၩ အဂူၫဂၩလ ဖၪအဂး,ဘဲၫၥိၭအမိဒုၭၥၭထၪ့ယၧၩ လၧအစူၪအမၩ ဆၧထီးအလူၬအကၠီၩ့လီၫ. အခိးမွဲယၥၭထၪ့မိခဲၩထၪ့",
			"18": "<sup>18</sup> ထၫ့ဒၩအလးယီၩတၭ, မိလၩ့ဖံၬဘၪအ့ၬ.- အ့ၪမွဲယုဒၫ အစဎွၩလၧအအၪ့မၧၫ့နၥံၪ ဂဲၫအၪ့စၪ့ယဟိဝၩနီၪ,နၥံၪ မိဘၪစံၭအဝ့ၫ, ယဟိဝၩအံၫစရ့လၭအယွၩစံၭဘဲၫ",
			"19": "<sup>19</sup> ယီၩ,ဆၧချဲၩ့လၧနနါဂၧၫ့နီၪ,- မွဲနၥၭထၪ့တၭ, ထီးန နါဂၧၫ့ဆၧချဲၩ့ထၫ့ဒၩဆၧအလးယီၩ, ဒဲထၫ့ဒၩၦလၧအ အီၪလၧအဖၧၩ့လၧအမိကဲၪထၪ့ ဆၧအီၪယူ,ဒဲဆၧဆိၪ အၧၩ့အလးနီၪတၭ, နဆၪ့လၩ့နၥၭ ဒဲၡၫ့နကီၩ့နၥိၭ, ဒဲဂၪ့လၧယမ့ၬယၫနီၪယနါဂၧၫ့ဆ့ယူၭ ယဟိဝၩစံၭဝ့ၫ",
			"20": "<sup>20</sup> ဒၪ.- မၩအၥၭဘဲၫနီၪတၭ, ယိခွါ, ယမိအီၪက့ၪကီၪ့ နၧၩလၧနဖါလဖၪတၭ, ဆၧမိအီၪက့ၪကီၪ့နၧၩလၧနၥွၪ ခိၪဖၧၩ့မုၬမုၬတၭ, နမ့ၬၥၪလဖၪမိဒၪဘၪဆၧအၧၩ့ထီး အလူၬ,လၧယမိဒုၭဂဲၫဘၪဆၧအလးယီၩအ့ၬ. တၭ အဝ့ၫၥံၪနီၪဂဲၫဆိၬန့စဎွၩလၧဆၧချဲၩ့နီၪလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> စဎွၩအၪ့မၧၫ့လၩ့ဆၧတၭ, ဒုၭအီၪကီၪ့ယုဒၫအၡၩ ၥုၪ့က့ၭၥၭၡါ ဒဲယရုစလံၫ့အၡၩၥုၪ့က့ၭၥၭၡါထီးအ",
			"2": "<sup>2</sup> လူၬလၧအအီၪလီၫ.- စဎွၩလ့ၩထၪ့လၧယဟိဝၩအ ဂံၪ့ဖၧၩ့ဒဲယုဒၫအၦၡၩထီးအလူၬ, ဒဲၦအီၪဝ့ၫလၧယ ရုစလံၫ့အဖၧၩ့ ထီးအလူၬအီၪလၧအၥိၭတၭ, ၦလုဆၧ လဖၪ,ဒဲမီၪလဖၪ, ဒဲၦခမျၧးထီးအလူၬ, ဒဲဒိၪဒဲဆံၭလီၫ. တၭအဝ့ၫဒၪဖီဘၪလၧအဝ့ၫၥံၪ အနါဖၧၩ့လၧကယဲဆၧ ချဲၩ့လၧလံၬဆၧအုၩ့လၩ့လၧ ၦဒၪန့ဝ့ၫလၧယဟိဝၩအ",
			"3": "<sup>3</sup> ဂံၪ့ဖၧၩ့နီၪလီၫ.- စဎွၩဆၧၫ့ထုၪ့လၧထုၪ့အနဲၩ့ထံၭ တၭ,အုၩ့လၩ့ဆၧလၧယဟိဝၩ အမ့ၬယၫလၧအမိဖိၬ ယဟိဝၩအခဲၫ့, ဒဲထီးန့အဆၧမၪလူၬလဖၪ, ဒဲအဆၧ ထိးအၥၭလဖၪ, ဒဲအၥနိၫလဖၪ, လၧအၥၭထၧၫ့ဖျိၪ့ ယၫ,ဒဲလၧအၥၭၡီၩ့ထီးအလူၬ ဘဲၫၥိၭအမိမၩဆၧ အုၩ့လၩ့ယီၩအဆၧချဲၩ့ လၧအကွ့ၭအၥၭလၧလံၬယီၩ အ ဖၧၩ့တၭ,ၦခမျၧးထီးအလူၬ ထိးအၥၭလၧဆၧအုၩ့",
			"4": "<sup>4</sup> လၩ့နီၪဆ့လီၫ.- တၭစဎွၩမၪလူၬၦလုဆၧ အခိၪစဟံၫ လကဲအၫ, ဒဲၦလုဆၧလဖၪနံၫဆၫ့လဆၫ့, ဒဲၦပၧၩ့တရၫ့ လဖၪဘဲၫၥိၭအမိဂဲၫဆိၬထၪ့ခွံၬ ကယဲထွ့ၫလၧၦတဲၩ့ ဝ့ၫလၧဘၫအလၭအဂး, ဒဲလၧအၡ့ရိၫအဂး, ဒဲလၧမူၭ ခိၪအၥုၭမုထီးအလူၬၥံၪအဂး, လၧအအီၪလၧယဟိ ဝၩအနီးဖၧၩ့လီၫ. တၭအဝ့ၫဆူၭထၪ့ခွံၬဝ့ၫလၧယရုစ လံၫ့အချိၫ့လခီၫ လၧကံဒၧၫ့အဆၧပျၩ့ဖၧၩ့တၭ, လ့ၩ",
			"5": "<sup>5</sup> ဆိၬအဖံၫ့ချၪလၧဘ့ၥလၭလီၫ.- အဝ့ၫဒၪအီၪက့ၪလၩ့ ခွံၬၦဘၩဆၧဂၩ့အၡၩလုဆၧလဖၪ လၧယုဒၫအစဎွၩ အီၪက့ၪထၪ့ဝ့ၫ, ဘဲၫၥိၭအမိဆူၭခဲၩဆၧနၧၫ့မၧၫ့လၧအ လးထၪ့ထီၫအဖၫ့ခိၪ, လၧယုဒၫအဒိၩ့ဖၧၩ့လၧဆၧအီၪ ဝၬဖီၩ့ယရုစလံၫ့, ဒဲလၧအဆူၭခဲၩဆၧနၧၫ့မၧၫ့လၧဘၫ အလၭအဂး, လၧမုအဂး, လၧလၩအဂး, ဒဲၡၪၥံၪအီၪ",
			"6": "<sup>6</sup> ပိၩ့,ဒဲမူၭခိၪအၥုၭမုခမျၧးထီးအလူၬအဂးလီၫ.- အဝ့ၫ ဒၪဂဲၫဆိၬထၪ့ခွံၬအၡ့ရိၫ လၧယဟိဝၩအဂံၪ့လၧယရု စလံၫ့အချိၫ့, ထီၩ့လၧထံၫချိၬကံဒၧၫ့တၭ, ဆူၭထၪ့ခွံၬ ဝ့ၫလၧထံၫချိၬ ကံဒၧၫ့အနဲၩ့တၭ, ယဲးလၩ့ဘျ့ၭဝ့ၫ ထီးအကဲၪထၪ့ဆၧအမုၬတၭ, ခွံၬၡိၭခွံၬဆၧအမုၬနီၪ",
			"7": "<sup>7</sup> လၧၦခမျၧးအဖိၪၥံၪအၥွၪခိၪဖၫ့ခိၪနီၪလီၫ.- ၦအဲၪပ ခၧၩ့ဖိၪအဂံၪ့ၥံၪလၧအအီၪ လၧယဟိဝၩအဂံၪ့နဲၩ့ထံၭ, ထီးအလးလၧၦမုၪၥံၪထၭကလကၫ လၧအၡ့ရိၫအဂး နီၪ,မၩလၩ့ဎီးခွံၬဝ့ၫလီၫ.",
			"8": "<sup>8</sup> အဝ့ၫဂဲၫဆိၬၦလုဆၧၥံၪထီးအလူၬ လၧယုဒၫအဒိၩ့ လဖၪအဖၧၩ့, ဒဲမၩဘၪၥၭလိၪဆၧအလးထၪ့ထီၫလ ဖၪထီးအလး လၧၦလုဆၧလဖၪဆူၭခဲၩဆၧနၧၫ့မၧၫ့, လၧဂံဘၫ, ထီၩ့လၧဘံအၧၫၡံၫဘၫတၭ, မၩလၩ့ဎီးခွံၬ တရၫ့အလးထၪ့ထီၫလဖၪလၧ အအီၪဝ့ၫလၧဆၧလ့ၩ နုၬလၧဒိၩ့အၦဒိၪစယီရှုၫအ့ၫအတရၫ့ ဖၧၩ့လၧအအီၪ",
			"9": "<sup>9</sup> ဝ့ၫလၧဒိၩ့အတရၫ့စူၪစ့ၪလခီၫနီၪလီၫ.- မွဲလါနၫ့တၭ, ဆၧအလးထၪ့ထီၫလဖၪ အၡၩလုဆၧၥံၪဂဲၫထၪ့လၧ ယဟိဝၩအဆၧလုလးလၧ ယရုစလံၫ့အဖၧၩ့အ့ၬ. အ့ၪ မွဲအဝ့ၫၥံၪအၪ့ကိၪလအီၪဘၪ လၧမံၪလၧအထၧၫ့ဖုဝဲ အကျၩလီၫ.",
			"10": "<sup>10</sup> အဝ့ၫဒၪမၩဘၪၥၭလိၪထိဖ့ၭ လၧအအီၪဝ့ၫလၧၦ ဟံၪ့နၧၫ့ဖိၪအခိၪလီၩ့ဆူၭဖၧၩ့, ဘဲၫၦထီးဒုၭခၫ့ဂၬအ ဖိၪခွၫမွဲဂ့ၩ, ဖိၪမုၪမွဲဂ့ၩ, လၧမ့ၪလၧမိလ့ၭအဂးနးဂၩ",
			"11": "<sup>11</sup> လဂ့ၩလီၫ.- အဝ့ၫဒၪဆိၬထၪ့ခွံၬကၥ့ၪလဖၪ လၧယု ဒၫအစဎွၩလဖၪဖ့ၪလၫ့ဝ့ၫ လၧမုအဂးထီးဆၧလ့ၩနုၬ လၧယဟိဝၩအဂံၪ့ဖၧၩ့ လၧၦဒိၪစနၫၥၫ့မ့လ့ၭ အဒူၭ အနဲၩ့လၧအအီၪဝ့ၫလၧခီၫ့တၭ, ဆူၭထၪ့ခွံၬမုအလဲၪ့",
			"12": "<sup>12</sup> ကၥ့ၪလၧမ့ၪလီၫ.- တၭဆၧလုလးလဖၪ လၧအအီၪဝ့ၫ လၧစအၫဟဇၭအဒူၭ လၧထၭလခီၫလဆၫ့အဖၫ့ခိၪ, လၧယုဒၫအစဎွၩလဖၪမၩဝ့ၫ, ဒဲဆၧလုအလးလဖၪ လၧစမနၭစ့ၫမၩဝ့ၫလၧယဟိဝၩ အဂံၪ့အဝၩ့နံၫစီၪ့အ ဖၧၩ့နီၪစဎွၩမၩလၩ့ဎီးခွံၬဝ့ၫ, ဒဲမၩလၩ့ဘျ့ၭခွံၬဝ့ၫထီး နီၪတၭ,ခွံၬၡိၭခွံၬအမုၬ လၧထံၫချိၬကံဒၧၫ့အဖၧၩ့",
			"13": "<sup>13</sup> နီၪလီၫ.- တၭဆၧအလးထီၫလဖၪလၧအအီၪဝ့ၫလၧ ယရုစလံၫ့အမ့ၬယၫ လၧခိၪလီၩ့မၩဂၭဂီၩ့ဆၧလၧစူၪ ထွ့ၪလခီၫလၧအံၫစရ့လၭ အစဎွၩစီလမၧၫ့ၥုၪ့ဝ့ၫလၧ ၦဇဲဒၧၫ့ဖိၪအဆၧဘၪၥၭလိၪအၭၡတြီၭအဂး, ဒဲလၧ ၦမိအၭဖိၪအဆၧဘၪၥၭလိၪ, ခံမီၭအဂး, ဒဲလၧအၫ မၧၫ့ဖိၪအဆၧဘၪၥၭလိၪမိလ့ၭအဂးနီၪ, စဎွၩမၩဘၪ",
			"14": "<sup>14</sup> ၥၭလိၪဝ့ၫလီၫ.- အဝ့ၫဒၪမၩလၩ့ဘျ့ၭဆၧဂၩ့လဖၪ, ဒဲခူၬလၩ့ခွံၬအၡ့ရိၫလဖၪတၭ, မၩဎွ့ၩဝ့ၫအလးၥံၪလၧ ၦၡၩအဎွံၪအနၧၩ့လီၫ.",
			"15": "<sup>15</sup> ဆၧလုအလးအီၪဝ့ၫလၧဘ့ၥလၭဆ့, ဒဲဆၧအလး ထၪ့ထီၫလၧစနံဘၭအဖိၪခွၫစယ့ၫရဘိအၫ့ လၧအဒုၭ မၩအံၫစရ့လၭလၧဆၧဒဲၩဘၭ လဂၩမၩဝ့ၫနီၪ, အဝ့ၫ ဒၪမၩလၩ့ဎီးခွံၬ ဆၧလုအလးနီၪ, ဒဲဆၧအလးထၪ့ ထီၫတၭ, ဆူၭထၪ့ခွံၬ ဆၧအလးထၪ့ထီၫ, ဒဲယဲးလၩ့ ဘျ့ၭခွံၬဝ့ၫတၭ, ဆူၭထၪ့ခွံၬအၡ့ရိၫနီၪလီၫ.",
			"16": "<sup>16</sup> စယိၫစဲအၫကၠၪစိၩအၥၭတၭ, ဒၪဆၧၥွၪခိၪအီၪလၧ ခိၪလီၩ့,ဒဲအၪ့မၧၫ့လၩ့ဆၧ, မၩန့ထၪ့ၦဎွံၪၥံၪလၧဆၧ ၥွၪခိၪဖၧၩ့တၭ, ဆူၭထၪ့ခွံၬဝ့ၫလၧဆၧလုလးအဖၫ့ခိၪ တၭ,မၩဘၪၥၭလိၪဝ့ၫ, ဘဲၫယဟိဝၩအလူအထၫ,လၧ ယွၩအၡၩကိၭထၪ့လၧဆၧချဲၩ့လဖၪနီၪ အၥိၭလီၫ.",
			"17": "<sup>17</sup> ထီးနီၪလဖၧၫ့အဝ့ၫဒၪစံၭ, ဆၧမၩနဲၪ့လဖျိၪ့လၧယဒၪ ဘၪနီၪ,မွဲဆၧနီၪလမံၩ့လဲၪ. တၭဒိၩ့အၡၩၥံၪစံၭဝ့ၫ,မွဲ ယွၩအၡၩလၧအဂဲၫဝ့ၫလၧယုဒၫ, ကိၭထၪ့ဆၧလဖၪ လၧနမၩထၫ့ဒၩ ဆၧလုအလး လၧဘ့ၥလၭအဖၫ့ခိၪ",
			"18": "<sup>18</sup> လဂၩအဆၧၥွၪခိၪလီၫ.- အဆၧစံၭဝ့ၫဒၪမွဲအအီၪဒၪ ဝ့ၫဆံၭ. မွဲၦထီးၥုၭခွံၬ အဎွံၪအနၧၩ့နးဂၩလဂ့ၩ, အ ခိးမွဲဘဲၫနီၪတၭ, အဝ့ၫဒၪအဎွံၪအနၧၩ့ဒဲမီၪလၧအဂဲၫ ထၪ့လၧစမ့ရအၫလဂၩအဎွံၪအနၧၩ့နီၪ အဝ့ၫၥံၪမၩဘူၭ ဝ့ၫအ့ၬ.",
			"19": "<sup>19</sup> တၭဆၧအလးထၪ့ထီၫလဖၪအဂံၪ့ဆ့, လၧအအီၪ ဝ့ၫလၧစမ့ရအၫအဒိၩ့လဖၪ အဖၧၩ့လၧအံၫစရ့လၭအ စဎွၩလဖၪမၩဝ့ၫ ဘဲၫၥိၭအမိဒုၭၥၭထၪ့ယဟိဝၩနီၪ, စယိၫစဲအၫမၩန့ထၪ့ခွံၬဝ့ၫတၭ, မၩဝ့ၫဘဲၫကယဲဆၧ",
			"20": "<sup>20</sup> မၩလၧအမၩဝ့ၫလၧဘ့ၥလၭအဖၧၩ့လီၫ.- အဝ့ၫဒၪမၩ ၥံၫဆၧအလးထၪ့ထီၫ အၡၩလုဆၧလဖၪ လၧအအီၪ ထီးနီၪထီးအလူၬလၧဆၧလုလး အဖၫ့ခိၪတၭ,ဆူၭထၪ့ ခွံၬအဎွံၪအနၧၩ့လၧအဖၫ့ခိၪတၭ, ထဲၩ့ကဒၩထဲၩ့လၧ ယရုစလံၫ့လီၫ.",
			"21": "<sup>21</sup> စဎွၩမၪလူၬၦခမျၧးထီးအလူၬတၭ, စံၭဝ့ၫဒၪ,ထီး န့ဘိၪ့လ့ၩဖၬလၧယဟိဝၩ နၥံၪအယွၩအဂး, ဘဲၫဆၧ",
			"22": "<sup>22</sup> ကွ့ၭအၥၭလၧလံၬဆၧအုၩ့လၩ့အဖၧၩ့နီၪဆံၭ.- မွဲတ ၡါၦလမၩဘၪဘိၪ့လ့ၩဖၬ ဘဲၫနီၪအၥိၭခီၫလၧၦစ့ၩ ရၫ့ခွးၥံၪလၧအစ့ၩရၫ့အံၫစရ့လၭ အမုနံၩလဖၪနီၪ,မွဲ ဂ့ၩ,လၧအံၫစရ့လၭအစဎွၩဒဲ လၧယုဒၫအစဎွၩထီးအ",
			"23": "<sup>23</sup> လူၬနီၪမွဲဂ့ၩ, အီၪနးဖၧၫ့အ့ၬ.- တၭလၧစယိၫစဲအၫအ နံၪ့လဆံၫဎိၭနံၪ့လနံၪ့အဖၧၩ့နီၪ ၦမၩဘိၪ့လ့ၩဖၬလ ဖၧၫ့ယီၩ လၧယဟိဝၩအဂး လၧယရုစလံၫ့အဖၧၩ့ လီၫ.",
			"24": "<sup>24</sup> တၭၦလၧအအိၭလိၬအၥၭ လၧၦအီၪလၧဆၧနၪၥံၪ,ဒဲ ဆၧယူၬၥံၪ, ဒဲဆၧဂၩ့တ့ၫရဖံၫ့, ဒဲဆၧဂၩ့ဆၧဖၪ့,ဒဲက ယဲဆၧဘၪၥၭလိၪ လၧအဒၪဝ့ၫလၧယုဒၫအခးဖၧၩ့,ဒဲ လၧယရုစလံၫ့အဖၧၩ့ထီးအလူၬနီၪ, စယိၫစဲအၫၥုၭခွံၬ ဝ့ၫဘဲၫၥိၭအမိထီးန့လံၬဆၧၥီၪ့ဆၧၥၫ့ အဆၧချဲၩ့လၧ အကွ့ၭအၥၭလၧလံၬ လၧၦလုဆၧစဟံၫလကဲအၫဒၪန့ ဘၪဝ့ၫလၧယဟိဝၩအဂံၪ့ဖၧၩ့နီၪလီၫ.",
			"25": "<sup>25</sup> တၭစဎွၩလၧအကၠၪစိၩအၥၭ လၧယဟိဝၩအအီၪ လၧအၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲလၧအၥၭၡီၩ့ထီးအလူၬ,ဒဲ လၧအဂဲးအဘၭထီးအလူၬ, ဘဲၫစမိစ့ၭအဆၧၥီၪ့ဆၧ ၥၫ့ထီးအလူၬအၥိၭနီၪ, မီၪ့ဎီၩ့အဝ့ၫနီၪ လၧအဝ့ၫလ ချႃၭအီၪဒံၭဘၪမွဲဂ့ၩ, လၧအဝ့ၫဒၪအလးခဲၫ့မွဲဂ့ၩ, အီၪ",
			"26": "<sup>26</sup> နးဂၩအ့ၬ.- မွဲလါနၫ့ဘဲၫနီၪတၭ ယဟိဝၩလကၠၪခွံၬ ဘၪအၥၭလၧအဆၧၥၭထၪ့ဆီၪ့ဆီၪ့လ့ၬ လၧအခဲၩထၪ့ ထၫ့ဒုၪဒၩယုဒၫလၧဆၧၥၭထၪ့ ထီးအလူၬအလးလၧ စမနၭစ့ၫဒုၭထၪ့ဝ့ၫအၥၭ အကၠီၩ့နီၪလီၫ.",
			"27": "<sup>27</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, ယမိၥုၭခွံၬယုဒၫလၧယမ့ၬယၫ ဆ့,ဘဲၫယၥုၭခွံၬအံၫစရ့လၭအၥိၭနီၪတၭ, ယမိခွံၬၡိၭ ဒိၩ့ယရုစလံၫ့လဖျိၪ့ယီၩ လၧယရွံန့ဝ့ၫ, ဒဲဂံၪ့လၧယ စံၭလၧအဂဲး, ယမံၩ့မိအီၪထီးနီၪလီၫ.",
			"28": "<sup>28</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစယိၫစဲအၫ,ဒဲက ယဲဆၧလၧအမၩဝ့ၫထီးအလူၬနီၪ ကွ့ၭအၥၭလၧယုဒၫ အစဎွၩၥံၪအလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.",
			"29": "<sup>29</sup> လၧမုနံၩလဖၪနီၪ အံဇံၭအစဎွၩ ဖၫရိၫနံကိၫလ့ၩထၪ့ ထၫ့ဒၩအစံရအၫအစဎွၩ လၧထံၫမိၡါယုၫဖ့ထံၫ,ဒဲ စဎွၩယိၫစဲအၫလ့ၩထၫ့ဒၩ အဝ့ၫဒၪတၭ, ထီးဆၧဒၪ",
			"30": "<sup>30</sup> ဘၪဝ့ၫတၭ, မၩၥံၫဝ့ၫထီးမဂံၭဒိၫအဖၧၩ့လီၫ.- အခ့ၫ အၡၩဆိၬထၪ့ဝ့ၫတၭ, ၥံၫဝ့ၫလၧလဲၪ့ၥုၭအဖၧၩ့လၧမ ဂံၭဒိၫတၭ,ဂဲၫဆိၬဝ့ၫလၧ ယရုစလံၫ့တၭ, ခုၪ့လၩ့ဘၧၩ့ ခွံၬဝ့ၫလၧအၥွၪခိၪဒၪဝ့ၫအဖၧၩ့လီၫ. တၭထံၫၥံၪခးၥံၪ အၡၩခမျၧးမၩန့စယိၫစဲအၫ အဖိၪခွၫစယဟိအဟၭ တၭ,ဂုၪဝ့ၫတၭ, အီၪက့ၪထၪ့ဝ့ၫလၧစဎွၩလၧအဖါအ လးနီၪလီၫ.",
			"31": "<sup>31</sup> လၧစဟိအဟၭကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪနံၫဆံၫၥၧၫ့ နံၪ့တၭ, ကဲၪစဎွၩလၩၥၧၫ့ဘံၪ့ လၧယရုစလံၫ့အဖၧၩ့ လီၫ.တၭအမိအမံၩ့မွဲနးဟၫမုတလၭ, စယ့ၫရမဲအၫ",
			"32": "<sup>32</sup> လၧလံၭဘနၫလဂၩ အဖိၪမုၪလီၫ.- အဝ့ၫဒၪမၩဆၧ အၧၩ့လၧယဟိဝၩအမ့ၬယၫ ဘဲၫကယဲဆၧလၧအဖါ",
			"33": "<sup>33</sup> လဖၪမၩဝ့ၫအၥိၭနီၪလီၫ.- ဘဲၫၥိၭအထီးပၧၩ့ဆၧ လၧယရုစလံၫ့အဖၧၩ့နီၪလဂ့ၩ, ဖၫရိၫနံကိၫစၧၩ့ထၬ ဝ့ၫလၧရံၭဘျၫအဖၧၩ့ လၧခးဟၫမၭအဖၧၩ့တၭ, အၪ့ မၧၫ့ၦခးဖိၪၥံၪဖ့ၪလၫ့အခီၫ့ လၧစ့ၩအကံကၫလယၩ, ဒဲထီၫ့လကံကၫလီၫ.",
			"34": "<sup>34</sup> ဖၫရိၫနံကိၫအီၪက့ၪစယိၫစဲအၫ အဖိၪခွၫစအံၫလဲအ ကံၫ့လၧစဎွၩ လၧအဖါစယိၫစဲအၫအလးတၭ, ဖျိၬဝ့ၫ အမံၩ့လၧစယဟီအကံၫ့တၭ, မၩန့ခွံၬစယဟိအဟၭ တၭ, အဝ့ၫဒၪဂဲၫဝ့ၫလၧအံဇံၭတၭ, ၥံၫဝ့ၫထီးနီၪ လီၫ.",
			"35": "<sup>35</sup> စယဟီအကံၫ့ဖ့ၪလၫ့စ့ၩ, ဒဲထီၫ့လၧဖၫရိၫလါနၫ့တၭ, အၪ့ကံၩ့အခီၫ့လၧၦခးဖိၪ ဘဲၫၥိၭအမိဖ့ၪလၫ့စ့ၩ ဘဲၫ ဖၫရိၫအဆၧမၩလူၬအၥိၭနီၪတၭ, အၪ့မၧၫ့ထံၫၥံၪခး ၥံၪအၡၩခမျၧးဖ့ၪလၫ့စ့ၩဒဲ ထီၫ့လဂၩဘဲၫအခီၫ့အၥိၭ, လဂၩဘဲၫအခီၫ့အၥိၭ, ဘဲၫအမိဖ့ၪလၫ့ဝ့ၫ လၧဖၫရိၫနံ ကိၫလီၫ.",
			"36": "<sup>36</sup> လၧစယဟီအကံၫ့ကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪနံၫဆံၫ ယဲနံၪ့တၭ, ကဲၪစဎွၩလဆံၫလနံၪ့လၧယရုစလံၫ့အဖၧၩ့ လီၫ. အမိအမံၩ့မွဲနးဇံၫဘုဒၫ, စပဒၫယၫအဖိၪမုၪလၧ",
			"37": "<sup>37</sup> ရုမၫလီၫ.- အဝ့ၫဒၪမၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬ ယၫဘဲၫကယဲဆၧလၧ အဖါၥံၪမၩဝ့ၫအၥိၭနီၪလီၫ."
		},
		"24": {
			"1": "<sup>1</sup> လၧအဝ့ၫဒၪအမုနံၩလဖၪ အထးဖၧၩ့နီၪဘၭဘ လၧၫ့ အစဎွၩန့ၭဘူၫခၫန့ဇၫဂဲၫထၪ့တၭ, စယဟီအကံၫ့ ကဲၪ ထၪ့အခ့ၫအၡၩၥၧၫ့နံၪ့တၭ, ထီးနီၪလဖၧၫ့, ကၠၪခွံၬ",
			"2": "<sup>2</sup> အၥၭပိၩ့ထၪ့ဝ့ၫလီၫ.- တၭယဟိဝၩအၪ့မၧၫ့ဆၧလ့ၩ ထၫ့ ဒၩအဝ့ၫနီၪ, မွဲၦခၫလဒံအၫဖိၪအဒီၪ့လဖၪ, ဒဲၦစံ ရအၫ ဖိၪအဒီၪ့လဖၪ, ဒဲၦမိအၭဖိၪအဒီၪ့လဖၪ, ဒဲၦအၫမၧၫ့ဖိၪ အဒီၪ့လဖၪတၭ, ဆၧအၪ့မၧၫ့လၩ့အ ဝ့ၫၥံၪ ထၫ့ဒၩယု ဒၫဘဲၫၥိၭအမိမၩဂၭဂီၩ့ဝ့ၫ, ဘဲၫ ယဟိဝၩအလူအထၫ လၧအချဲၩ့ဝ့ၫလၧအခ့ၫအၡၩ",
			"3": "<sup>3</sup> မီၪၥံၪအစူၪဖၧၩ့အၥိၭနီၪလီၫ.- မွဲမၬ, ဆၧဂဲၫဘၪယုဒၫ လၧယဟိဝၩအဆၧမၪ လူၬဘဲၫၥိၭအမိၥုၭခွံၬဝ့ၫလၧ အမ့ၬယၫလၧစမနၭစ့ၫ အဆၧဒဲၩဘၭအကၠီၩ့ ဘဲၫ",
			"4": "<sup>4</sup> ကယဲဆၧလၧအမၩဝ့ၫအၥိၭနီၪ,- ဒဲလၧဆၧၥွံၪ လၧ ဆၧဒဲၩဘၭလအီၪဘၪလၧ အလူၫလၩ့ဝ့ၫ လၧယဟိ ဝၩလဖျါခွံၬဘၪဝ့ၫ အကၠီၩ့နီၪလီၫ. အဂဲးဘဲၫယီၩ အ ဝ့ၫဒၪမၩဎွ့ၩထၪ့ ယရုစလံၫ့ လၧဆၧၥွံၪလၧဆၧဒဲၩဘၭ လအီၪဘၪနီၪလီၫ.",
			"5": "<sup>5</sup> ဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စယဟီအကံၫ့,ဒဲကယဲ ဆၧလၧအမၩဝ့ၫ ထီးအလူၬနီၪကွ့ၭအၥၭ လၧယုဒၫ",
			"6": "<sup>6</sup> အစဎွၩအလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.- စယ ဟီအကံၫ့,မံၫဝ့ၫလၧအဖါၥံၪအၥိၭတၭ, အဖိၪခွၫစယ ဟီအခံၫ့ကဲၪထၪ့စဎွၩလၧအလးလီၫ.",
			"7": "<sup>7</sup> တၭအံဇံၭအစဎွၩ စဲၪ့ထၪ့ခွံၬလၧၩ့လၧအခးဒၪဝ့ၫ အဖၧၩ့အ့ၬ. အဂဲးဘဲၫယီၩဘၭဘလၧၫ့အစဎွၩမၩန့ ကယဲဆၧဘၪဆဲၫ့ လၧအံဇံၭအစဎွၩ ပၧၩ့ဝ့ၫနီၪ, လၧ အံဇံၭအထံၫမိၡါ ထီၩ့လၧယုၫဖ့ထံၫ အထံၫမိၡါနီၪ လီၫ.",
			"8": "<sup>8</sup> လၧစယဟီအခံၫ့ကဲၪၥၫ့စဎွၩနီၪ အၥၭအီၪလဆံၫ ဎိၭနံၪ့တၭ,ကဲၪစဎွၩလၩၥၧၫ့ဘံၪ့ လၧယရုစလံၫ့အဖၧၩ့ တၭ,အမိအမံၩ့မွဲနးနံၫဟုၡတၫ, စအ့လနၫၥၫ့အဖိၪ",
			"9": "<sup>9</sup> မုၪလၧယရုစလံၫ့လီၫ.- အဝ့ၫဒၪမၩဆၧအၧၩ့လၧယ ဟိဝၩအမ့ၬယၫ ဘဲၫကယဲဆၧလၧအဖါမၩဝ့ၫအၥိၭနီၪ လီၫ.",
			"10": "<sup>10</sup> အဆၧၫ့အထီထီးနီၪဘၭဘလၧၫ့ အစဎွၩန့ၭဘူၫခၭ န့ဇၫအခ့ၫအၡၩဂဲၫထၫ့ဒၩ ယရုစလံၫ့တၭ,ဒိၩ့ဘၪဆၧ",
			"11": "<sup>11</sup> ဝၩ့ထၬဝ့ၫလီၫ.- ဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫဂဲၫ",
			"12": "<sup>12</sup> ထၫ့ဒၩဒိၩ့တၭ, အခ့ၫအၡၩဝၩ့ထၬဝ့ၫလီၫ.- တၭယုဒၫ အစဎွၩယဟီအခံၫ့ဂဲၫထၪ့ လၧဘၭဘလၧၫ့အစဎွၩအ အီၪ,အဝ့ၫဒၪအမိ, ဒဲအခ့ၫအၡၩလဖၪ, ဒဲအၦဒိၪဖၭဒိၪ လဖၪ,ဒဲအၦဒိၪလဖၪတၭ, လၧအကဲၪစဎွၩဎိၭနံၪ့လ",
			"13": "<sup>13</sup> နံၪ့နီၪဘၭဘလၧၫ့အစဎွၩ မၩန့ဝ့ၫလီၫ.- ဆိၬန့ခွံၬထီး နီၪကယဲဆၧလူဒိၪဎွ့ၩဒိၪ လၧယဟိဝၩအဂံၪ့ဖၧၩ့,ဒဲ ဆၧလူဒိၪဎွ့ၩဒိၪလၧစဎွၩအဂံၪ့ဖၧၩ့တၭ, ဒၪ့ဘျ့ၭခွံၬ ကယဲဆၧအထွ့ၫထီၫ့လဖၪ လၧအံၫစရ့လၭ အစဎွၩ စီလမၧၫ့မၩကဲၪထၪ့ဝ့ၫ လၧယဟိဝၩအနီးဖၧၩ့, ဘဲၫ",
			"14": "<sup>14</sup> ယဟိဝၩစံၭဝ့ၫအၥိၭနီၪလီၫ.- တၭဆိၬထၪ့ခွံၬအၪ့ မၧၫ့ဎီးယရုစလံၫ့ဖိၪ ထီးအလူၬ, ဒဲၦအဆီၪ့ၦၥုၭဖိၪ ထီးအလူၬ, ၦကဲၪဎီးလလၬ, ဒဲကယဲၦမၩဆၧၥ့ၪ,ဒဲၦ ထမၬၥံၪထီးအလူၬလီၫ. လၧခးအၡၩ ခမျၧးအကျၩ နီၪ,အီၪလၩ့ထးန့ၫၦၡၪ့ဖိၪယၬဖိၪလီၫ.",
			"15": "<sup>15</sup> အဝ့ၫဒၪဆိၬထၪ့ခွံၬ စယဟီအခံၫ့ထီၩ့ လၧဘၭဘ လၧၫ့,ဒဲစဎွၩအမိ, ဒဲစဎွၩအမၫလဖၪ, ဒဲၦဒိၪလဖၪ,ဒဲ ထံၫၥံၪခးၥံၪအၡၩဆီၪ့လဖၪလီၫ. ဆိၬထၪ့ခွံၬဝ့ၫလၧ ယရုစလံၫ့ထီၩ့လၧဘၭဘလၧၫ့တၭ, အၪ့မၧၫ့ဎီးဝ့ၫဒၪ",
			"16": "<sup>16</sup> လီၫ.- ကယဲၦၥထံၫနွ့ၫထီၫ့,ဒဲၦမၩဆၧၥ့ၪ,ဒဲၦထမၬၥံၪ လထီၫ့,ကယဲၦလၧအအီၪဆီၪ့ ၦၥုၭဖိၪထီးအလူၬနီၪ ဘၭဘလၧၫ့ အစဎွၩဂဲၫဆိၬအၪ့မၧၫ့ဎီး လၧဘၭဘ",
			"17": "<sup>17</sup> လၧၫ့နီၪလီၫ.- တၭဘၭဘလၧၫ့ အစဎွၩဒုၭကဲၪအဖါ အထၧၫ့ဖုဝဲစမၭတနဲအၫလၧ စဎွၩလၧအလးတၭ,ဖျိၬ ဝ့ၫအမံၩ့အၥၫ့ လၧစဇ့ၭဒကဲအၫလီၫ.",
			"18": "<sup>18</sup> လၧစဇ့ၭဒကဲ အၫကဲၪထၪ့ၥၫ့စဎွၩနီၪ အၥၭအီၪ နံၫဆံၫလနံၪ့တၭ, ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့ လ ဆံၫလနံၪ့တၭ,အမိအမံၩ့မွဲနးဟၫမုတလၭ, မွဲစယ့ၫ",
			"19": "<sup>19</sup> ရမဲအၫလၧလံၭဘနၫအဖိၪမုၪလီၫ.- အဝ့ၫဒၪမၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬယၫ,ဘဲၫကယဲဆၧလၧ စယဟီအခံၫ့",
			"20": "<sup>20</sup> မၩဝ့ၫအၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩ လၧယဟိဝၩ အၥၭထၪ့အကၠီၩ့ နီၪဆၧမၩအၥၭလၧယရုစလံၫ့, ဒဲလၧယုဒၫအဖၧၩ့ထီး အနၫ့ထၪ့ခွံၬအဝ့ၫၥံၪ လၧအမ့ၬ ယၫတၭ, စဇ့ၭဒကဲအၫပိၩ့ထၪ့ဘၭဘလၧၫ့အစဎွၩနီၪ လီၫ."
		},
		"25": {
			"1": "<sup>1</sup> တၭလၧအကဲၪစဎွၩ အနံၪ့ခွံၫနံၪ့လနံၪ့လၧလၩဆံၫ ဘံၪ့လဘံၪ့လၩထၪ့ဆံၫနံၩလနံၩနီၪ, ဆၧမၩအၥၭ လၧဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၭန့ဇၫ ဂဲၫထၫ့ဒၩယ ရုစလံၫ့, အဝ့ၫဒၪဒဲအၡၩၥုၭမုခမျၧးထီးအလူၬတၭ, ၥုၪ့တဲၩထၫ့ဒၩဝ့ၫ, မၩထၪ့ထိၬလဖၪထၫ့ဒၩအီၪဖီၩ့ဝ့ၫ",
			"2": "<sup>2</sup> ဝၬဝၬလီၫ.- တၭဒိၩ့နီၪဘၪဆၧဝၩ့ထၬဝ့ၫထီးအဘၪ",
			"3": "<sup>3</sup> စဎွၩဇ့ၭဒကဲအၫအနံၪ့လဆံၫလနံၪ့နီၪလီၫ.- တၭလၩ ထၪ့ခွံၫနံၩလနံၩနီၪ ဆၧၥၭဝံလၩ့ဒိၩဆီၪ့ထၪ့ဝ့ၫလၧ ဒိၩ့ဖၧၩ့တၭ, ကိၪအီၪလၧခးအၡၩခမျၧးအဂးအ့ၬ.",
			"4": "<sup>4</sup> ဒိၩ့နီၪဂၭဂီၩ့ဝ့ၫတၭ, ကယဲၦၥုၭဖိၪထီးအလူၬစဲၪ့ထၪ့ ခွံၬဝ့ၫလၧမုနၩလခီၫ လၧတရၫ့အဖၧၩ့ၥၭ လၧအအီၪ လၧဆၧခိၪဒၧၩ့နံၫစီၪ့ အဘိၩ့ဆၧၩ့လၧအအီၪဝ့ၫလၧ စဎွၩအကျိၭအနဲၩ့ထံၭနီၪလီၫ. တၭၦခၫလဒံအၫဖိၪ အီၪဝၬဖီၩ့ထၫ့ဒၩဒိၩ့နီၪတၭ, စဎွၩလ့ၩလၧဖၧၩ့ၥၭ",
			"5": "<sup>5</sup> တီၩလၧဆၧပျၩ့ဖၧၩ့လခီၫလီၫ.- ၦခၫလဒံအၫဖိၪၥုၭမု ခမျၧးၥံၪလီၩ့ဆီးစဎွၩတၭ, ချႃၭန့ဝ့ၫလၧယ့ၫရခိၫအ ဆၧပျၩ့ဖၧၩ့တၭ, အၡၩၥုၭမုခမျၧးထီးအလူၬနီၪလၩ့",
			"6": "<sup>6</sup> ပြံၩလၩ့ပၩခွံၬလၧအဝ့ၫလီၫ.- အဝ့ၫၥံၪဖီၪ့န့စဎွၩဂဲၫ ထဲၩ့ဆိၬဝ့ၫလၧဘၭဘလၧၫ့ အစဎွၩအအီၪလၧရံၭ",
			"7": "<sup>7</sup> ဘျၫအဖၧၩ့တၭ,အဝ့ၫၥံၪစ့ၩရၫ့အဝ့ၫလီၫ.- အဝ့ၫၥံၪမၩ ၥံၫစဇ့ၭဒကဲအၫအဖိၪခွၫ လဖၪလၧအမ့ၬယၫတၭ,အီၩ့ ခွ့ၭထၪ့ခွံၬစဇ့ၭဒကဲအၫအမ့ၬၥၪတၭ, စၧၩ့ထၬဝ့ၫလၧ ၥွ့ၫထၭထီးဘၩ့တၭ, ဆိၬန့အဝ့ၫထီၩ့လၧဘၭဘလၧၫ့ နီၪလီၫ.",
			"8": "<sup>8</sup> လၩယဲဘံၪ့လဘံၪ့လၩထၪ့ နွ့ၫနံၩလနံၩနီၪ,လၧအ မွဲဘၭဘလၧၫ့အစဎွၩန့ၭဘူၫခၫန့ဇၫ, အနံၪ့ထၪ့လဆံၫ ခွံၫနံၪ့လနံၪ့နီၪ, ဘၭဘလၧၫ့အစဎွၩ အခ့ၫအၡၩ,ၦပၧၩ့ ဆၧအခိၪစန့ၭဘူၫဇၫရဒၫ့ဂဲၫဝ့ၫ လၧယရုစလံၫ့အဖၧၩ့",
			"9": "<sup>9</sup> လီၫ.- အဝ့ၫဒၪဆူၭထၪ့ခွံၬယဟိဝၩအဂံၪ့, ဒဲစဎွၩအ ဂံၪ့လၧယရုစလံၫ့အဖၧၩ့ ထီးအလူၬတၭ, ကယဲၦအဒိၪ",
			"10": "<sup>10</sup> ထီးအလူၬအဂံၪ့နီၪဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪလီၫ.- တၭၦ ခၫလဒံအၫဖိၪအၡၩၥုၭမုထီးအလူၬ လၧအအီၪဝ့ၫလၧ ၦခိၭဆၧအခိၪနီၪ, မၩလၩ့ဎီးခွံၬယရုစလံၫ့အခိၪဒၧၩ့",
			"11": "<sup>11</sup> ဝၬဖီၩ့ဝ့ၫလီၫ.- ၦခမျၧးလၧအအီၪ လၩ့ထးလၧဒိၩ့ ဖၧၩ့,ဒဲၦစဲၪ့ဖျိၭလဖၪလၧအစဲၪ့ဒၪဆၧလၧဘၭဘလၧၫ့ အစဎွၩအအီၪ ဒဲၦခမျၧးအဆၧအီၪလၩ့ထးနီၪ ၦပၧၩ့ ဆၧအခိၪစန့ၭဘူၫဇၫရဒၫ့ ဆိၬအၪ့မၧၫ့ ဎီးဝ့ၫလီၫ.",
			"12": "<sup>12</sup> အ့ၪမွဲၦခးဖိၪအၡၪ့အယၬ လဖၪနီၪၦခိၭဆၧအခိၪအီၪ လၩ့ထးဝ့ၫဘဲၫၥိၭအမိကဲၪထၪ့ ၦမၩစဘံၭအလး,ဒဲၦ မၩကၩလၧဂၪ့ခိၪနီၪလီၫ.",
			"13": "<sup>13</sup> တၭထုၪ့ထီးဘၩ့လဖၪ လၧအအီၪလၧယဟိဝၩအ ဂံၪ့ဖၧၩ့,ဒဲဆၧအခၪ့လဖၪ, ဒဲကမၫထီးဘၩ့လၧအအီၪ ဝ့ၫလၧယဟိဝၩအဂံၪ့ဖၧၩ့နီၪ, ၦခၫလဒံအၫဖိၪမၩခါ ခွံၬဝ့ၫတၭ, ဆိၬန့ခွံၬထီးဘၩ့လၧဘၭဘလၧၫ့နီၪလီၫ.",
			"14": "<sup>14</sup> တၭဖၧၩ့ၥံၪ, ဒဲဎ့ၬချီၩ့ၥံၪ, ဒဲထၭထံၬမ့ၪၥံၪ, ဒဲနိၪထိၩ့ ၥံၪ,ဒဲကယဲဆၧအဎၧၩ့အဎီ ထီးဘၩ့လၧၦမၩဆၧလၧ",
			"15": "<sup>15</sup> အဝ့ၫထီးအလူၬနီၪ အဝ့ၫၥံၪဆိၬန့ခွံၬဝ့ၫလီၫ.- တၭ ဖၧၩ့မ့ၪၥံၪ,ဒဲထွ့ၫၥံၪ ဒဲဆၧလၧၦမၩလၧထီၫ့မွဲထီၫ့,ဒဲ",
			"16": "<sup>16</sup> လၧစ့ၩမွဲစ့ၩ, ၦခိၭဆၧအခိၪဆိၬန့ခွံၬဝ့ၫလီၫ.- ထုၪ့နံၫ ထုၪ့,ဒဲကမၫနီၪ ဒဲဆၧအခၪ့ၥံၪလၧစစီလမၧၫ့မၩကဲၪ ထၪ့ဝ့ၫလၧယဟိဝၩအဂံၪ့အဂးနီၪ, ဆၧထီးအလူၬအ",
			"17": "<sup>17</sup> ထီးဘၩ့အလယၧးအီၪအ့ၬ.- ထုၪ့လထုၪ့အထီၫမွဲလ ဆံၫဎိၭဖျါတၭ, အခိၪစီၪ့လၧအဖၫ့ခိၪမွဲထီးဘၩ့, အခိၪ အထီၫမွဲၥၧၫ့ဖျါ, ဒဲဆၧၥံၪအၥၭ, ဒဲၥလဲၩၥၪလၧအခိၪ ဝၬဖီၩ့ဝ့ၫနီၪ, မွဲထီးဘၩ့ထီးအလူၬလီၫ. တၭဘဲၫအဝ့ၫ ၥံၪအၥိၭနီၪ ထုၪ့နံၫထုၪ့ လထုၪ့ဒၪနီၪအီၪလၧဆၧၥံၪ အၥၭလီၫ.",
			"18": "<sup>18</sup> တၭၦခိၭဆၧအခိၪ မၩန့ၦလုဆၧအခိၪ စစံၫရအဲ အၫ,ဒဲၦလုဆၧနံၫဂၩလဂၩစဇ့ၭဖနဲအၫ, ဒဲၦပၧၩ့တ",
			"19": "<sup>19</sup> ရၫ့ၥၧၫ့ဂၩလီၫ.- တၭလၧဒိၩ့ဖၧၩ့နီၪအဝ့ၫမၩန့ၦဒိၪ လဂၩလၧအအီၪဝ့ၫ လၧၦၥုၭဖိၪအဖၫ့ခိၪ, ဒဲၦယဲဂၩ လၧအအီၪဒၪအဆၧလၧစဎွၩ အမ့ၬယၫလၧအဒၪန့ဝ့ၫ လၧဒိၩ့ဖၧၩ့တၭ, ၦၥုၭမုခမျၧးအၡၩ ၦကွ့ၭလံၬအခိၪ လၧအဒုၭအီၪကီၪ့ခးၥံၪအၡၩခမျၧး, ဒဲၦဎူၫဆံၫလၧခး",
			"20": "<sup>20</sup> အၡၩခမျၧးအကျၩလၧအဒၪန့ဝ့ၫလၧဒိၩ့ဖၧၩ့လီၫ.- ၦ ခိၭဆၧအခိၪစန့ၭဘူၫဇၫရဒၫ့ မၩန့အဝ့ၫၥံၪနီၪတၭ,ဂဲၫ ဆိၬဝ့ၫလၧဘၭဘလၧၫ့အစဎွၩအအီၪ လၧရံၭဘျၫအ",
			"21": "<sup>21</sup> ဖၧၩ့နီၪလီၫ.- ဘၭဘလၧၫ့အစဎွၩကျီၪ့ခွံၬဝ့ၫတၭ, မၩ ၥံၫဝ့ၫလၧရံၭဘျၫအီၪလၧခးဟၫမၭ အဖၧၩ့နီၪလီၫ. ယုဒၫဘၪဆၧဆိၬထၪ့ခွံၬဝ့ၫ လၧအထံၫအခးဒၪဝ့ၫဘဲၫ နီၪၥိၭလီၫ.",
			"22": "<sup>22</sup> ၦခမျၧးလၧအအီၪလၩ့ထး လၧခးယုဒၫအဖၧၩ့လၧ ဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၫခၭန့ဇၫ အီၪက့ၪလၩ့ထး ဝ့ၫနီၪ,အဝ့ၫဒၪအီၪက့ၪစၡၫဖၫ့အဖိၪခွၫ စအဟဲကၫ့အ ဖိၪခွၫ,စဂ့ၭဒလဲအၫလၧအခိၪ လၧၦၡၩလဖၪနီၪအဖၫ့ ခိၪလီၫ.",
			"23": "<sup>23</sup> ထီးၦၥုၭမုခမျၧးအခိၪထီးအလူၬလဖၪနီၪ, အဝ့ၫၥံၪ ဒဲအၡၩလဖၪနါဂၧၫ့ဝ့ၫလၧဘၭဘလၧၫ့ အစဎွၩအီၪ က့ၪစဂ့ၭဒလဲအၫလၧဆၧအခိၪတၭ, ၦဂဲၫလၧစဂ့ၭဒလဲ အၫအအီၪလၧမံဇပၫအဖၧၩ့ လၧန့ၭၥနဲအၫအဖိၪခွၫ စအံၫၡမၫအ့လၭ, ဒဲစကရံအၫအဖိၪခွၫစယိၫဟၫနၫ့, ဒဲၦနတီၭဖၥဲၭဖိၪ, စတၫ့ဟုမ့ၭအဖိၪခွၫစစံၫရအဲအၫ, ဒဲၦမၫအကၭဖိၪလဂၩအဖိၪခွၫ စယအၭဇနဲအၫ အ",
			"24": "<sup>24</sup> ဝ့ၫၥံၪဒဲအၡၩၥံၪလီၫ.- တၭစဂ့ၭဒလဲအၫဆိၪလၩ့အ ၥၭလၧအဝ့ၫၥံၪဒဲအၡၩၥံၪတၭ, စံၭဝ့ၫ,နၥံၪကဲၪထၪ့ၦ ခၫလဒံအၫဖိၪအခ့ၫအၡၩနီၪ အၪ့ယိၪလဂ့ၩ, အီၪလၧ ခးဖၧၩ့,ဒဲမၩဘၭဘလၧၫ့အစဎွၩ အဆၧမၩဆံၭ.တၭ",
			"25": "<sup>25</sup> နၥံၪမိဘီၪထၪ့ယီၫထၪ့လီၫ.- အ့ၪမွဲလၧလၩနွ့ၫဘံၪ့လ ဘံၪ့အဖၧၩ့နီၪစဎွၩအချံၫအၥၪ စအံၫလံၭၡမၫအဖိၪ ခွၫစန့ၭၥနဲအၫအဖိၪခွၫစအံၫၡမၫအ့လၭ, ဂဲၫဝ့ၫတၭ, ၦဆံၫဂၩအီၪလၧအၥိၭ, ကျီၪ့ခွံၬစဂ့ၭဒလဲအၫတၭ,အ ဆၧၥံၫဝ့ၫ,ဒဲၦယုဒၫဖိၪ, ဒဲၦခၫလဒံအၫဖိၪလၧအအီၪ",
			"26": "<sup>26</sup> လၧအၥိၭလၧမံဇပၫအဖၧၩ့လီၫ.- ၦခမျၧးထီးအလူၬ, ဒဲဒိၪဒဲဆံၭ ဒဲၦၥုၭမုခမျၧးအခိၪလဖၪဂဲထုၪ့တၭ, လ့ၩ လၧအံဇံၭအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪၥၭမဲၪၦ ခၫလဒံအၫဖိၪလီၫ.",
			"27": "<sup>27</sup> လၧယုဒၫအစဎွၩ ယဟီအခံၫ့ ကဲၪဎီးၥၧၫ့ဆံၫနွ့ၫနံၪ့ လနံၪ့အဖၧၩ့နီၪလၩလဆံၫနံၫဘံၪ့လဘံၪ့, လၩထၪ့နံၫ ဆံၫနွ့ၫနံၩလနံၩနီၪ, ဆၧမၩအၥၭလၧဘၭဘလၧၫ့အစ ဎွၩစအံဝ့ၫမရီဒၭကဲၪၥၫ့စဎွၩလနံၪ့နီၪတၭ, ဘိၭထၪ့ ယုဒၫအစဎွၩ ယဟီအခံၫ့အခိၪဎွံၪထုၭထၪ့ခွံၬဝ့ၫလၧ",
			"28": "<sup>28</sup> ထီၫ့ဖၧၩ့လီၫ.- ချဲၩ့ဆၧမုၬမုၬလၧအဝ့ၫတၭ, အီၪက့ၪ အလးဆီၩ့ဆီထီၫနဲၪ့စဎွၩလဖၪအလးဆီၩ့ဆီလၧအ",
			"29": "<sup>29</sup> အီၪလၧအၥိၭလၧဘၭဘလၧၫ့အဖၧၩ့နီၪလီၫ.- တၭ အၪ့လဲၩခွံၬအထီၫ့အဆၧကီၩ့ဆၧၥိၭတၭ, အဆၧအၪ့",
			"30": "<sup>30</sup> ကိၪလၧအမ့ၬယၫလထံၪဎး လဆိၩဒၪအၥၭလီၫ.- တၭ အဆၧအၪ့နၩ့ဖၭနီၪ မွဲဆၧဖ့ၪလၫ့လၧစဎွၩဖ့ၪလၫ့ဝ့ၫ လထံၪဎး, ဆၧလၧလနံၩအဂးလနံၩအဂး လဆိၩဒၪ အၥၭလီၫ."
		}
	}
};
module.exports = book;